/*Table structure for table `employee` */

DROP TABLE IF EXISTS `employee`;

CREATE TABLE `employee` (
  `emp_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '员工id',
  `emp_no` char(20) NOT NULL COMMENT '员工账号',
  `emp_pwd` char(20) NOT NULL COMMENT '账号密码',
  `emp_role` int(1) NOT NULL COMMENT '权限：1-售票员，2-经理， 3-影院管理员',
  `emp_name` char(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '员工姓名',
  `emp_gender` int(1) DEFAULT NULL COMMENT '0 女; 1 男',
  `emp_telnum` char(11) DEFAULT NULL COMMENT '员工电话',
  `emp_email` varchar(100) DEFAULT NULL COMMENT '员工邮箱',
  `emp_status` int(1) DEFAULT '1' COMMENT '1 启用；0 禁用',
  PRIMARY KEY (`emp_id`),
  UNIQUE KEY `emp_no` (`emp_no`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

