/*Table structure for table `movie` */

DROP TABLE IF EXISTS `movie`;

CREATE TABLE `movie` (
  `mid` int(11) NOT NULL AUTO_INCREMENT,
  `title` char(20) NOT NULL COMMENT '电影名',
  `actor` blob NOT NULL COMMENT '演员表',
  `type` char(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '电影类型',
  `area` char(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '制片地区',
