/*Data for the table `movie` */

insert  into `movie`(`mid`,`title`,`actor`,`type`,`area`,`language`,`releaseDate`,`filmlen`,`introduction`,`rate`,`cover`) values (156,'金刚川','张译;吴京;李九霄;魏晨;邓超;欧豪;邱天;周思羽;刘显达;石昊正;','剧情;战争;','中国大陆;','汉语普通话;英语;',1623175908160,122,'1953年，抗美援朝战争进入最终阶段，志愿军在金城发动最后一场大型战役。为在指定时间到达，向金城前线投放更多战力，志愿军战士们在物资匮乏、武装悬殊的情况下，不断抵御敌机狂轰滥炸，以血肉之躯一次次修补战火中的木桥。一段鲜为人知的历史，在暗流涌动的金刚川上徐徐展开......',6.5,'1623175908202332236.jpg'),(157,'黑白魔女库伊拉','艾玛·斯通;艾玛·汤普森;乔尔·弗莱;保罗·沃尔特·豪泽;约翰·麦克雷;艾米丽·比查姆;马克·斯特朗;凯万·诺瓦克;柯尔比·豪威尔-巴普蒂斯特;詹米·德米特鲁;尼亚姆·林奇;安德鲁·梁;艾德·伯奇;迪伦·洛;保罗·巴泽利;亚伯拉罕·波波拉;里奥·比尔;妮妮特·芬奇;莎拉·克劳登;阿斯玛拉·加布里埃;汤姆·特纳;托马斯·派登;克里斯·雷曼;安部春香;珍妮特·亨弗瑞;杰奎琳·陈;赫梅尔妮·加利福德;彼得·辛格;保罗·乔杜里;蒂姆·斯蒂德;乔舒亚·希尔;简·豪;杰拉丁·菲茨杰拉德;蒂珀·塞弗特·克利夫兰;吉安尼·卡尔切蒂;贝恩·科拉科;妮科尔·亨布拉;','喜剧;犯罪;','美国;','英语;',1623176005847,134,'影片改编自道迪·史密斯的小说，故事设定在20世纪70年代朋克摇滚革命时期的伦敦，讲述了一个名叫艾丝黛拉（艾玛·斯通饰）的年轻骗子的故事。艾丝黛拉是一个聪明又有创意的女孩，她决心用自己的设计让自己出名。她和一对欣赏她的恶作剧嗜好的小偷交上了朋友，并能够一起在伦敦的街道上建立自己的生活。有一天，艾丝黛拉的时尚品味吸引了冯·赫尔曼男爵夫人（艾玛·汤普森饰）的眼球，她是一位时尚界的传奇人物，拥有毁灭性的时尚和可怕的高雅，但他们的关系引发了一系列事件，导致艾丝黛拉去拥抱她的邪恶一面，成为了兼具疯狂、时尚和报复心的库伊拉。',6.9,'1623176005887538606.jpg'),(158,'我啊，走自己的路','田中裕子;苍井优;东出昌大;滨田岳;青木崇高;宫藤官九郎;','剧情;','日本;','日语;',1623176055929,138,'75岁的桃子独自生活在东京郊外。20岁时为避免包办婚姻逃到东京以来，桃子凭自己意愿组建家庭并幸福生活了55年。在丈夫猝死之后，和平度过暮年的计划遭到挫败，成为独居老人的桃子却意外收获了三个精神伙伴，于是重拾昔日活力，伴随相互交织的回忆和现实，重新审视过往的一生。日本名导冲田修一的新作改编自63岁出道的日本女作家若竹千佐子的同名自传体小说，老戏骨田中裕子饰演主人公桃子，苍井优饰演20-34岁的桃子。',7.3,'1623176055968507141.jpg'),(159,'剧场版 美少女战士Eternal 前篇','三石琴乃;金元寿子;佐藤利奈;小清水亚美;伊藤静;福圆美里;野岛健儿;渡边直美;菜菜绪;','爱情;动画;奇幻;','日本;','日语;',1623176076153,160,'2017年6月30日，在东映丸之内剧院举办的“美少女战士25周年：月野兔庆生活动”中，官方发表了《美少女战士Crystal》系列动画的最新情报，将以两部剧场版（前、后篇）的形式推出第四期“DeadMoon死亡之月”篇动画，同时第三季的导演今千秋也将继续执导。2018年美国时间6月30日，在月野兔庆生event中，官方确认在90年代版动画中担当人设师并深受大家喜爱的只野和子老师，将回归负责第四季剧场版的人设工作。',6.8,'1623176076194713573.jpg'),(160,'461个便当','井之原快彦;道枝骏佑;森七菜;若林时英;阿部纯子;映美藏良;野间口彻;KREVA;やついいちろう;坂井真纪;倍赏千惠子;','家庭;','日本;','日语;',1623176076667,0,'铃木一树（井之原快彦饰)与妻子离婚后带着儿子虹辉（道枝骏佑饰)一起生活，儿子正处于多愁善感的十五岁，一树感觉很对不起孩子，虹辉高中考试失败，第二年春天才合格，孩子希望中午能吃爸爸亲手做的便当，于是两人有了一个约定，一树三年每天给儿子做便当，儿子三年间风雨无阻去上学，为了心爱的儿子，一树开始了制作便当的历程。',6.6,'1623176076705381884.jpg'),(161,'老友记重聚特辑','詹妮弗·安妮斯顿;柯特妮·考克斯;马修·派瑞;大卫·休默;丽莎·库卓;马特·勒布朗;瑞茜·威瑟斯彭;Lady Gaga;大卫·贝克汉姆;贾斯汀·比伯;詹姆斯·柯登;辛迪·克劳馥;卡拉·迪瓦伊;埃利奥特·古尔德;基特·哈灵顿;拉里·哈金;敏迪·卡灵;托马斯·列农;克里斯蒂娜·皮克勒斯;汤姆·塞立克;詹姆斯·迈克尔·泰勒;玛姬·惠勒;马拉拉·尤萨夫扎伊;BTS;','喜剧;爱情;','美国;','英语;',1623176077481,104,'《老友记Friends》主创之一MartaKauffman早前在Tribeca电视节的《老友记》25周年活动上指，他们绝对不会拍重聚剧或重启作，另一位主创DavidCrane则表示他们已经把剧拍好了，所以这就是完结了。不过呢……今天HBOMax指在计划弄一个重聚特辑，而且目前尚在谈判阶段中。目前这部94-04年的喜剧仍然有巨大影响力，单是JenniferAniston在进驻Instagram首日放出六名主演新合照就令她迅速增加了1000万以上追随者。',9.4,'1623176077520570330.jpg'),(162,'电锯惊魂9：漩涡','克里斯·洛克;塞缪尔·杰克逊;麦克思·明格拉;马利索·妮可;摩根·大卫·琼斯;阿莉·约翰逊;弗兰克·利卡里;约翰·托卡特利迪斯;佐伊·帕尔默;丹·皮特隆杰维奇;理查德·泽皮里;伊迪·英克斯特;莱拉·丽;克里斯托弗·泰;盖内尔·威廉姆斯;莱昂尼达斯·卡斯特罗尼斯;克里斯·柯林斯;纳齐恩·康特拉科特;卢克·加洛;乔什·斯托博格;','悬疑;惊悚;恐怖;','美国;加拿大;','英语;',1623176078332,93,'老鸟警探（塞缪尔·杰克逊SamuelL.Jackson饰）带领警探（克里斯·洛克ChrisRock饰）调查惨绝人寰的连环杀警案，“拼图杀人魔”重出江湖的传言，再度勾起所有人心中的恐惧。这次新的游戏规则，似乎直冲警察而来。每个命案现场留下的“死亡漩涡”，将把他们卷进难以抽身的血腥深渊之中……《电锯惊魂》第九部由第8部的两位编剧皮特·古德芬格和乔什·斯托伯格撰写剧本。执导了《电锯惊魂234》的达伦·林恩·鲍斯曼此番回归执导。',5.1,'1623176078369243102.jpg'),(163,'哆啦A梦：伴我同行2','水田山葵;大原惠美;嘉数由美;木村昴;关智一;妻夫木聪;宫本信子;三石琴乃;松本保典;笨蛋节奏;羽鸟慎一;','剧情;动画;','日本;','日语;',1623176078966,96,'某天，大雄（大原惠美配音）偶然发现了童年时奶奶为自己缝制的玩偶熊，于是央求哆啦A梦（水田山葵配音）去往过去看望已不再人世的奶奶（宫本信子配音），大雄与奶奶重逢之后，奶奶希望能看到大雄长大结婚时的样子，答应奶奶的大雄与哆啦A梦则再一次的返回了未来，婚礼如期举行的那天，所有人都到了场，但最重要的新郎成年大雄（妻夫木聪配音）居然不在现场，情急之下，哆啦A梦让大雄假扮成年时的自己与静香结婚（嘉数由美配音），然而真正的成年大雄究竟去了哪里呢？',7.4,'1623176079005569370.jpg'),(164,'扫黑·决战','姜武;张颂文;金世佳;李倩;赵毅;焦刚;尤勇智;刘琳;白志迪;王丽云;钱波;王佳佳;董博睿;徐可珑;张康乐;阿如那;蒋雪鸣;陈进;宗俊涛;涂圣成;王浩丞;吴双;范诗然;柳俊岐;秦海;钱漪;张天舒;王欣嘉;贾凤柱;王若溪;顾语涵;王峰;王建龙;张海怡;王静宇;','剧情;动作;犯罪;','中国大陆;','汉语普通话;',1623176079914,112,'该片是国内首部以“扫黑除恶”行动为题材、展现全国扫黑办督办案件的影视化作品，讲述某扫黑专案组组长宋一锐带领组员由一起征地案深入调查，突破层层阻挠，与幕后的黑恶势力展开激烈斗争，最终揭开腐败官员利用公职权力充当犯罪保护伞的虚伪面具，将犯罪分子绳之以法的故事。',6.2,'1623176079952932118.jpg'),(165,'人之怒','杰森·斯坦森;霍特·麦克卡兰尼;罗奇·威廉姆斯;乔什·哈奈特;杰弗里·多诺万;斯科特·伊斯特伍德;安迪·加西亚;道比·欧帕瑞;拉兹·阿隆索;劳尔·卡斯提洛;克里斯·雷利;埃迪·马森;尼芙·阿尔格;塔格·墨菲;马克·阿诺德;亚历克斯·费恩斯;乔什·柯德雷;杰森·王;罗伯·德兰尼;伊莱·布朗;凯瑞·莎勒;卡梅伦·杰克;达雷尔·席尔瓦;巴布斯·奥卢桑莫昆;多米尼克·托马斯;琳·勒内;蕾贝卡·卡尔德;伊芙·麦凯林;詹姆斯·沃伦;史蒂威·戴维斯;蒙塔娜·曼宁;安东尼·莫利纳利;','动作;犯罪;','美国;英国;','英语;',1623176080533,118,'在一次全副武装的运钞车劫案中，梅斯先生（杰森·斯坦森饰）的儿子作为案发目击者被劫匪杀害。怒火中烧的梅斯为报丧子之仇，化身H卧底成为运钞车安保，试图找出杀害他儿子的劫匪以及与劫匪暗中勾结的安保公司内鬼。',6.8,'1623176080571737561.jpg'),(166,'活死人军团','戴夫·巴蒂斯塔;艾拉·珀内尔;安娜·德拉·雷古拉;马提亚斯·施维赫夫;诺拉·阿娜泽德尔;真田广之;劳尔·卡斯提洛;迈克尔·卡西迪;加瑞特·迪拉胡特;萨曼莎·乔;西奥·罗西;欧玛瑞·哈德威克;泰格·诺塔洛;洛拉·玛汀内斯-康宁安;里昂·贝克维思;萨拉·明妮奇;切尔西·埃德蒙森;迈克尔·雷德·麦基;胡玛·库雷希;理查德·赛特伦;丹尼埃尔·布鲁吉奥;瑞恩·沃森;韦恩·达格利什;莎伊娜·瑞恩;戴维·鲍尔斯;乔恩·道格拉斯·雷尼;加里·A·赫克;斯蒂芬妮·希尔;罗比·德拉费勒;詹姆斯·凯迪;雅各布·布朗;大卫·冯·罗姆;费尔南多·劳拉;蒂莫西·奥蒂斯;','动作;科幻;恐怖;','美国;','英语;',1623176081109,148,'影片的故事发生在丧尸危机爆发的拉斯维加斯，在此期间，一名男子集结一群雇佣兵进行最终的赌博，冒险进入隔离区，以进行有史以来最大的劫案。',5.3,'1623176081145255718.jpg'),(167,'我的姐姐','张子枫;肖央;朱媛媛;段博文;梁靖康;金遥源;王圣迪;孙嘉灵;陈永胜;朴松日;','剧情;家庭;','中国大陆;','汉语普通话;四川话;',1623176081741,127,'影片围绕失去父母的姐姐在面对追求个人独立生活还是抚养弟弟的问题上展开了一段细腻感人的亲情故事。',7,'1623176081777226008.jpg'),(168,'明天会好的','姜逸磊;张超;吴玉芳;白客;周奇墨;小鹿;许歌;陆忠;','喜剧;爱情;','中国大陆;','汉语普通话;',1623176082389,101,'这是一部非常真实的爱情喜剧电影，每个人都能从中找到自己的影子。年近30岁但一事无成的女生萧渝（papi酱饰）在经历被炒鱿鱼、合租闺蜜突然宣布要抛弃她住进男友房子后，搬进了五环外一个简陋的出租屋内，这是她在这个大城市第九次搬家。迫于生计的萧渝决定去剧组看看机会，为了省钱把房子短租给了一个同样潦倒的小歌手季野（张超饰）。可是很快萧渝又被剧组辞退，只能提前回京可季野的租期未满，萧渝竟成了沙发客。两人从窘迫到搭伙过日子，生活越来越甜蜜，发生了许多啼笑皆非的事情……生活总是一地鸡毛，但水逆总会过去，相信明天会好的！',5,'1623176082425702154.jpg'),(169,'第十一回','陈建斌;周迅;大鹏;窦靖童;春夏;王学兵;宋佳;牛犇;刘金山;于谦;贾冰;黄建新;史航;方龄;李九霄;','剧情;喜剧;','中国大陆;','汉语普通话;',1623176083044,117,'30年前一桩杀人案，被市话剧团拿来改编成舞台剧，马福礼（陈建斌饰）作为杀人案的当事人，旧事重提让他的生活再起波澜。马福礼一边忙着和话剧团导演胡昆汀（大鹏饰）纠缠掰理，一边找律师翻案寻求真相还自己清白，还要忙着调和妻子金财铃（周迅饰）和女儿金多多（窦靖童饰）剑拔弩张的关系，生活给了他多记重锤……时隔多年，马福礼能否重新翻案？真相到底有几个？人生如戏，请君入席。',7.4,'1623176083085939421.jpg'),(170,'兹山鱼谱','薛景求;卞约汉;李姃垠;敏度希;柳承龙;','剧情;历史;古装;','韩国;','韩语;',1623176083721,126,'纯祖一年，丁若铨（薛景求饰）因受辛酉迫害事件影响被发配到遥远的黑山岛。来到岛上后，丁若铨对这里的海洋生物产生了浓厚的兴趣，并决定写一本关于海洋生物的书籍。他向在这里土生土长、熟识各种海洋生物的青年渔夫昌大（卞耀汉饰）寻求帮助，但最初昌大因丁若铨是戴罪之身而拒绝。后丁若铨了解到昌大在自学识字的过程中常遇到困难，于是提议将各自擅长的知识教授对方，昌大最终同意，两人也在相互碰撞中成为了彼此的良师益友。然而，丁若铨在得知昌大学习的目的是为仕途后大失所望，昌大也明白两人各有志向，亦师亦友的二人决定分道扬镳……',8.5,'1623176083759726009.jpg'),(171,'鬼灭之刃 剧场版 无限列车篇','花江夏树;鬼头明里;下野纮;松冈祯丞;日野聪;平川大辅;石田彰;樱井孝宏;小西克幸;早见沙织;铃村健一;关智一;杉田智和;森川智之;佐藤利奈;三木真一郎;桑岛法子;本渡枫;大地叶;小原好美;古贺葵;小山力也;丰口惠美;榎木淳弥;伊濑茉莉也;笠间淳;千本木彩花;江口拓也;山村响;广濑裕也;高桥伸也;秋保佐永子;仲村宗悟;中惠光城;','动画;','日本;','日语;',1623176084366,117,'该片基于吾峠呼世所著漫画《鬼灭之刃》创作而成，是2019年播出的TV动画的续篇，讲述灶门炭治郎和炼狱杏寿郎与下弦之壹魇梦作战的故事。',8.1,'1623176084405978509.jpg'),(172,'鬼吹灯之黄皮子坟','周澄奥;杨冬麒;孙雅丽;赵梓冲;刘超;','悬疑;奇幻;','中国大陆;','汉语普通话;',1623176085251,103,'地下阴宅戏腔绕梁，邪祟横行怪象不穷。胡八一、王胖子、燕子为求中邪真相，竟入吃人怪楼，纸人夺命、黄仙儿迷魂、活人献祭、死而复生......',6,'1623176085287824474.jpg'),(173,'夏目友人帐：石起和可疑来访者','神谷浩史;井上和彦;堀江一真;黑田崇矢;冈村明美;长岛雄一;松山鹰志;下崎纮史;','动画;奇幻;','日本;','日语;',1623176086073,51,'以短篇集的形式，推出两篇人气故事“唤石”与“可疑访客”。讲述天生拥有能够看见妖怪能力的夏目，和强大妖怪“斑”组成跨越人与妖怪的组合，为夏目崭新的高中生涯带来众多不同的邂逅…《唤石》篇夏目在森林中遇见小妖怪－「三美」，据它说，它身负著名为「唤石」的职责，负责将具备神格名叫「岩铁」的妖怪从沉睡中唤醒。不过猫咪老师和妖怪们垂涎任务完成后能得到的美酒奖赏，计画要夺取唤石一职。夏目担心三美，决心出手相助――。《可疑的访客》篇田沼身边出现一位不可思议的客人。每天都会出现在他身边，只跟他说了一些话便离去。夏目得知该位客人的真实身分是妖怪后虽然很担心田沼，但田沼本人却对跟妖怪的交流乐在其中。虽然这妖怪似乎无意作恶，但田沼的身体却日渐虚弱。',9,'1623176086111448797.jpg'),(174,'酒精计划','麦斯·米科尔森;托玛斯·博·拉森;马格努斯·米兰;拉斯·兰特;玛利亚·邦妮薇;海伦娜·赖因科德·纳曼;苏西·沃德;艾伯特·鲁德贝克·林哈特;弗莱德瑞克·温瑟·拉斯穆森;多尔特·回斯特德;莫滕·桑博;奥勒·杜邦;比尔·克林顿;列昂尼德·伊里奇·勃列日涅夫;让-克洛德·容克;安格拉·默克尔;欧尔班·维克托;尼古拉·萨科齐;鲍里斯·尼古拉耶维奇·叶利钦;Silas Cornelius Van;Martin Greis-Rosenthal;Magnus Sjørup;Aksel Vedsegaard;Gustav Sigurth Jeppesen;Aya Grann;','剧情;喜剧;','丹麦;瑞典;荷兰;','丹麦语;瑞典语;',1623176086746,117,'本片将围绕马丁(米科尔森饰)和他三个朋友展开，这四个高中老师为了摆脱日常的循规蹈矩，开始了一项持续醉酒的实验。虽然计划最初很成功，但最终失败了。',7.7,'1623176086782619663.jpg'),(175,'小人物','鲍勃·奥登科克;阿列克谢·谢列布里亚科夫;康妮·尼尔森;克里斯托弗·洛伊德;迈克尔·艾恩塞德;科林·萨蒙;罗伯特·菲茨杰拉德·迪格斯;比利·麦克莱伦;阿拉亚·门格沙;盖奇·芒罗;佩斯利·卡多拉思;亚历山大·帕里;亨伯利·冈萨雷斯;爱德森·莫拉莱斯;J·P·马诺克斯;伊利亚·奈舒勒;谢尔盖·希纳罗维;斯蒂芬妮·西;鲁斯兰·鲁辛;Bj·韦罗;达雅·查库莎;亚当·哈蒂格;克里斯汀·哈里斯;埃里克·阿塔瓦尔;沙龙·巴杰;鲍里斯·古利亚林;丹尼尔·伯哈特;阿兰·莫西;泰瑞·威瑟斯庞;吉姆·科比;','动作;犯罪;','美国;日本;','西班牙语;俄语;英语;',1623176087355,92,'一天晚上，Hutch（鲍勃·奥登科克BobOdenkirk饰）位于郊区的家中遭两名小偷闯入。为了避免暴力冲突，Hutch没有为自己或是家人反击。他的儿子Blake（盖奇·芒罗GageMunroe饰）对他感到很失望，他的老婆Becca（康妮·尼尔森ConnieNielsen饰）似乎也因此更加疏远他。这起事件激发了Hutch心中压抑许久的情绪和本能，促使他走上残酷的道路，将揭露他黑暗的秘密和致命的能力。在拳头、枪弹和急速行驶的车阵中，Hutch必须从危险的敌人（阿列克谢·谢列布里亚科夫AlexeySerebryakov饰）手中救出自己的家人，并确保别人不会再把他视作无名小卒。',7.9,'1623176087392724763.jpg'),(176,'寻汉计','任素汐;李保田;王子川;张本煜;李勤勤;董博;仁龙;史航;柳小海;刘丹;曹征;赵晓苏;','喜剧;','中国大陆;中国香港;','汉语普通话;',1623176088043,106,'2016年伊始，大龄女青年王招（任素汐饰）离婚后发现自己怀了前夫的孩子，然而此时非婚生子女尚不能登记户口，千方百计想留下这个孩子的她，在姥爷（李保田饰）的热心“帮助”下，开启了一段阴差阳错的“寻汉”之旅……',6.2,'1623176088079755745.jpg'),(177,'普吉岛的最后黄昏','普提蓬·阿萨拉塔纳功;克里特·安努艾德奇康;','剧情;喜剧;同性;','泰国;','泰语;',1623176088590,0,'德与欧儿即将迎接曼谷的大学生活，离开普吉岛之前的一天，德要给欧儿一个特别的一天……',9.5,'1623176088627912447.jpg'),(178,'窗里的女人','艾米·亚当斯;加里·奥德曼;安东尼·麦凯;朱丽安·摩尔;詹妮弗·杰森·李;怀亚特·罗素;弗莱德·赫钦格;布莱恩·泰里·亨利;珍妮·塞拉尔斯;莉莎·科伦-扎亚斯;安娜‧卡梅隆;本杰明·杰伊·戴维斯;阿曼达·拉比诺维茨;崔西·莱茨;马塞拉·伦茨·波普;黛安·德恩;Donat Balaj;Rand Guerrero;Mariah Bozeman;','剧情;惊悚;犯罪;','美国;','英语;',1623176089156,101,'乔·赖特(《至暗时刻》《赎罪》《傲慢与偏见》)将执导悬疑惊悚新片《窗里的女人》(TheWomanintheWindow)，根据A.J.Finn所著同名畅销小说改编，崔西·莱茨(《八月:奥色治郡》《伯德小姐》)操刀剧本。讲述女主角AnnaFox隐居在纽约家中，酗酒、看老电影、回忆曾经的美好，以及暗中监视她的邻居们。当罗素一家三口搬来后，Anna某晚透过窗户看到了不该看的东西，她的世界开始支离破碎，令人震惊的秘密开始显露出来。',6,'1623176089198739065.jpg'),(179,'酸酸甜甜','张基永;蔡秀彬;郑秀晶;赵汉哲;吴素贤;','爱情;','韩国;','韩语;',1623176089802,102,'因一见钟情而开始恋爱，但因就业问题而身心疏远的情侣的爱情电影。',7,'1623176089838853590.jpg'),(180,'非常保镖','邵庄;安宁;大牛;包志强;','喜剧;悬疑;','中国大陆;','汉语普通话;',1623176090441,103,'故事讲述了因为一场车祸失去双腿的童松（邵庄饰）与技术顾问安宁（安宁饰）、安全顾问梁猛（大牛饰）合伙开办保镖公司。不料保镖团的第一单任务就遭遇不少意外，在各方势力暗流涌动之下，童松抽丝剥茧与罪犯展开斗智斗勇……',6.8,'1623176090478626591.jpg'),(181,'唐人街探案3','王宝强;刘昊然;妻夫木聪;托尼·贾;长泽雅美;染谷将太;铃木保奈美;浅野忠信;三浦友和;尚语贤;肖央;张子枫;邱泽;张钧甯;马伯骞;程潇;陈哲远;李明轩;崔雨鑫;张一白;文咏珊;张熙然;克拉拉;树林伸;刘德华;陈思诚;平山日和;奥田瑛二;六平直政;酒向芳;秋山成勋;桥本爱实;长井短;宇治清高;张国强;大鹏;陈祉希;林沐然;','喜剧;悬疑;','中国大陆;中国香港;日本;','汉语普通话;日语;英语;泰语;',1623176091447,136,'继曼谷、纽约之后，东京再出大案。唐人街神探唐仁（王宝强饰）、秦风（刘昊然饰）受侦探野田昊（妻夫木聪饰）的邀请前往破案。“CRIMASTER世界侦探排行榜”中的侦探们闻讯后也齐聚东京，加入挑战，而排名第一Q的现身，让这个大案更加扑朔迷离，一场亚洲最强神探之间的较量即将爆笑展开……',5.4,'1623176091483861610.jpg'),(182,'无依之地','弗兰西斯·麦克多蒙德;大卫·斯特雷泽恩;德里克·贾尼斯;泰·斯特雷泽恩;卡特·克利福德;彼得·斯皮尔斯;盖伊·德福雷斯特;帕特里夏·格里尔;琳达·梅;安吉拉·雷耶斯;卡尔·R·休斯;道格拉斯·G·苏尔;瑞安·阿基诺;特蕾莎·布坎南;凯莉·林恩·麦克德莫特·怀尔德;布兰迪·威尔伯;马克西·埃切维里;鲍勃·威尔斯;安妮特·威尔斯;瑞秋·班农;夏琳·斯旺基;','剧情;','美国;德国;','英语;',1623176092405,108,'基于JessicaBruder所著书籍《Nomadland:SurvivingAmericaintheTwenty-FirstCentury》，讲述一个60多岁的女人在经济大萧条中失去了一切，她作为一个居住在货车里的现代游牧民，开始了穿越美国西部的旅程。',8.3,'1623176092441598366.jpg'),(183,'奇花记','茅子俊;徐沐婵;吴佩柔;蔡宜达;洪剑涛;','奇幻;古装;','中国大陆;','汉语普通话;',1623176093055,82,'改编自《聊斋志异·葛巾》。入赘相府数年的常在田,衣冠光鲜地带着随从魏新突然回到了七年未归的故乡鹿韭村。发现当年的恋人曹玉在自己进京赶考后不久便惨遭山匪杀害,全家人亦无一幸免。见此惨状,常在田心中悲痛但却又暗自侥幸。回乡当晚,常在田在曹府旧宅离奇地遇到一位与曹小姐相貌一致的姑娘阿玉。短暂相处中,常在田觉得她举手投足间都是曹小姐当年的影子。与此同时,村庄不断发生离奇怪事,降妖术士桑道人,更口口声声说鹿韭村怨气深重,有妖怪作祟。如世外桃源的小山村里,诡异的氛围顿时弥漫开来。眼前的阿玉究竟是谁?村民的讳莫如深又隐藏了什么秘密?看似不起眼的随从魏新又怀揣着什么秘密?面对错综复杂的局面,暗藏在鹿韭村的妖异也向常在田伸出了魔爪…',4.6,'1623176093093243217.jpg'),(184,'剧场版 情色小说家~playback~','竹财辉之助;猪塚健太;吉田宗洋;大石吾朗;松本若菜;奥野壮;小林凉子;前野朋哉;','剧情;爱情;同性;','日本;','日语;',1623176093732,107,'电视剧《官能小说家》、《靛蓝色的心情》系列的第三部，也是最终章。故事描绘了竹财饰演的木岛理生，和猪冢饰演的久住春彦，两人怀抱着对彼此的心意却还是产生了隔阂，为共同的未来而纠结苦恼的身影。',6.8,'1623176093769129680.jpg'),(185,'黑道与家族','绫野刚;馆博;北村有起哉;尾野真千子;市原隼人;岩松了;丰原功补;矶村勇斗;寺岛忍;','剧情;犯罪;','日本;','日语;',1623176094391,136,'凭借《新闻记者》荣获2019年日本电影学院奖最佳影片的藤井道人导演，其最新力作转而呈现黑帮家族史诗，以1999，2005，2019三个年份为切入点，故事线跨越平成与令和时代的风云变迁，以极度压迫性的镜头语言诠释现代社会中的黑社会真相以及黑道族人的生存准则。绫野刚再度贡献影帝级别的表演，实力演绎年少漂泊被黑帮收留的主人公贤治，自此一生陷入残酷恶斗与亲情挚爱的两难之中。',7.7,'1623176094432663320.jpg'),(186,'扎克·施奈德版正义联盟','本·阿弗莱克;亨利·卡维尔;盖尔·加朵;杰森·莫玛;埃兹拉·米勒;雷·费舍尔;艾米·亚当斯;威廉·达福;杰西·艾森伯格;杰瑞米·艾恩斯;戴安·琳恩;康妮·尼尔森;J·K·西蒙斯;塞伦·希德;郑恺;艾梅柏·希尔德;乔·莫顿;丽莎·洛文·孔斯利;大卫·休里斯;安·奥戈博莫;奥古斯塔·艾娃·艾伦德斯杜提尔;克里斯特比约格·凯尔德;英格瓦·埃盖特·西古德松;马克·麦克卢尔;迈克尔·麦克埃尔哈顿;约翰·达格尔什;拉腊·德坎罗;罗比·基;吉姆·斯图格恩;杜晨·科洛斯;埃莉诺·松浦;萨曼莎·乔;布鲁克恩斯;杰罗姆·普拉顿;理查德·克里弗特;文森特·里奥特;马克·阿诺德;彼得·吉尼斯;赛吉·康斯坦斯;奥萝尔·劳泽瑞尔;朱利安·刘易斯·琼斯;雷·波特;弗朗西斯·麦基;科雷西·克莱门斯;露西·布莱尔斯;威尔·柯班;凯伦·布莱森;克里斯蒂·梅尔;吉安皮罗·科格诺利;寇布勒·霍尔德布鲁克-史密斯;凯文·马图林;泰勒·詹姆斯;布鲁斯·钟;奥赖恩·李;奥利弗·加茨;凯莉·波尔克;奥利弗·鲍威尔;哈里·伦尼克斯;欧米·罗斯;萨姆·本杰明;卡拉·古奇诺;罗素·克劳;扎克·施奈德;','动作;科幻;奇幻;冒险;','美国;','英语;',1623176095228,242,'布鲁斯·韦恩（本·阿弗莱克饰）为了确保不让超人（亨利·卡维尔饰）白白牺牲，他决定与戴安娜·普林斯（盖尔·加朵饰）联手并计划招募一支超能力者团队来保护世界免遭即将到来的灾难性威胁。但这项任务比布鲁斯想象中要困难，因为每位成员都必须面对并跨越自己过去的心魔，团结起来，最终形成一个前所未有的英雄联盟。蝙蝠侠、神奇女侠、海王（杰森·莫玛饰）、钢骨（雷·费舍饰）、闪电侠（埃兹拉·米勒饰）现在必须联合起来，否则就无法阻止荒原狼（塞伦·希德饰）、狄萨德（彼得·吉尼斯饰）以及达克赛德（雷·波特饰）毁灭地球的可怕计划。',8.2,'1623176095268370836.jpg'),(187,'正义骑士','麦斯·米科尔森;尼古拉·雷·卡斯;罗兰·默勒;古斯塔夫·林德;尼可拉斯·布若;拉尔斯·博格曼;雅各布·乌尔里克·罗曼;艾伯特·鲁德贝克·林哈特;蒙坦·瑟贝尔;Jesper Groth;丽克·路易丝·安德森;Jesper Ole Feit Andersen;古斯塔夫·代克尔吉塞;Andrea Heick Gadeberg;Rigmor Ranthe;Henrik Noël Olesen;卡斯帕·威尔伯格;克劳斯·赫朱勒;赖沃·特拉斯;Anne Fletting;','剧情;喜剧;动作;','丹麦;','丹麦语;',1623176095924,116,'故事讲述马库斯的妻子在一场悲剧的火车事故中身亡，马库斯要赶回家陪女儿玛蒂尔德。这场事故似乎是一场意外，但一位数学极客，也是火车中的一位乘客，与他的两个同事现身，说出他们确信这场事故背后另有隐情。',7.2,'1623176095965283348.jpg'),(188,'那些希望我死的人','安吉丽娜·朱莉;芬恩·利特;乔·博恩瑟;艾丹·吉伦;尼古拉斯·霍尔特;杰克·韦伯;梅迪纳·森戈尔;泰勒·派瑞;布兹·萨瑟兰德;托利·基特尔斯;詹姆斯·乔丹;洛拉·玛汀内斯-康宁安;小霍华德·弗格森;瑞安·杰森·库克;劳拉·尼米;迪兰·科宁;劳伦·波特;雅各布·布朗;斯蒂芬妮·希尔;马特·梅德拉诺;阿尔玛·西斯内罗斯;卢·伍德曼;','剧情;动作;惊悚;','加拿大;美国;','英语;',1623176096629,100,'一名十几岁的凶案证人发现自己在蒙大拿州的荒野中被两名暗杀者追杀，一名求生专家负责保护他-——而一场森林大火正危及他们所有人。',6.2,'1623176096670142314.jpg'),(189,'你好，李焕英','贾玲;张小斐;沈腾;陈赫;刘佳;丁嘉丽;王琳;杜源;何翯;何欢;韩云云;包文婧;葛珊珊;史策;黄小猫;许君聪;卜钰;刘宏禄;魏翔;孙集斌;泰维;郭宇鹏;朱天福;王宇;冯巩;乔杉;王小利;宋晓峰;董若溪;曹贺军;赵婷婷;姬晴;郭祥鹏;李一峰;潘斌龙;','剧情;喜剧;奇幻;','中国大陆;','汉语普通话;',1623176097266,128,'2001年的某一天，刚刚考上大学的贾晓玲（贾玲饰）经历了人生中的一次大起大落。一心想要成为母亲骄傲的她却因母亲突遭严重意外，而悲痛万分。在贾晓玲情绪崩溃的状态下，竟意外的回到了1981年，并与年轻的母亲李焕英（张小斐饰）相遇，二人形影不离，宛如闺蜜。与此同时，也结识了一群天真善良的好朋友。晓玲以为来到了这片“广阔天地”，她可以凭借自己超前的思维，让母亲“大有作为”，但结果却让晓玲感到意外......',8,'1623176097307878015.jpg'),(190,'奥斯陆','露丝·威尔森;安德鲁·斯科特;耶夫·威尔布什;萨利·姆道;瓦利德·祖伊特;艾格尔·纳尔;多瓦勒·格利克曼;罗坦·凯南;Itzik Cohen;托比亚斯·齐哈库斯;塞森·加布埃;杰拉尔丁·亚力山大;亚当·瓦库拉;约阿希姆·保罗·阿斯波克;山姆·费尔;','剧情;惊悚;历史;','美国;','英语;',1623176097891,118,'Recountsthetrue-life,previouslysecret,back-channelnegotiationsinthedevelopmentofthepivotal1990sOsloPeaceAccordsbetweenIsraelandthePalestinianLiberationOrganization.影片叙述了以色列和巴勒斯坦解放组织在制定1990年代奥斯陆关键和平协定过程中的真实生活，以前是秘密的后通道谈判。',7.5,'1623176097932654366.jpg'),(191,'猛鬼实验室','朋抔·里拉塔纳卡邹;帕瑞斯·因塔拉科玛亚苏特;娜塔妮查·纳瓦塔纳瓦尼;','剧情;惊悚;恐怖;','泰国;','泰语;',1623176098458,117,'两位医生朋友格拉和阿威在进行一项关于来世的研究实验，结果他们亲眼看到“鬼魂”，并由此一发不可收拾，决心要为幽灵和来世的存在寻找科学解释。他们的狂热和对未知不计后果的追求如同一个无底洞，将危及他们的友谊和至亲之人。',5.7,'1623176098497855560.jpg'),(192,'人潮汹涌','刘德华;肖央;万茜;程怡;黄小蕾;国义骞;狄志杰;郭京飞;刘天佐;路阳;郭帆;刘浩良;饶晓志;雷佳音;史航;魏之皓;王学兵;林海;隋凯;卫莱;','喜剧;犯罪;','中国大陆;中国香港;','汉语普通话;',1623176099199,119,'陈小萌（肖央饰）一直渴望成为一名演员，但残酷的现实令他至今扔在龙套的位置上苦苦挣扎。没钱没工作没恋人没朋友还欠了一大笔钱的陈小萌想到了死，可是就连死神都抛弃了他，他数次自杀都以失败告终。一天，陈小萌去澡堂泡澡，意外邂逅了一位神秘且富有的男子（刘德华饰），该男子在澡堂里意外摔倒昏迷被送进了医院，拾得了他的储物室手环的陈小萌决定顶替他的身份，享受一下富人的生活。头部的撞击令男子失忆了，凭借着零星的线索，他认定自己是陈小萌，并且顺藤摸瓜来到了陈小萌的出租屋，希望熟悉的环境能够令他更快的恢复记忆。在此过程中，男子邂逅了名为李想（万茜饰）的自媒体人，两人之间碰撞出了火花。©豆瓣',6.8,'1623176099240353918.jpg'),(193,'新神榜：哪吒重生','杨天翔;张赫;宣晓鸣;李诗萌;朱可儿;凌振赫;刘若班;张遥函;张喆;高增志;郭浩然;','动作;动画;奇幻;','中国大陆;','汉语普通话;',1623176099866,116,'三千年前，天下动荡，人神共遇大劫，不想哪吒的一缕魂魄逃脱天罗地网，世世转世投胎，这一世与东海市酷爱机车的热血青年李云祥人神共生。然而龙族对哪吒恩怨并未善罢甘休，有着哪吒元神的李云祥，亦无法逃脱被龙族赶尽杀绝的宿命。东海危在旦夕，李云祥是否能够与哪吒元神并肩作战，成为抵抗龙族的英雄？东海市的子民能否得到拯救？',7.1,'1623176099909376135.jpg'),(194,'寻龙传说','凯莉·玛丽·陈;奥卡菲娜;嘉玛·陈;金大贤;吴珊卓;本尼迪克特·王;伊扎克·王;塔莉娅·陈;艾伦·图代克;迪辰·拉克曼;帕蒂·哈里森;姜成镐;罗斯·巴特勒;乔娜·肖;宋静秀;弗朗克西斯·周;保罗·扬;丽莎·德尔·门多;塔妮亚·古纳迪;珍妮·关;卢锡安·佩雷兹;文森特·罗德里格兹三世;','动画;奇幻;冒险;','美国;','英语;',1623176100511,108,'很久以前，在充满奇幻色彩的龙佑之邦，人类和龙和谐地生活在一起。但当一股邪恶的力量袭来，龙牺牲了自己来拯救人类。500年后，同样的邪恶力量卷土重来，只有一个孤独的战士拉雅（凯莉·玛丽·陈配音）承担重任，追踪传说中的最后一条龙，以修复这块破碎的土地，团结分裂的人民。在她的旅程中，她也会逐渐了解到拯救世界不仅仅需要一条龙，还需要信任和团队合作。',7.2,'1623176100551694726.jpg'),(195,'秘密访客','郭富城;段奕宏;张子枫;许玮甯;荣梓杉;王圣迪;吕聿来;张柏嘉;孔雁;','悬疑;惊悚;','中国大陆;','汉语普通话;',1623176101154,111,'校车司机于困樵（段奕宏饰）因失职酿成了一起重大的校车车祸，困樵拼死救出了似与车祸背后真相息息相关的汪楚祺（荣梓杉饰），校车上的其他学生无人生还。得知此事家境显赫的汪父（郭富城饰）为了隐藏这个秘密，不得不把困樵藏在自己家的地下室里长达三年，却处处暗示困樵何时自首。随着访客的到来，这个原本温馨和睦的四口之家变得越来越诡异，母亲（许玮甯饰）整日惴惴不安，姐姐（张子枫饰）举止一反常态，家人个个心怀鬼胎，怪事频出，这个家背后不可告人的秘密似乎即将浮出水面……',5.6,'1623176101193963275.jpg'),(196,'刺杀小说家','雷佳音;杨幂;董子健;于和伟;郭京飞;佟丽娅;董洁;王圣迪;杨轶;刘天佐;李柄辉;萧子墨;双雪涛;徐建;','动作;奇幻;冒险;','中国大陆;','汉语普通话;',1623176101838,130,'异世界皇都，天神赤发鬼残暴统治，滥杀无辜。少年空文因被赤发鬼追杀，决定奋起反击。在黑甲（郭京飞饰）的指引下，踏上了凡人弑神之路。这是小说家路空文（董子健饰）笔下的奇幻世界。没想到小说的进程，竟然影响着现实世界。这时一名男子（雷佳音饰）接下了刺杀他的任务……',6.7,'1623176101880858979.jpg'),(197,'孤味','陈淑芳;谢盈萱;徐若瑄;孙可芳;丁宁;陈姸霏;张钧甯;杨一展;张翰;龙劭华;洪胜德;琇琴;杨闵;许怀民 ;庄心瑜;蔡海殷;陈家逵;','剧情;家庭;','中国台湾;','汉语普通话;闽南话;',1623176102530,123,'林秀英（陈淑芳饰）是台南赫赫有名的餐厅老板，在丈夫（龙劭华饰）无声无息地离家后，便靠著卖虾卷独自抚养三个女儿长大成人，不仅把虾卷从路边摊卖到开餐厅，三个女儿更是成就非凡，大女儿阿青（谢盈萱饰）是国际舞者，二女儿阿瑜（徐若瑄饰）在台北当整形医生，小女儿佳佳（孙可芳饰）则接手自己的餐厅事业。眼看就要苦尽甘来，秀英却在70大寿当天接到丈夫离世的噩耗，在替这位有名无实的丈夫筹办丧礼的同时，竟意外迎来了另一位陪伴丈夫度过晚年的女人，令她不得不再次面对内心埋藏已久的怨怼……',8,'1623176102572533753.jpg'),(198,'氧气危机','梅拉尼·罗兰;马修·阿马立克;马立克·兹迪;Marc Saez;Laura Boujenah;Lyah Valade;Cathy Cerda;Marie Lemiale;Pascal Germain;Eric Herson-Macarel;','科幻;惊悚;','法国;美国;','法语;',1623176103156,101,'《氧气》是一部求生题材法国惊悚片，由亚历山大·阿嘉执导。这部电影讲述了一名年轻女子（梅拉尼·罗兰饰，《鬼影特攻：以暴制暴》《无耻混蛋》）在低温舱中醒来，她不记得自己是谁，为何出现在这里。由于氧气即将耗尽，她必须重建自己的记忆，以逃离这噩梦般的场景。',6.4,'1623176103196563771.jpg'),(199,'智能大反攻','奥利维娅·科尔曼;埃里克·安德烈;玛娅·鲁道夫;查琳·易;丹尼·麦克布莱德;艾比·雅各布森;弗莱德·阿米森;克莉丝汀·泰根;玛德琳·麦格劳;亚历克斯·赫什;柯南·奥布莱恩;萨西尔·扎玛塔;约翰·传奇;贝克·班尼特;Griffin McElroy;杰·费罗尔;布雷克·格里芬;迈克尔·里安达;丝凯拉·格雷;','喜剧;科幻;动画;冒险;','美国;加拿大;中国香港;','英语;',1623176104059,113,'《智能大反攻》是由美国索尼哥伦比亚影片公司和索尼动画联合出品的原创喜剧冒险动画电影。该片由荣获奥斯卡最佳动画长片大奖的《蜘蛛侠：平行宇宙》金牌制作团队重磅打造，可谓2020年最值得期待的动画巨制。迈克尔·里安达（《怪诞小镇》）担任导演、菲尔·罗德和克里斯托弗·米勒（《蜘蛛侠：平行宇宙》《乐高大电影》）担任制片人。特立独行又充满创意的凯蒂·米切尔考上了她梦寐以求的电影学院。她本打算坐飞机前往学校，但热爱大自然的父亲瑞克却决定开车载全家人一起送凯蒂上大学，在她离开之前增进家人感情。除了凯蒂和瑞克，米切尔一家还包括乐天派的母亲琳达和性格古怪的弟弟艾伦，以及胖乎乎的可爱八哥犬蒙奇，他们展开了一段刺激的家庭公路自驾游。但意外发生了，智能科技突如其来地向人类发起反攻，彻底打乱了米切尔一家的计划。人们最常用的电子设备，从手机到家用电器，乃至一系列最新的私人机器人，...(展开全部)《智能大反攻》是由美国索尼哥伦比亚影片公司和索尼动画联合出品的原创喜剧冒险动画电影。该片由荣获奥斯卡最佳动画长片大奖的《蜘蛛侠：平行宇宙》金牌制作团队重磅打造，可谓2020年最值得期待的动画巨制。迈克尔·里安达（《怪诞小镇》）担任导演、菲尔·罗德和克里斯托弗·米勒（《蜘蛛侠：平行宇宙》《乐高大电影》）担任制片人。特立独行又充满创意的凯蒂·米切尔考上了她梦寐以求的电影学院。她本打算坐飞机前往学校，但热爱大自然的父亲瑞克却决定开车载全家人一起送凯蒂上大学，在她离开之前增进家人感情。除了凯蒂和瑞克，米切尔一家还包括乐天派的母亲琳达和性格古怪的弟弟艾伦，以及胖乎乎的可爱八哥犬蒙奇，他们展开了一段刺激的家庭公路自驾游。但意外发生了，智能科技突如其来地向人类发起反攻，彻底打乱了米切尔一家的计划。人们最常用的电子设备，从手机到家用电器，乃至一系列最新的私人机器人，决定在全球范围内向人类进攻。在两台友好的故障机器人帮助下，米切尔一家齐心协力互相帮助，共同面对这次非同寻常的挑战！',7.5,'1623176104100750742.jpg'),(200,'猫和老鼠','科洛·莫瑞兹;迈克尔·佩纳;郑肯;科林·乔斯特;乔丹·博尔格;罗伯·德兰尼;克里斯蒂娜·钟;布赖恩·斯特帕尼克;帕拉维·沙尔达;卡米拉·阿维森;克丽·麦克莱恩;卡米拉·拉瑟福德;泰·赫尔利;丹尼尔·阿德博伊加;乔蕾·科斯;丹尼尔·厄根;伯纳多·桑托斯;乔·伯恩;乔基姆·斯卡利;','喜剧;动画;冒险;','英国;美国;','英语;',1623176104741,101,'“超杀女”科洛·莫瑞兹饰演的少女凯拉刚刚入职豪华大酒店，就碰上了叫人头疼的难题——杰瑞竟然想在酒店里定居，令酒店最近承接的世纪婚礼岌岌可危。于是，汤姆被凯拉雇佣成为酒店员工，目的是赶走杰瑞，这对欢喜冤家就此展开了一场你追我赶的爆笑喜剧。',5.3,'1623176104783671173.jpg'),(201,'芝加哥七君子审判','埃迪·雷德梅恩;艾利克斯·夏普;萨莎·拜伦·科恩;杰瑞米·斯特朗;约翰·卡洛·林奇;叶海亚·阿卜杜勒-迈丁;马克·里朗斯;约瑟夫·高登-莱维特;本·申克曼;J.C.麦肯泽;弗兰克·兰格拉;丹尼尔·弗莱厄蒂;诺亚·罗宾斯;约翰·道曼;迈克尔·基顿;小凯文·哈里森;凯特琳·菲茨杰拉德;茱丽叶·安吉洛;布伦丹·伯克;凯文·奥多奈尔;爱丽丝·克雷梅尔堡;拉里·米切尔;韦恩·杜瓦尔;迈克尔·布鲁里布;达米安·杨;米歇尔·赫斯特;马修·勒弗沃;克里斯蒂安·利特克;马克斯·阿德勒;肖恩·帕森;爱德华德·弗莱彻;C·J·威尔逊;史蒂文· 加斯沃思;大卫·菲耶罗;伊恩·邦兹;莱克斯·艾尔;','剧情;历史;','美国;英国;印度;','英语;',1623176105609,129,'1968年民主党全国代表大会上的和平抗议演变成了与警察和国民警卫队的暴力冲突。抗议活动的组织者包括艾比·霍夫曼、杰里·鲁宾、汤姆·海登和鲍勃·席勒，他们被指控阴谋煽动暴乱，随之而来的审判是历史上最臭名昭著的几场审判之一。',8.6,'1623176105650825980.jpg'),(202,'信条','约翰·大卫·华盛顿;罗伯特·帕丁森;伊丽莎白·德比茨基;肯尼思·布拉纳;亚伦·泰勒-约翰逊;迪宝·卡帕蒂娅;克蕾曼丝·波西;希米什·帕特尔;安德鲁·霍华德;尤里·科洛科利尼科夫;迈克尔·凯恩;马丁·唐文;卡里娜·韦尔瓦;乔纳森·坎普;凯蒂·麦克凯布;贝恩·科拉科;安东尼·莫利纳利;特伦特·布克斯顿;英格丽·玛格斯;瑞奇·切劳洛;劳里·谢泼德;马克·克雷尼克;亚历克斯·威克索;丹兹尔·史密斯;马塞尔·萨巴特;','剧情;动作;科幻;','美国;英国;','英语;俄语;乌克兰语;爱沙尼亚语;印地语;挪威语;',1623176106459,150,'世界存亡危在旦夕，“信条”一词是唯一的线索与武器。主人公穿梭于全球各地，开展特工活动，力求揭示“信条”之谜，并完成一项超越了真实时间的神秘任务。这项任务并非时间之旅，而是【时空逆转】。',7.7,'1623176106499467782.jpg'),(203,'浅田家！','二宫和也;妻夫木聪;黑木华;菅田将晖;风吹淳;平田满;渡边真起子;北村有起哉;野波麻帆;','剧情;家庭;','日本;','日语;',1623176107128,127,'热爱拍照的父亲，年末都会替全家拍摄新年合照。父亲知道小儿子立志成为摄影师，所以在他12岁生日当天，将自己最珍爱的相机送给了他。由小儿子所拍下的第一张照片，就是他们的全家福。如今，这位小儿子浅田政志（二宫和也饰演），已经从专科学校毕业，并持续与父母及哥哥四人，拍摄一系列别具特色的全家福，其中包括消防员、黑道、赛车手、选举、战队、乐队等不同主题，并以《浅田家》为名出版了摄影集。由于风格独特并让人会心一笑，让他获得摄影大奖肯定，从此踏上专业摄影师之路。不过随之而来的一场灾难，却让他逐渐失去人生目标。他自愿成为灾后重建义工，并在海啸过后的泥泞中，找到一本本已经失去主人的相簿。在这些充满故事的照片背后，他能否从中领悟到摄影的真正意义呢？',8.3,'1623176107170924394.jpg'),(204,'一秒钟','张译;刘浩存;范伟;余皑磊;张邵勃 ;李延;于洋;刘云龙;常海军;曹瑞;唐孜悦;李晓川;于滨;王敏萱;宋家琦;杨铁城;王兵;','剧情;','中国大陆;','汉语普通话;',1623176108003,104,'影片讲述了没赶上电影场次的张九声与刘闺女因一场电影结下了不解之缘的故事。故事灵感来源于张艺谋导演早期经历，是其一贯对文化展开追忆和寻根的风格。',7.8,'1623176108044792712.jpg'),(205,'徐福','孔刘;朴宝剑;赵宇镇;张荣男;朴秉恩;金在健;延济旭;金弘波;李言廷;韩智贤;车智媛;安德烈亚斯·弗龙克;罗光旭;','剧情;动作;科幻;','韩国;','韩语;',1623176108992,114,'濒临死亡的前情报局特工闵基宪（孔刘饰），偶然遇见拥有人类不死秘密的「永生人」徐福（朴宝剑饰），闵基宪的最后一场任务是誓死守护徐福到安全之地，途中想占有永生人的庞大财团与各方恶势力展开大规模猎杀，让他们的逃亡过程卷入惊天动地的危险局面....',5.9,'1623176109031221029.jpg'),(206,'心灵奇旅','杰米·福克斯;蒂娜·菲;菲利西亚·拉斯海德;阿米尔-卡利布·汤普森;戴维德·迪格斯;格拉汉姆·诺顿;瑞切尔·豪斯;艾莉丝·布拉加;理查德·艾欧阿德;唐尼尔·罗林斯;安吉拉·贝塞特;马戈·霍尔;罗德莎·琼斯;韦斯·斯塔迪;沙基纳·贾弗里;福琼·费姆斯特;卡鲁姆·格兰特;泽诺比娅·谢罗夫;朱恩·斯奎布;凯茜·卡瓦蒂妮;罗纳尔多·德尔·卡门;Elisapie Isaac;杰森·佩斯;科拉·尚波米耶;','动画;音乐;奇幻;','美国;','英语;',1623176109863,101,'究竟是什么塑造了真正的你？电影将聚焦乔伊·高纳（杰米·福克斯配音）。这位中学音乐老师获得了梦寐以求的机会——在纽约最好的爵士俱乐部演奏。但一个小失误把他从纽约的街道带到了一个奇幻的地方“生之来处”（theGreatBefore）。在那里，灵魂们获得培训，在前往地球之前将获得他们的个性特点和兴趣。决心要回到地球生活的乔伊认识了一个早熟的灵魂“二十二”（蒂娜·菲配音），二十二一直找不到自己对于人类生活的兴趣。随着乔伊不断试图向二十二展示生命的精彩之处，他也将领悟一些人生终极问题的答案。',8.8,'1623176109902465300.jpg'),(207,'同学麦娜丝','施名帅;郑人硕;纳豆;刘冠廷;陈以文;王彩桦;潘慧如;洪小玲;朱芷莹;郑宇彤;汤志伟;蓝苇华;林义雄;加藤鹰;陈俊成;黄信尧;庄益增;安乙荞;萧鸿文;韩亚熙;金美满;吴茵茵;','剧情;喜剧;','中国台湾;','闽南语;汉语普通话;日语;',1623176110500,122,'四个高中同学毕业后常常聚在泡沫红茶店刁牌、唬烂三小，但聚会后他们还是要继续面对生活的艰难：电风（郑人硕饰）是保险业务员，领着微薄薪水省吃俭用买了新房，因为女友怀孕将步入婚姻的人生阶段；从事纸扎屋行业又有阴阳眼的闭结（刘冠廷饰），因长期照顾卧病在床的阿嬷错过婚姻，想寻求婚姻介绍所找一个好女人结婚；罐头（纳豆饰）在一次吞药自杀后洗心革面，接下了户政所的工作，因此与他心目中的女神校花麦娜丝重逢；添仔（施名帅饰）是怀才不遇的导演，却在机缘下被政客（陈以文饰）相中开始选举之路…',7.9,'1623176110541213251.jpg'),(208,'新秩序','迪耶戈·博内塔;达里奥·亚斯贝克·贝纳尔;奈安·诺温德;莫妮卡·德尔·卡门;罗伯托·梅迪纳;埃利希奥·梅兰德斯;莉萨·欧文;恩里克·辛格;古斯塔沃·桑切斯·帕拉;Samantha Yazareth Anaya;Patricia Bernal;Analy Castro;Fernando Cuautle;Zamira Franco;Ximena García;Claudia Lobo;Eli Nassau;亚历杭德罗·桑切斯·德拉佩尼亚;','剧情;','墨西哥;','西班牙语;',1623176111147,88,'墨西哥导演米歇尔·弗兰克在参加马拉喀什电影节时确认他执导的第六部影片[少数人的梦想](TheDreamsofaFew，暂译)将于明年4月开机拍摄。弗兰克的上一部影片[艾普尔的女儿]于去年戛纳电影节“一种关注单元”首映并荣获评审团奖。弗兰克表示新片将是一部大制作影片，影片风格有别于他以往作品，将采用全墨西哥演员阵容，墨西哥取景拍摄。据悉新片故事将设定在一个不远未来的反乌托邦世界，影片主题涉及墨西哥城的贫富鸿沟。',7.1,'1623176111188297491.jpg'),(209,'又见奈良','吴彦姝;英泽;国村隼;永濑正敏;鹏飞;张巍;秋山真太郎;','剧情;','中国大陆;日本;','汉语普通话;日语;',1623176112446,100,'电影讲述了一段跨越60年的异国无血缘母女情。年近八十的老奶奶陈慧明（吴彦姝饰）孤身奔赴奈良，寻找失去联系的养女陈丽华。在遗孤二代小泽（英泽饰）和退休警察一雄（國村隼饰）的帮助下，找到了许多接触过、帮助过丽华的人们。在这个过程中，陈慧明如同亲历丽华到达日本之后的人生，她与小泽、一雄之间的关系，也在这段旅程中更加贴近了。',7.5,'1623176112487871351.jpg'),(210,'侍神令','陈坤;周迅;陈伟霆;屈楚萧;王丽坤;沈月;王紫璇;王悦伊;孙红雷;艾米;','奇幻;','中国大陆;','汉语普通话;',1623176113143,120,'穿行于人妖两界的阴阳师晴明（陈坤饰），因与一众妖怪缔结契约，酿成大祸，深陷危机。而与此同时，妖皇势力正卷土重来，一场恶战一触即发。在风云突变、局势动荡的危急时刻，晴明恍然发现，自己人妖混血的身份，竟是这一切灾祸的关键......',5.5,'1623176113184505367.jpg'),(211,'无声','陈姸霏;刘子铨;刘冠廷;杨贵媚;太保;张本渝;陈雪甄;金玄彬;范睿修;王士豪;潘亲御;廖钧纬;郑维奕;汪建民;','剧情;','中国台湾;','汉语普通话;',1623176113742,104,'失聪少年张诚准备转到启聪学校就读。聋人的世界，却不比听人的世界宁静。当他发现校车最后一排的「游戏」，融入新生活的欣喜之情，瞬间成为恐惧⋯⋯。眼见心仪的女孩贝贝在游戏中遍体鳞伤、学长小光气势狂妄不可质疑，一群同学们又天真无害，张诚忖度着是否该揭开游戏的残忍真相，或加入游戏的行列？当加害者与受害者的界线越趋模糊，盘根错节的苦痛、无可倾诉的怨怼，种种困惑与不安在无声的校园蔓延。新锐导演柯贞年的首部长片大胆将真实事件搬上银幕，在直面残酷的同时，不失温柔的眼光。犀利刻画人物之间复杂与纠结的情感，呈现声嘶力竭却仍仿若无声的残忍。贝贝一句「他们只是在玩」轻描淡写，却惊悚、沉痛，更是真实无比的哀叹。',7.7,'1623176113783514958.jpg'),(212,'有答案的男子','瓦西里斯·马古里奥蒂斯;安东·威尔;皮尔·安德里亚·波斯尼亚;瓦西里斯·迪米特鲁利亚;里尼奥·德拉崎;罗尼·恩维;斯特拉·热罗尼;安东尼·卡萨里斯;玛丽亚·卢斯·拉托雷;弗朗兹斯科·洛佩兹;安妮塔·洛鲁索;索佐罗斯·米霍普洛斯;马克·皮斯托诺;艾丽莎·普林西比;毛罗·拉坎蒂;','剧情;同性;','塞浦路斯;希腊;意大利;','英语;希腊语;德语;意大利语;',1623176114557,80,'维克多自幼和奶奶生活在希腊的海边小镇，奶奶去世后，他决定开车去往德国，开始一段公路旅行。在前往意大利的船上，维克多偶遇英俊、自由、奔放的德国男人马蒂亚斯，二人相互吸引，越走越近。在驱车北上的过程中，马蒂亚斯逼迫维克多走出舒适区，二人因此发生激烈的冲突。当旅行临近结束，他们各自的问题是否能找到答案？',7.8,'1623176114598287058.jpg'),(213,'打开心世界','凯瑟琳·沃特斯顿;凡妮莎·柯比;克里斯托弗·阿波特;卡西·阿弗莱克;卡丽娜·齐安娜·格拉西姆;丹尼尔·布拉姆博格;约阿希姆·乔巴努;詹姆斯·朗肖尔;桑德拉·泼萨内科豪斯;安德烈娅·瓦西里;','剧情;爱情;同性;','美国;','英语;',1623176115233,105,'故事发生在19世纪的美国东北部，艾比盖尔（凯瑟琳·沃特森KatherineWaterston饰）和丈夫戴亚（卡西·阿弗莱克CaseyAffleck饰）在这里经营着一座农场，繁重的农活让艾比盖尔和丈夫之间没有任何的交流，不久之前两人的女儿因病去世的事件也让这对夫妻之间的感情更加的疏离。某日，农场里来了一对小夫妻——塔利（凡妮莎·柯比VanessaKirby饰）和芬妮（克里斯托弗·阿波特ChristopherAbbott饰），塔利的处境和艾比盖尔差不过，在家庭中也处于弱势的地位，她因为无法怀孕而遭到丈夫的冷待。两个内心里伤痕累累的女人一拍即合，很快就培养出了真挚的友谊，这友谊随着时间渐渐发酵，散发出了爱情的醇香。©豆瓣',8.2,'1623176115274906828.jpg'),(214,'追虎擒龙','古天乐;梁家辉;吴镇宇;林家栋;姜皓文;胡然;郑则仕;蔡洁;林子善;刘浩龙;何浩文;黄浩然;龚慈恩;李天翔;','剧情;动作;犯罪;','中国香港;中国大陆;','粤语;汉语普通话;',1623176115919,105,'影片讲述1973年，香港警黑勾结，在英国人指使下贪污巨利，荼毒市民。港督成立廉政公署，最先两位检察官为黑白双煞（古天乐、林家栋饰）历尽千辛万苦调查权倾黑白两道的总华探长徐乐（吴镇宇饰）及跛豪（梁家辉饰），终把二人绳之以法的故事。',5.5,'1623176115957116880.jpg'),(215,'倒霉性爱，发狂黄片','克劳迪娅·耶利米亚;奥林匹娅·马莱;尼科丁·恩古里亚努;亚历山德鲁·波托切安;安迪·瓦斯卢亚努;','剧情;喜剧;','罗马尼亚;卢森堡;捷克;克罗地亚;','罗马尼亚语;',1623176116734,106,'一段视频被病毒式传播，视频中，一男一女戴着面具做爱。不过，这名女子还是被认出来了。更糟的是，她是一名教师，本应当是一个榜样。而且这是在一个后社会主义社会，即将迷失在一个社会网络话语中，其中有治愈洁癖的态度，有伪政治万事通，有神圣沙文主义，有怪诞阴谋论。每个人都有自己的意见。辩论变成了一个法庭，关于双方同意的性、色情等等。拉杜·裘德（RaduJude）一如既往地致力于创新的电影实验，在这个星座中精心制作了一个聪明的、讽刺性的三部曲：第一部分以不紧不慢的精准镜头对准布加勒斯特街头日常熙攘生活中的疯狂幽默，向我们展示纪录-虚构界面的当代电影的样子。第二部分是一系列平淡无奇的静态影像，旨在作为我们这个时代符号的百科全书。影片的大结局（虽然是开放式的）是在学校举行的讨论，对女主角的存在的理由作出裁决。',7.2,'1623176116776401111.jpg'),(216,'冷血悍将','迈克尔·B·乔丹;朱迪·特纳-史密斯;杰米·贝尔;盖·皮尔斯;劳伦·伦敦;雅各布·西皮奥;托德·拉桑斯;杰克·凯西;露西·拉塞尔;凯姆·吉甘戴;卢克·米切尔;亚特乔姆·吉尔茨;布伦特·吉尔曼;梅拉布·尼尼泽;亚历山大·梅尔库里;科尔曼·多明戈;德里克·梅森堡;梅尔·法尔;乔治·阿斯普雷;卡兹·陶吉纳斯;汤姆·科利;玛丽索尔·科雷亚;里奇·格拉夫;希妮·拉芙尔;罗伯特‧马瑟;阿德里安·罗林斯;凯特·萨普特;亚历山大·雅辛;','动作;惊悚;','美国;','英语;',1623176117524,109,'本片由斯特法诺·索利马执导，泰勒·谢里丹担任编剧，根据汤姆·克兰西创作同名小说改编，讲述前特种兵约翰·克拉克(乔丹饰)女友被贩毒组织杀害，可就在他决定复仇时，华盛顿高管要求他完成解救高级军官的秘密任务。杰米·贝尔仍在就加盟本片进行最后谈判。',5.6,'1623176117564962842.jpg'),(217,'无声','刘亚仁;刘在明;文胜雅;林姜成;李海云;俞成柱;金子英;金汉娜;','惊悚;犯罪;','韩国;','韩语;',1623176118631,99,'昌福(刘在明饰)和泰仁(刘亚仁饰)表面上以卖菜为生，实际上两人还有另一个活计，就是为黑道组织提供杀人场所以及处理尸体，一日像往常一样在处理尸体的两人被组织中的金室长(林姜成饰)胁迫，去接管一个被绑架的11岁女孩初喜(文胜雅饰)，两人平静的生活随即被打破，事情开始向着他们无法控制的方向发展…',7.4,'1623176118672335160.jpg'),(218,'夺冠','巩俐;黄渤;吴刚;彭昱畅;白浪;朱婷;徐云丽;张常宁;姚迪;林莉;刘晓彤;颜妮;惠若琪;丁霞;袁心玥;龚翔宇;李现;刘敏涛;陈展;罗慧;毛雯;李紫微;李冬徐;马雪纯;刘畅;刘贞宏;凌敏;李阳一;刘晨曦;','剧情;运动;','中国大陆;中国香港;','汉语普通话;英语;日语;葡萄牙语;',1623176119547,135,'2008年8月15日，北京奥运会女排比赛，中国VS美国。戴着金丝框眼镜的郎平（巩俐饰）坐在美国队教练席上，大气沉稳，目光如电；中国队教练（黄渤饰）站在场边，全神贯注，面带笑容。中国队教练望向郎平，目光充满深意，不断经过的人影遮蔽了他的视线，中国女排三十余年的沉浮图景被缓缓打开……',7.3,'1623176119588392904.jpg'),(219,'紫罗兰永恒花园 剧场版','石川由依;子安武人;','剧情;动画;','日本;','日语;',1623176120243,140,'延续TV版的主线剧情，继续讲述从战场回来的少女薇尔莉特·伊芙加登为了理解“爱”的含义而从事为有需要的人们写信传情的工作。薇妹一直挂念的少佐的下落大概率会在这部剧场版中讲述。',8.2,'1623176120282685125.jpg'),(220,'玫瑰岛的不可思议的历史','埃利奥·杰曼诺;莱昂纳多·利迪;马蒂尔达·德·安杰利斯;汤姆·拉斯齐哈;卢卡·津加雷蒂;法布里齐奥·本蒂沃利奥;弗朗索瓦·克鲁塞;布鲁诺·格里;阿斯卡尼奥·巴尔博;法布里齐奥·隆吉奥内;马尔科·潘克拉齐;克里斯蒂安·斯塔姆;特科·切里奥;费德里科·帕西菲奇;克里斯蒂安·吉内普;','喜剧;','意大利;','意大利语;法语;德语;',1623176121116,119,'有天赋却被人误解的工程师乔治奥跌入了人生谷底，他被解雇了，父母也不和他讲话，并且在他意外令自己和女友被捕后（说来话长…），女友抛弃了他。厌倦了60年代末沉闷的意大利社会，乔治奥制定了一个不可能的计划；他要在海中建造自己的岛。在一群革命者和被驱逐者的加入下，玫瑰岛共和国成立并宣布独立，乔治奥被任命为总统。然而，他们的团队价值观和应变能力将受到考验，因为意大利总理认为乔治奥的理想岛是意大利的头号敌人。《玫瑰岛》由希德尼·希比利亚（《玩命毒师》三部曲）执导，由Grøenlandia（《TheFirstKing》）出品，是一部基于真实故事改编的滑稽喜剧，剧中充斥着反叛精神。',8,'1623176121156356466.jpg'),(221,'送你一朵小红花','易烊千玺;刘浩存;朱媛媛;高亚麟;夏雨;岳云鹏;陈祉希;李晓川;孔琳;吴晓亮;张绍刚;孙强;安笑歌;李增辉;姚未平;张浩天;柴陆;','剧情;','中国大陆;','汉语普通话;',1623176121812,128,'两个抗癌家庭，两组生活轨迹。影片讲述了一个温情的现实故事，思考和直面了每一个普通人都会面临的终极问题——想象死亡随时可能到来，我们唯一要做的就是爱和珍惜。',7.4,'1623176121854178715.jpg'),(222,'八佰','王千源;张译;姜武;黄志忠;张俊一;欧豪;杜淳;魏晨;张宥浩;唐艺昕;李九霄;李晨;梁静;侯勇;辛柏青;俞灏明;刘晓庆;姚晨;郑恺;余皑磊;黄晓明;徐嘉雯;张承;马精武;胡晓光;陆思宇;白恩;曹璐;刘云龙;杨嘉华;中泉英雄;高爽;郑伟;高冬平;黄米依;曹卫宇;宋洋;徐乐同;徐幸;','剧情;历史;战争;','中国大陆;','汉语普通话;日语;英语;',1623176122660,147,'1937年淞沪会战的最后一役，“八百壮士”奉命坚守上海四行仓库，以少敌多顽强抵抗四天四夜。电影《八佰》由管虎导演，是亚洲首部全片使用IMAX摄影机拍摄的商业电影，将于2020年8月21日全国影院上映。',7.6,'1623176122700544565.jpg'),(223,'命运理发师','约吉·巴布;Sheela Rajkumar;Sangili Murugan;G.M. Sundar;Kanna Ravi;Douglas Kumaramoorthy;George Maryan;Aaru Bala;Deepa Shankar;Subadhini Subramanian;Saranya Ravichandran;森西库马里;','喜剧;','印度;','泰米尔语;',1623176123299,140,'在一场当地选举中，两名参选人都不择手段想要获胜，一名理发师意外掌握重权，成为决定选举结果的关键一票。',7.5,'1623176123338140139.jpg'),(224,'名侦探柯南：绯色的子弹','高山南;山崎和佳奈;小山力也;林原惠美;日高法子;田中敦子;森川智之;池田秀一;一城美由希;梁田清之;土师孝也;杉本优;滨边美波;','动作;动画;悬疑;冒险;','日本;','日语;英语;',1623176123977,110,'故事发生于东京，在全球最大体育盛事WSG即将召开之际，知名企业的高官却接连在赞助商酒会现场遭到绑架，而自新名古屋站至东京的最高时速1000km的真空超导磁悬浮列车也被卷入其中，一场牵动国际目光的重大案件就此展开。',5.9,'1623176124017875699.jpg'),(225,'小镇缉凶','艾瑞克·巴纳;吉娜薇·欧瑞丽;基尔·奥唐纳;约翰·波尔森;朱丽娅·布莱克;布鲁斯·斯宾斯;威廉·扎帕;马特·纳夫莱;詹姆斯·弗兰切威勒;杰里米·林赛·泰勒;乔·克洛塞克;碧比·贝登科特;克劳德·斯科特-米歇尔;山姆·科利特;Miranda Tapsell;','剧情;','美国;','英语;',1623176124494,117,'艾瑞克·巴纳加盟澳大利亚新片[小镇缉凶](TheDry，暂译)。影片改编自简·哈珀同名畅销小说，罗伯特·康诺利(《深暗势力》)自编自导，巴纳、康诺利共同担任监制。影片围绕一个警察回到老家侦破凶案展开，明年二月开机。这也是巴纳自2007年的[我的父亲,罗穆卢斯]后再度拍摄澳大利亚影片。',6.9,'1623176124533120972.jpg'),(226,'混沌行走','汤姆·赫兰德;黛西·雷德利;德米安·比齐尔;大卫·奥伊罗;科特·萨特;辛西娅·艾莉佛;贝瑟妮·安妮·林德;麦斯·米科尔森;尼克·乔纳斯;雷·迈克金农;文森特·莱克莱尔;布兰·克洛卡雷尔;蒂龙·本斯金;弗兰克·方丹;帕特里克·加洛;玛丽莲·迪恩-罗比齐;朱利安·瑞钦斯;迈克尔·戴森;马克斯韦尔·麦卡比-洛克斯;迈克尔·亚穆什;布莱恩·亚历山大;奥妮克·阿德莉;克劳迪娅·贝索;奥斯卡·贾恩那达;塔拉·尼科迪莫;哈里森·奥斯特菲尔德;','动作;科幻;冒险;','美国;加拿大;','英语;',1623176125103,109,'人类在与地球相似的遥远外星建立了新家园，但这个星球上却有一种病毒，男人感染后可以听到其他人和动物的心声，每个男人脑子里的想法都能被他人听到，人与人之间不存在隐私，新星球上的普伦提司镇的男人们就不堪忍受自己的想法被人听见。托德·赫维特（汤姆·赫兰德饰）是出生于这座小镇的男孩，他的认知中小镇没有女人是因为该星球土著居民蓝光兽家园被人类侵犯时故意让人类感染了噪音病毒，他们还杀光了所有女性。托德对此深信不疑，直到他遇到一个女孩。托德在小镇附近的森林里遇到了一个叫维奥拉（黛西·雷德利饰）的女孩，她来自遥远的地球，她的飞船因故坠毁在森林里，普伦提司镇的镇长在得知这个消息后立刻展开对他俩的追杀，托德为了保护女孩维奥拉只好一起出逃，开始了一段他意想不到且危机重重的星球冒险。',5.2,'1623176125144958735.jpg'),(227,'电话','朴信惠;全钟瑞;金成铃;李艾;李东辉;朴浩山;吴政世;','剧情;悬疑;惊悚;','韩国;','韩语;',1623176125694,112,'一通电话让来自过去和现在的两个女人产生了奇妙的联系，并引发了一场改变未来的危险游戏...她们将渐渐难以自拔。',7.6,'1623176125733538500.jpg'),(228,'明天的记忆','徐睿知;金康宇;朴相旭;廉惠兰;裴侑蓝;金嫝勋;','悬疑;惊悚;','韩国;','韩语;',1623176126254,99,'我看见的明日，你就是杀人凶手！在一次创伤后失去记忆的秀珍（徐睿知饰），常常反覆梦到一个没有脸的人紧追著她不放，秀珍好不容易在丈夫（金康宇饰）陪伴下慢慢回复正常生活。但秀珍却开始有了预见未来的能力，她在看见未来的画面后，一次次帮助别人度过难关，而她也渐渐发现丈夫似乎隐瞒了天大的秘密，甚至还看到了丈夫杀人的影像，但现实中却似乎什麽事都没发生。医生认为秀珍看到的幻象只是创伤后遗症，而此时一位警探（朴相旭饰）怀疑秀珍的丈夫捲入了一件窃盗案，起疑的秀珍开始寻找真相，却让她脑中的记忆越来越混乱……',6.4,'1623176126292652827.jpg'),(229,'罪之声','小栗旬;星野源;松重丰;古馆宽治;市川实日子;火野正平;宇崎龙童;梶芽衣子;宇野祥平;','悬疑;犯罪;','日本;','日语;',1623176126884,142,'影片改编自塩田武士的同名推理小说，以昭和年间最大的未解决事件为主题，讲述新闻记者阿久津英士（小栗旬饰）和少年时期与该事件有关联的男人曾根俊也（星野源）之间的故事。',7.1,'1623176126926111594.jpg'),(230,'我和我的家乡','葛优;黄渤;范伟;邓超;沈腾;张占义;王宝强;徐峥;闫妮;马丽;刘敏涛;刘昊然;卢靖姗;王子文;魏翔;章宇;王砚辉;张译;王源;张一鸣;杨新鸣;王迅;于和伟;苗阜;辣目洋子;张子贤;董子健;陶虹;吴京;韩彦博;吕行;佟丽娅;李晨;孙俪;赵铁人;郝云;彭昱畅;杨紫;岳云鹏;赵海燕;岳小军;王俊凯;贾玲;潘斌龙;高睿菲儿;陈数;代乐乐;黄才伦;雷佳音;梁超;孙贵权;韩昊霖;岳红;陶亮;李易峰;许猛;郭帆;卫莱;栗坤;薇娅;李佳琦;白泽泽;','剧情;喜剧;','中国大陆;','汉语普通话;',1623176127928,153,'电影《我和我的家乡》定档2020年国庆，延续《我和我的祖国》集体创作的方式，由张艺谋担当总监制，宁浩担任总导演，张一白担任总策划，宁浩、徐峥、陈思诚、闫非&彭大魔、邓超&俞白眉分别执导五个故事。',7.2,'1623176127967826595.jpg'),(231,'吉祥如意','王吉祥;大鹏;刘陆;','剧情;家庭;','中国大陆;','汉语普通话;',1623176128556,80,'大鹏首次执导现实题材文艺片，故事讲述一位喜剧片导演突发奇想，回到东北农村老家，希望将一家人如何过年拍成一部文艺电影，结果遭遇一系列意外。因拍电影而聚齐的家庭成员们，完成了最后的聚会。',7.8,'1623176128597676004.jpg'),(232,'菊石','凯特·温丝莱特;西尔莎·罗南;费奥纳·肖;杰玛·琼斯;詹姆斯·麦卡德尔;亚力克·塞克雷亚努;克莱尔·拉什布鲁克;哈维·斯克林肖;温迪·诺丁汉;利亚姆·托马斯;莎拉·怀特;比阿特丽斯·克纽;','剧情;爱情;同性;','英国;澳大利亚;美国;','英语;法语;',1623176129289,117,'故事发生在19世纪20年代的英国，玛丽（凯特·温丝莱特KateWinslet饰）是一名古生物学家，然而，这个行当显然无法让她过上优渥的生活，所以玛丽至今仍然在贫困线上挣扎，为了给病重的母亲治病，玛丽靠着在沙滩上捡化石卖给游客来维生。某日，一个名叫罗德里克（詹姆斯·麦卡德尔JamesMcArdle饰）的男人找到了玛丽，开出了很高的薪酬，希望玛丽能够去照料他病重的妻子夏洛特（西尔莎·罗南SaoirseRonan饰），经受不住金钱的诱惑，玛丽答应了。可是，就在玛丽刚刚见到夏洛特没多久，两人之间差异巨大的思想就碰撞出了火花，但随着时间的推移，她们都在彼此的身上看到了自己未曾经历过的世界。©豆瓣',7.1,'1623176129329923579.jpg'),(233,'缉魂','张震;张钧甯;孙安可;李铭顺;张柏嘉;林晖闵;古斌;吕雪凤;林鹤轩;吴志庆;张哲豪;','科幻;悬疑;惊悚;犯罪;','中国大陆;中国台湾;','汉语普通话;闽南语;英语;',1623176130076,130,'著名集团董事长王世聪惨死家中，负责此案的检察官梁文超（张震饰）与妻子刑警阿爆（张钧甯饰）在调查中得知：死者的儿子王天佑（林晖闵饰），年轻的新婚妻子李燕（孙安可饰），多年合伙人万宇凡（李铭顺饰），甚至死去的前妻唐素贞（张柏嘉饰），每个人之间都有着错综复杂的关联。阿爆更是发现隐藏在案件背后的惊人秘密……电影根据江波小说《移魂有术》改编。',6.9,'1623176130114616616.jpg'),(234,'哥斯拉大战金刚','亚历山大·斯卡斯加德;米莉·波比·布朗;丽贝卡·豪尔;凯莉·霍特尔;布莱恩·泰里·亨利;小栗旬;艾莎·冈萨雷斯;朱利安·迪尼森;兰斯·莱迪克;凯尔·钱德勒;德米安·比齐尔;哈基姆·凯-卡西姆;钱信伊;约翰·皮鲁切洛;克里斯·乔克;康兰·卡萨尔;布拉德·麦克默里;本杰明·里格比;普里西拉·道伊西;戴维·卡斯蒂洛;吉姆·帕尔默;柯蒂斯·布什;皮拉·福德;爱丽丝·兰斯伯里;肖恩·麦克布莱德;乔尔·皮尔斯;乔恩·奎斯蒂德;塔斯尼姆·罗克;艾梅伯·瓦尔斯;迪索·拉莫斯;','动作;科幻;冒险;','美国;澳大利亚;加拿大;印度;','英语;美国手语;',1623176130841,113,'这两位宛如神衹一般强大的对手于一场壮观的战争中相遇，彼时世界命运正悬于一线。为了找到真正的家园，金刚与他的保护者们踏上了一次艰难的旅程。与他们一道前行的还有一个年轻的孤儿女孩——吉雅，这个女孩与金刚之间存在着一种独特而强大的紧密联系。但意想不到的是，他们在前行的航道上与愤怒的哥斯拉狭路相逢，也由此在全球引起了一系列破坏。一股无形的力量造成了这两只巨兽之间的巨大冲突，深藏在地心深处的奥秘也由此揭开。',6.4,'1623176130883798875.jpg'),(235,'疯狂原始人2','尼古拉斯·凯奇;艾玛·斯通;瑞恩·雷诺兹;凯瑟琳·基纳;莱斯利·曼恩;彼特·丁拉基;克拉克·杜克;克萝丽丝·利奇曼;乔安娜·林莉;凯莉·玛丽·陈;','喜剧;动画;冒险;','美国;','英语;',1623176131596,95,'经历了逃离洞穴、挺过末日危机之后的原始人咕噜家族，咕噜一家决定寻找新家园。中途盖（瑞恩·雷诺兹RyanReynolds配音）已成了咕噜一家中的一员，但让瓜哥（尼古拉斯·凯奇NicolasCage配音）头疼的是，盖跟女儿小伊（艾玛·斯通EmmaStone配音）每天你侬我侬，还妄想组成只属于两人的小家庭。就在咕噜一家人饥肠辘辘之际，他们发现了一片高墙内隐藏着食物丰饶的沃土，原来开辟这片世外桃源的文明人夫妇霍普和菲尔是已经去世的盖的父母的朋友。在最初的热情款待后，一心想要撮合盖和女儿晓晓的霍普和菲尔，发现咕噜一家成了绊脚石，为了把盖抢过来，他们用上了攻心计。两家人闹得不可开交，盖和小伊也产生了裂痕，却浑然不知危险正慢慢靠近……',7.9,'1623176131637124001.jpg'),(236,'命运之夜——天之杯Ⅲ：春之歌','杉山纪彰;下屋则子;川澄绫子;植田佳奈;门胁舞以;伊藤美纪;中田让治;津嘉山正种;浅川悠;诹访部顺一;稻田彻;七绪春日;宫川美保;西前忠久;水泽史绘;泽木郁也;上田耀司;立花慎之介;大原沙耶香;茅野爱衣;打田政志;','剧情;动画;奇幻;','日本;','日语;',1623176132226,122,'本片改编自TYPE-MOON出品的文字冒险类游戏《Fate/staynight》，是该游戏的Heaven\'sFeel路线，简称“HF”或“樱线”，是该系列作品动画剧场版全三部作品中的最终章。在剧场版作品第二章黑化之后的樱吸收了众多Servant的灵魂后，被世间所有的恶控制，成为黑色圣杯的化身。最终，得知一切的士郎放弃了成为正义的伙伴，选择了保护樱...',8.5,'1623176132267901400.jpg'),(237,'神奇女侠1984','盖尔·加朵;克里斯·派恩;克里斯汀·韦格;佩德罗·帕斯卡;康妮·尼尔森;罗宾·怀特;莉莉·阿斯佩尔;加布瑞拉·王尔德;杜晨·科洛斯;琳达·卡特;克里斯托弗·普拉哈;里昂·贝克维思;拉维·帕特尔;娜塔莎·罗斯韦尔;泰莎·波纳姆·琼斯;艾拉·沃克;游朝敏;谢恩·阿特沃尔;艾德·伯奇;帕特里克·利斯特;奥克莉·布尔;科莎·恩格勒;小田部阿基;康斯坦丁·格雷戈里;文森·德·保罗;朱利安·费罗;罗莎娜·沃尔斯;丹尼·摩根;克里斯·西尔科克;伯纳多·桑托斯;菲利普·菲尔玛;尼克·欧文福特;乔尔·莫里斯;贾格·帕特尔;温迪·阿尔比斯顿;马诺伊·阿南德;约翰·盖蒂尔;佩内洛普·卡普迪雅;莎拉·卢娜;','动作;奇幻;冒险;','美国;英国;西班牙;','英语;',1623176133022,151,'故事背景设定在五光十色、充满诱惑的80年代，神奇女侠戴安娜在华盛顿的自然历史博物馆过着与普通人无异的生活，然而在阻止了一场看似平常的劫案后，身边的一切都发生了变化。在强大的神力诱惑下，两位全新劲敌悄然出现——与神奇女侠“相爱相杀”的顶级掠食者豹女，以及掌控着能改变世界力量的麦克斯·洛德，一场惊天大战在所难免。另外一边，旧爱史蒂夫突然“死而复生”，与戴安娜再续前缘，然而浪漫感动之余，史蒂夫的回归也疑窦丛生。新时代大幕开启，面对两位强大的邪恶反派和神秘归来的史蒂夫，神奇女侠要如何才能再次拯救世界？',6.2,'1623176133063920982.jpg'),(238,'哆啦A梦：大雄的新恐龙','水田山葵;大原惠美;嘉数由美;木村昴;关智一;三石琴乃;松本保典;高木涉;荻野志保子;庆长佑香;矢口麻美;远藤绫;钉宫理惠;间宫康弘;下和田裕贵;小野大辅;悠木碧;渡边直美;木村拓哉;神木隆之介;','动画;奇幻;冒险;','日本;','日语;',1623176133675,110,'大雄把恐龙展发现的化石带回家，借助哆啦A梦的时光包袱竟然成功孵化出两只从未被发现过的长着翅膀的新恐龙。大雄和小伙伴们决定将小恐龙们带回到属于它们的时代，一场惊心动魄的白垩纪大冒险即将上演。本片是《哆啦A梦》漫画连载50周年纪念作品，同时也是《哆啦A梦》系列电影的第40部作品。全新的故事，全新的大雄，全新的冒险，全新出发！',7.3,'1623176133714495485.jpg'),(239,'紧急救援','彭于晏;王彦霖;辛芷蕾;蓝盈莹;王雨甜;徐洋;陈家乐;李岷城;张景祎;李欣蕊;郭晓东;张国强;魏大勋;连凯;','动作;灾难;','中国大陆;中国香港;','汉语普通话;英语;',1623176134390,134,'倾覆沉没的钻井平台，顺流直冲的运油车头，直坠入海的满载客机。交通海上应急反应特勤队队长高谦（彭于晏饰）、机长方宇凌（辛芷蕾饰）和绞车手赵呈（王彦霖饰）一次次带领队伍第一时间抵达，站在水火咆哮的最前面，守在危急撤离的最后面，用生命对抗天灾人祸。但在自然面前，特勤员毕竟没有超能力，血肉之躯踩在死亡边缘，真实的恐惧无数次让这些斗士颤抖、无助和气馁。而海上救援的字典里没有“退缩”。当你听见旋翼的轰鸣、洪亮的汽笛、马达的飞驰，那是他们无惧艰难险阻，舍己为人，谱写的一曲英雄之歌。',6.1,'1623176134429773254.jpg'),(240,'拆弹专家2','刘德华;刘青云;倪妮;谢君豪;姜皓文;吴卓羲;马浴柯;黄德斌;郑子诚;洪天明;袁富华;刘浩龙;凌文龙;赵永洪;蔡瀚亿;张竣杰;张扬;','动作;犯罪;','中国大陆;中国香港;','汉语普通话;粤语;英语;',1623176135331,121,'香港某处发生爆炸案，前拆弹专家潘乘风（刘德华饰）因昏迷于现场，被警方怀疑牵涉其中。苏醒后的潘乘风只能一边逃亡一边查明真相，然而，他的好友董卓文（刘青云饰）和他的前女友庞玲（倪妮饰）却给他讲述了两段截然不同的经历。有计划的爆炸案接二连三发生，真相却越来越扑朔迷离……',7.6,'1623176135369709890.jpg'),(241,'发掘','凯瑞·穆里根;拉尔夫·费因斯;莉莉·詹姆斯;强尼·弗林;本·卓别林;肯·斯托特;莫妮卡·杜兰;阿舍尔·阿里;乔·赫斯特;伊莲恩·戴维斯;詹姆斯·德莱顿;埃利·皮尔西;杰克·班尼特;Chris Wilson;Grant Crookes;Jane Fowler;','剧情;传记;历史;','英国;','英语;',1623176136007,112,'第二次世界大战即将爆发时，一个富有的寡妇雇用了一名业余考古学家在她的庄园内挖掘墓冢。当他们做出历史性发现时，英国的过去和不确定的未来将遥相呼应。',7.8,'1623176136047984254.jpg'),(242,'除暴','王千源;吴彦祖;春夏;卫诗雅;大力;于笑;胡子程;李晓川;洪浚嘉;纪焕博;庞雨浓;答有为;鲍起静;尤勇智;王超北;胡晨曦;','剧情;动作;犯罪;','中国香港;中国大陆;','粤语;汉语普通话;',1623176136709,95,'上世纪90年代，刑警钟诚受命追捕悍匪集团“老鹰帮”。这群悍匪犯下惊天连环劫案，训练有素且纪律严明，首领张隼更屡次恶意挑衅，矛头直指钟诚。为将“老鹰帮”捉拿归案，钟诚带领刑警小队咬死不放，誓与恶势力斗争到底。数年间，警匪上演了一次次紧张刺激的较量，悍匪愈加猖獗，警方步步逼近，双方展开殊死对决……',6.2,'1623176136748201362.jpg'),(243,'地窖奇劫','弗莱迪·海默;阿斯特丽德·伯格斯-弗瑞斯贝;萨姆·赖利;利亚姆·坎宁安;何塞·科罗纳多;路易斯·托萨尔;埃米利奥·古铁雷斯·卡巴;阿克塞尔·施泰因;法米克·詹森;弗兰克·费斯;维森特·希尔;雷格·威尔森;克雷格·史蒂文森;亨特·特里梅恩;大卫·切弗斯;贾格布·迪森塔;托马斯·德尔·伊思塔;胡利奥·维莱斯;Simon Cohen;费兰·特拉萨;哈维尔·加里多·加西亚;','动作;犯罪;','西班牙;','英语;',1623176137499,118,'西班牙银行是无与伦比的，绝对没有人能闯得进去，也不可能被人抢劫，没有蓝图、没有资料，世上没有人知道一百多年前用来建造金库的历史性工法。这个充满刺激的挑战激起了汤姆的好奇心：这个天才决心找出金库的秘密，闯进银行的最深处。目标是遗失已久的宝藏，将在这家银行内保管仅仅十天。在极具领袖风范的艺术鉴赏家华特的带领之下，汤姆和他的团队要在短短十天内准备好这次的抢案，事成后还要拟好千载难逢的逃跑计划。计划十天，但执行这个计划却只有90分钟：这90分钟是世界杯足球决赛的时间，届时将吸引成千上万的球迷来到西班牙银行的门口。',7,'1623176137539799219.jpg'),(244,'女人的碎片','凡妮莎·柯比;希亚·拉博夫;艾伦·伯斯汀;埃莱扎·施莱辛格;本·萨弗迪;莎拉·斯努克;莫莉·帕克;史蒂文·麦卡锡;蒂龙·本斯金;弗兰克·萧宾;哈里·斯坦德乔夫斯基;多梅尼克·迪罗萨;吉米·费尔斯;朱丽叶特·卡萨格兰德;盖尔·加芬克尔;肖恩·塔克;埃里克·戴维斯;','剧情;','加拿大;匈牙利;美国;','英语;',1623176138347,128,'西恩（希亚·拉博夫ShiaLaBeouf饰）和玛莎（凡妮莎·柯比VanessaKirby饰）正在充满期待的等待着两人爱情结晶的诞生，根据玛莎的要求，他们决定将助产士请到家里来，在家中分娩。然而，当玛莎开始了分娩过程后，她原先选中的助产士却因事无法前来，换成了另一个名叫艾娃（莫莉·帕克MollyParker饰）助产士来接生。悲剧就这样发生了，玛莎的孩子在出世短短几分钟后便因为窒息而死亡了。当命运的重锤砸下时，人们只能选择咬紧牙关默默承受，为了替自己死去的孩子讨回一个公道，玛莎的母亲找来了律师苏姗妮（莎拉·斯努克SarahSnook饰），将艾娃告上法庭。在面对自己支离破碎的内心的同时，玛莎还必须处理她和西恩之间濒临崩溃的夫妻关系，而控制欲极强的母亲的步步紧逼，更是夺走了玛莎得以呼吸的最后一丝空气。©豆瓣',7.7,'1623176138386661233.jpg'),(245,'狼行者','肖恩·宾;霍纳·妮芙茜;伊娃·惠塔克;西蒙·迈克伯尼;汤米·蒂尔南;玛丽亚·多耶·肯尼迪;乔·肯尼;约翰·莫顿;诺拉·托梅;保罗·杨;奥利弗·麦克格拉斯;Niamh Moyles;','动画;奇幻;冒险;','爱尔兰;卢森堡;法国;丹麦;美国;英国;','英语;',1623176139125,100,'讲述了11岁女孩罗芬的神奇经历。罗芬作为一个年轻的学徒猎人，她和父亲一起来到爱尔兰，准备消灭最后一批在那里的狼，但是改变她的事情来了，她发现了狼行者，此后一连串的古怪故事就发生了……',7.8,'1623176139164349506.jpg'),(246,'白虎','阿达什·古拉夫;佩丽冉卡·曹帕拉;拉吉·库玛;马赫什·曼杰瑞卡;维杰·莫里亚;斯瓦普·桑帕特;纳尼什·尼尔;凯姆利什·吉尔;Paras Gola;Ansuman Bhagat;Lokesh Mittal;Perrie Kapernaros;Vedant Sinha;Trupti Khamkar;Abhishek Khandekar;','剧情;犯罪;','印度;美国;','英语;',1623176140046,125,'巴尔朗·哈勒维（阿达什·古拉夫饰）讲述了他从贫穷村民成长为当代印度成功企业家的史诗般、充满黑色幽默的人生历程。我们年轻的主人公足智多谋而又雄心勃勃，设法成为了刚从美国回来的阿肖克（拉吉·库玛饰）和粉红夫人（朴雅卡·乔普拉饰）的司机。社会将巴尔朗训练成一名仆人，他便努力将自己打造成富有主人的得力帮手。但经过一夜之间的背叛，他意识到主人们会不择手段地陷害他以进行自救。在失去一切的边缘，巴尔朗决心反抗被操纵的人生和不平等的制度，奋起成为新型的主人。该影片改编自《纽约时报》畅销书和2008年曼布克奖获奖小说。',7.6,'1623176140086656466.jpg'),(247,'许愿神龙','成龙;牛骏峰;薇薇安;苏柏丽;','喜剧;动画;奇幻;','中国大陆;美国;中国香港;','汉语普通话;英语;',1623176141356,99,'你知道这世上仅存一条粉红色的许愿神龙吗？他能够实现许愿者任何逆天改命的愿望。这样的神力引得不少人在暗中寻找神龙的踪迹，然而普普通通的上海小青年丁思齐误打误撞打开了神龙的封印。千年代沟引发连串爆笑经历，被绑定的一人一龙踏上了一段妙想天开又惊险万分的旅途…',6.6,'1623176141395361314.jpg'),(248,'犹大与黑弥赛亚','丹尼尔·卡卢亚;勒凯斯·斯坦菲尔德;杰西·普莱蒙;多米尼克·菲什巴克;艾什顿·桑德斯;阿尔吉·史密斯;达里尔·布里特-吉布森;里尔·莱尔·哈瓦瑞;多米尼克·索恩;马丁·辛;阿马里·切托姆;克里斯·戴维斯;伊恩·达夫;卡勒布·埃伯哈特;罗伯特·朗斯特里特;汤米·拉菲特;特雷勒·希尔;齐纳·萨维尔斯;迈克尔·哈瑞蒂;迈克尔·博诺莫;布莱恩·鲍曼;杰梅因·福勒;洛根·弗莱;泰拉·乔伊·史密斯;','剧情;传记;历史;','美国;','英语;',1623176142022,126,'影片改编自真人真事。讲述了1960年代美国黑人社团黑豹党历史上的真实事件，故事聚焦于Hampton之死，他于1969年被杀，死于芝加哥警察局和FBI组织的一次突袭行动。警方开了80枪，而“黑豹党”成员一共只开了一枪，这一枪还是来自于一位成员被警方打死后的肌肉收缩。Hampton与怀孕的未婚妻正在睡觉时，头部被近距离射杀2枪，他当晚被下了药，根本没听见任何警方的动静，死后尸体被拖进小巷中，年仅21岁。经过审讯，他的死被判定为“正当杀人”，后来在1982年，以185万美元的赔偿数额，达到了民事诉讼的庭外和解。',7.2,'1623176142060793876.jpg'),(249,'760号犯人','塔哈·拉希姆;朱迪·福斯特;本尼迪克特·康伯巴奇;扎克瑞·莱维;谢琳·伍德蕾;沙莫·阿斯玛尼;克里·约翰逊;马修·马什;大卫·芬恩;安德烈·雅各布斯;兰利·柯克伍德;史蒂夫·马克;罗伯特·霍布斯;梅丽莎·海登;阿拉·萨菲;埃文·亨斯特;达伦-迈耶;弗朗西斯·乔勒;克莱顿·博伊德;南希·霍兰德;Meena Rayann;Arthur Falko;','剧情;惊悚;','英国;美国;','法语;阿拉伯语;英语;',1623176142653,129,'影片改编自MohamedouOuldSlahi的回忆录《关塔那摩日记》，讲述Slahi(塔哈饰)被美国政府俘虏，在毫无指控与判决的情况下被关进了监狱，他失去了希望。Slahi寻得辩护律师南希·霍兰德(福斯特饰)与助手特里·邓肯(伍德蕾饰)的帮助，他们在面对无数障碍的情况下，一同追求正义。在富有争议的主张及斯图尔特·库什中尉(康伯巴奇饰)揭露的证据下，一个令人震惊的阴谋露出水面。',7.3,'1623176142691991095.jpg'),(250,'风平浪静','章宇;宋佳;王砚辉;李鸿其;邓恩熙;周政杰;陈瑾;张建亚;叶青;高宇航;赵龙豪;丁冠中;林津锋;','剧情;爱情;犯罪;','中国大陆;','汉语普通话;',1623176143316,119,'十五年前的一次意外，成绩优异高中生宋浩离开了家乡，也离开了原本的人生轨迹。十五年后，他回到家乡，一切仿佛都已风平浪静。与老同学潘晓霜的重逢，给了他人生久违的光亮。他决定揭开那个十五年来不敢触碰的伤疤，重新掌控人生，完成一场似乎不可能的自我救赎。',6.2,'1623176143354918844.jpg'),(251,'鬼灭之刃 那田蜘蛛山篇','花江夏树;鬼头明里;下野纮;松冈祯丞;','剧情;动作;奇幻;','日本;','日语;',1623176143845,138,'炭治郎，伊之助还有我妻善逸在打败响凯，并得到休整后，《鬼灭之刃》的故事也将进入新的篇章，那就是“那田蜘蛛山篇”。在这一篇章，真正有着十二鬼月实力的角色，也将会出现',9.2,'1623176143885629254.jpg'),(252,'我是大哥大 电影版','贺来贤人;伊藤健太郎;清野菜名;桥本环奈;仲野太贺;柳乐优弥;山本舞香;矢本悠马;若月佑美;柾木玲弥;铃木伸之;猪塚健太;矶村勇斗;佐藤二朗;吉田钢太郎;泉泽祐希;荣信;爱原实花;','喜剧;','日本;','日语;',1623176144465,114,'三桥贵志以转校为契机，决定在新学校“嚣张”一把，从此做个不良少年。为了能在同学中获得存在感，他还特地去发廊弄了一头金色卷发。而和他转到同一所学校的伊藤也有同样的想法。在开学第一天，伊藤和三桥就发现了彼此的秘密，也因此结成盟友。三桥的信条是“无论用多么卑鄙的手段，只要能赢就行”，所以，在和别人打架的时候只要能玩阴的就绝对不正面对抗，但他真正的实力也不容小觑。伊藤为人处世相对正经，有时候甚至会慢半拍，也因此常常被三桥利用且被蒙在鼓里，而在打架方面，他战斗力超群，有着不服输的信念。两个人一起挑战校内校外的不良少年，引发了一连串爆笑事件。',7.9,'1623176144510767133.jpg'),(253,'姜子牙','郑希;杨凝;图特哈蒙;阎么么;季冠霖;姜广涛;','剧情;动画;奇幻;','中国大陆;','汉语普通话;',1623176145190,110,'故事发生于封神大战后。姜子牙率领众神伐纣，赢得封神大战胜利，以为可以唤回世间安宁。然而，一切并未结束。一个偶然，姜子牙发现了原来“封神大战”之下酝酿着更大的阴谋。姜子牙开始踏上探寻真相的旅途......',6.7,'1623176145231692901.jpg'),(254,'消失的情人节','刘冠廷;李霈瑜;黑嘉嘉;周群达;林美秀;马志翔;陈竹昇;庄益增;','喜剧;爱情;奇幻;','中国台湾;','汉语普通话;闽南语;',1623176145849,119,'公车司机阿泰（刘冠廷/饰），是一个动作慢吞吞、连手表的时间、地震的感应都比别人慢的奇葩。他每天都会去邮局，找柜员杨晓淇（李霈瑜/饰）寄一封不知道给谁的平信。柜员杨晓淇和阿泰完全相反，是个凡事抢拍的超级急性子，唯独感情生活毫无进展，年近三十还是母胎单身。情人节前夕，杨晓淇被天菜阳光男刘老师（周群达Duncan/饰）搭讪，终于情窦初开的晓淇和刘老师天雷勾动地火；想不到一觉醒来，刘老师再无音讯、而且情人节居然已经过了？！每天来寄信的阿泰也再也没出现过...毫无记忆的杨晓淇，开始了一趟寻找真相的奇幻旅程...',7.2,'1623176145889340791.jpg'),(255,'女生要革命','哈德莉·罗宾逊;劳伦·蔡;尼科·希拉加;帕特里克·施瓦辛格;西德尼·帕克;安杰利卡·华盛顿;J·J·托塔;艾米·波勒;伊克·巴里霍尔兹;马西娅·盖伊·哈登;约瑟芬·兰福德;Joshua Walker;克拉克·格雷格;罗恩·帕金斯;亚伦·霍利戴;维克托·沃尔夫;格雷格·波勒;凯文·多尔夫;柯瑞·福格尔玛尼斯;布兰迪·赖特;','剧情;喜剧;','美国;','英语;',1623176146502,111,'高中校园里的性别歧视和价值扭曲，让这位害羞的16岁女孩再也受不了了！妈妈的叛逆过往让她灵机一动，匿名发行一份小报，继而引爆风靡全校的成长变革。本片改编自珍妮佛·马修的小说，由艾米·波勒执导。',7.6,'1623176146540893940.jpg'),(256,'消失的情人节','刘冠廷;李霈瑜;黑嘉嘉;周群达;林美秀;马志翔;陈竹昇;庄益增;','喜剧;爱情;奇幻;','中国台湾;','汉语普通话;闽南语;',1623229699813,119,'公车司机阿泰（刘冠廷/饰），是一个动作慢吞吞、连手表的时间、地震的感应都比别人慢的奇葩。他每天都会去邮局，找柜员杨晓淇（李霈瑜/饰）寄一封不知道给谁的平信。柜员杨晓淇和阿泰完全相反，是个凡事抢拍的超级急性子，唯独感情生活毫无进展，年近三十还是母胎单身。情人节前夕，杨晓淇被天菜阳光男刘老师（周群达Duncan/饰）搭讪，终于情窦初开的晓淇和刘老师天雷勾动地火；想不到一觉醒来，刘老师再无音讯、而且情人节居然已经过了？！每天来寄信的阿泰也再也没出现过...毫无记忆的杨晓淇，开始了一趟寻找真相的奇幻旅程...',7.2,'1623229699897851037.jpg'),(257,'从邪恶中拯救我','黄政民;李政宰;朴正民;朴昭怡;崔嬉序; 沈英恩;朴明勋;吴代焕;宋永彰;李书焕;李泰剑;池炫俊;朴宰弘;文正秀 ;金敏植;宋宥弦;林成宰;丰原功补;白龙;水野智则;藏原健;','动作;悬疑;犯罪;','韩国;','韩语;日语;泰语;英语;汉语普通话;',1623229701117,108,'泰国发生震惊人心的绑架事件，完成最后杀人任务的杀手仁南（黄政民饰演），在得知这事件与自己有关之后，随即前往泰国，并与助手开始追查这起事件。另一方面，得知自己兄弟被仁南杀害的雷（李政宰饰演），为了复仇，也前往了泰国。惨烈的暗杀者与无情的追击者，展开了一场没有底线的猛烈追击。',7.2,'1623229701173927984.jpg'),(258,'发财日记','宋小宝;马丽;沙溢;张一山;肖央;艾伦;王祖蓝;魏翔;韩彦博;马汉毅;黄小蕾;肖添仁;','剧情;喜剧;','中国大陆;','汉语普通话;',1623229701981,128,'故事讲述上世纪90年代初，穷小子小宝追随同村“发小儿”二哥，一路从贫穷朴实的东北农村来到了经济飞速发展的深圳。期间，两人无意中收留了一个嗷嗷待哺的婴儿，生活困窘的小宝和二哥该如何将孩子抚养长大？当小宝和二哥与同在深圳打拼的创业女青年马露“狭路相逢”，三人之间又将发生哪些令人捧腹的爆笑故事？一段笑泪参半、起伏跌宕的小人物奋斗史就此展开……',5.9,'1623229702026879054.jpg'),(259,'艾达，怎么了？','贾丝娜·德尤里奇克;伊兹丁·巴乔维奇;Dino Bajrovic;约翰·海尔登贝格;雷蒙德·提哈瑞;波利斯·伊萨科维奇;埃米尔·哈齐哈夫茨比哥维奇;雷豪特·比瑟马克;特恩·吕伊克斯;Juda Goslinga;耶琳娜·科迪奇·库雷特;厄明·布拉沃;伊迪塔·马洛维奇;米哈·赫尔肖夫;桑内·丹·哈托格;艾莉娜·梅尔彻尔;Emina Muftic;玛利洛·尼佐维奇;露娜·米乔维克;乔万·齐瓦诺维奇;埃尔敏·西贾米贾;Boris Ler;Alban Ukaj;','剧情;历史;战争;','波黑;奥地利;罗马尼亚;荷兰;德国;波兰;法国;挪威;土耳其;','塞尔维亚克罗地亚语;波斯尼亚语;英语;荷兰语;塞尔维亚语;',1623229703039,101,'1995年7月，斯雷布雷尼察。艾达是联合国的一名翻译。当塞尔维亚军队入侵波什尼亚克飞地并接管那里的权力时，她和她的家人和其他成千上万的人一样，在联合国营地寻求保护。激烈的政治谈判开始了，阿伊达不得不进行翻译，通过翻译她得知了致命而残酷的信息。但尽管信息的爆炸性极强，她还是坚持着逃脱迫在眉睫的命运的希望。',7.8,'1623229703092437148.jpg'),(260,'温暖的抱抱','常远;李沁;沈腾;乔杉;马丽;艾伦;田雨;王智;魏翔;王宁;黄才伦;张一鸣;王成思;张子栋;陈昊明;吴莫愁;','喜剧;','中国大陆;','汉语普通话;',1623229703809,112,'对整洁和计划有着超乎常人执念的鲍抱（常远饰），本以为自己是一个友情爱情的绝缘体，但在遇到个性率真宋温暖（李沁饰）、妙手“神经”贾医生（沈腾饰）和假仁假义王为仁（乔杉饰）之后，上演了一段阴差阳错的喜剧故事……影片根据韩国电影《计划男》改编。',5.4,'1623229703850251970.jpg'),(261,'大师','安东尼·霍普金斯;艾比·考尼什;安松·蒙特;迪奥拉·拜尔德;埃迪·马森;大卫·摩斯;理查德·布雷克;克里斯·佩尔费蒂;布莱斯·科里根;Jenna Hellmuth;Shay Guthrie;Ryan Jonze;Estelle Girard Parks;Lory Molino;Basil Kershner;','动作;惊悚;犯罪;','美国;','英语;',1623229704625,0,'安东尼·霍普金斯、安森·蒙特(《异人族》《星际迷航：发现号》)、艾比·考尼什(《三块广告牌》《明亮的星》)将主演黑色惊悚片《大师》(TheVirtuoso，暂译)，NickStagliano(《美好的一天》)执导。蒙特饰一个职业杀手，欠下他的导师(霍普金斯)很多，为此他得杀掉最新接受的一个任务目标。但没有任何这个目标的照片和具体描述，他只知道目标会在下午5点，出现在一个死气沉沉的小镇的餐厅里。那么餐厅里任何顾客都可能是这个杀手要杀的人，还有那个神秘的女招待(考尼什)，就算她不是目标，也是一个足够威胁这项任务的存在，她甚至可能危害杀手的生命。该片也即将在#戛纳电影节#卖片。',6.1,'1623229704665117158.jpg'),(262,'蜡笔小新：激战！涂鸦王国和约四位勇士','小林由美子;楢桥美纪;森川智之;兴梠里美;真柴摩利;林玉绪;一龙斋贞友;佐藤智惠;神谷浩史;伊藤静;富永美伊奈;黑泽朋世;森田顺平;七绪春日;富泽美智惠;三石琴乃;玉川纱己子;铃木玲子;大塚瑞惠;伊仓一惠;星野千寿子;山田秋子;大冢智子;茶风林;辻亲八;中田让治;平田广明;玄田哲章;三矢雄二;飞田展男;井上喜久子;小杉十郎太;诹访部顺一;能登麻美子;麻生智久;大西健晴;泷本富士子;山本格;松本健太;田岛章宽;桂一雅;后藤光祐;花藤莲;岩桥由佳;河村梨惠;井之上润;古贺明;安田陆矢;八幡谅;桥本结;小泉濑奈;久保田光;今泉里绪奈;前田晴香;凯莉葩缪葩缪;池田贵史;苹果酱;山田裕贵;','动画;家庭;','日本;','日语;',1623229705449,103,'《蜡笔小新》第28部电影，日本于2020年4月24日上映，本作并为蜡笔小新漫画连载30周年纪念作品。宣传标语有[世界拯救！蜡笔！，本作以涂鸦王国为舞台，讲述小新等四位勇士拯救世界的故事。',8.6,'1623229705493634954.jpg'),(263,'三国志新解','大泉洋;贺来贤人;桥本环奈;山本美月;冈田健史;桥本哲;高桥努;岩田刚典;渡边直美;矶村勇斗;矢本悠马;阿部进之介;半海一晃;室毅;山田孝之;城田优;佐藤二朗;西田敏行;小栗旬;','历史;','日本;','日语;',1623229706262,113,'《三国志》，是围绕公元200年左右，中国后汉时期，魏蜀吴三国争夺天下霸权、群雄割据的相关史实整理而成。这次的电影则是同时担任剧本工作的福田导演，在《三国志》的基础上，增添了新解释的作品。',5.3,'1623229706302929936.jpg'),(264,'沐浴之王','彭昱畅;乔杉;卜冠今;苇青;金世佳;洪剑涛;房子斌;张本煜;黄垲翔;朱时茂;沈南;桑平;白客;柯达;刘循子墨;巴多;孔连顺;李建义;','喜剧;','中国大陆;','汉语普通话;',1623229707080,103,'在一次搓澡服务中，富二代肖翔（彭昱畅饰）和搓澡工周东海（乔杉饰）发生矛盾，让周东海面临生活困境。肖翔因跳伞事故被送到医院记忆全失，周东海恰巧撞见，心生一计，骗肖翔是自己的弟弟并骗回周家澡堂当搓澡工，于是一个富二代开始了一段终身难忘的搓澡生涯……',6.1,'1623229707120587435.jpg'),(265,'穷途鼠的奶酪梦','大仓忠义;成田凌;吉田志织;咲妃美悠;佐藤穗奈美;小原德子;','剧情;同性;','日本;','日语;',1623229708146,131,'大伴恭一（大仓忠义饰），从学生时代起就只与“喜爱自己的女性”交往，不断重复着被动的恋爱，也因为优柔寡断的性格而不断地出轨。大学后辈今之濑涉（成田凌饰）作为出轨调查员在接受主人公妻子的委托后，某日与前辈大伴恭一时隔7年再次相遇，突然向其告白「从很早以前就一直喜欢你了」，并用为其隐瞒出轨事实作为代价要求前辈以身体来交换。在被今之濑死缠烂打地靠近和追求下，最终恭一也体会到了如胸口揪心般的恋爱之痛…',7.6,'1623229708186123496.jpg'),(266,'亲爱的房客','莫子仪;陈淑芳;白润音;吴朋奉;谢琼煖;姚淳耀;是元介;沈威年;王可元;陈雪甄;胡广雯;朱宥丞;林欣怡;','剧情;同性;','中国台湾;','汉语普通话;',1623229709177,106,'林健一（莫子仪饰）是住在顶楼的房客，但他不只照顾年迈患病的房东周秀玉（陈淑芳饰），还收养了她9岁的孙子王悠宇（白润音饰），这一切看似超出普通房客的行为动机，在周秀玉去世后受到质疑，很多人怀疑他是为了顺理成章的获得遗产，他百口莫辩，因为这些举动背后隐藏着一段不被承认的感情，也更是他思念一个人的方式，而那个人正是房东已经过世的儿子…',7.5,'1623229709226391112.jpg'),(267,'兴安岭猎人传说','尚铁龙;林枫烨;','悬疑;恐怖;冒险;','中国大陆;','汉语普通话;',1623229709986,83,'东北民间流传着关于“皇围猎人”的神秘传说，他们世代生存于深山，为帝王守护兴安岭这片龙兴之地的气脉运转。传闻猎人除了精通狩猎之法，更知晓驱鬼通神之术。在东北一处偏僻的山村里，悄然发生一起灭门惨案，在村民们的恳求下，最后一代皇围猎人刘二爷（尚铁龙饰）决定出山调查真相，不想过程中怪事屡现，老林子里的秘密也被渐渐揭开....',6.1,'1623229710027398086.jpg'),(268,'女巫','安妮·海瑟薇;奥克塔维亚·斯宾瑟;斯坦利·图齐;克里斯汀·肯诺恩斯;克里斯·洛克;查尔斯·爱德华兹;尤吉尼亚·克鲁索;西蒙·曼永达;菲利普·斯波;安格斯·瑞特;奥尔拉·欧鲁尔克;吉米·斯达;','喜剧;奇幻;冒险;','美国;墨西哥;英国;','英语;',1623229710813,106,'该片基于罗尔德·达尔（《查理和巧克力工厂》原著作者）所著同名儿童小说，部分设定在挪威，部分设定在英国，讲述一个7岁小男孩和祖母住在一起，这个世界中存在着邪恶女巫，某次他偶遇女巫，被变成了老鼠，他必须尽力阻止她们破坏世界。',5.8,'1623229710855625073.jpg'),(269,'海边的异邦人','村田太志;松冈祯丞;岛村侑;伊藤加奈惠;仲谷明香;佐藤花;坂木孝辅;竹内惠美子;樱井优辉;稻川英里;鸣海龙明;橘龙丸;熊谷健太郎;仪武祐子;天海由梨奈;水野朔;上西哲平;白石兼斗;加藤涉;','爱情;动画;同性;','日本;','日语;',1623229711841,59,'故事讲述住在冲绳离岛上的桥本骏(村田配音)，结识了失去父母的孤独高中生知花实央(松冈配音)，两位少年成了好友。实央为了快点成长为大人，决定离开本岛，两人渐渐断了联系。3年后，实央却再次出现在骏的面前，还大胆告白。',7.2,'1623229711880662171.jpg'),(270,'85年盛夏','菲利克斯·勒费弗尔;本杰明·沃辛;菲莉皮娜·维莱芝;瓦莱丽亚·布鲁尼·泰德斯基;梅尔维尔·珀波;伊莎贝尔·南蒂;洛朗·费尔南德斯;奥罗拉·布鲁坦;布鲁诺·洛歇;约恩·齐默;安托万·西蒙尼;帕特里克·齐默尔曼;塞缪尔·博拉夫曼-芒蒂尔;','剧情;同性;','法国;比利时;','法语;',1623229712689,100,'亚历克西斯（菲利克斯·勒费弗尔FélixLefebvre饰）是一位精力旺盛，向往自由的少年。一天，在独自出海的过程中，亚历克西斯遭遇了意外，所幸得到了大卫（本杰明·沃辛BenjaminVoisin饰）的出手相救才逃过了一劫。这次事件让两个少年迅速建立了深厚的友谊，他们一个放荡不羁古灵精怪，一个沉着稳重心思细腻，简直就是天作之合。然而，当一个名叫凯特（菲莉皮娜·维莱芝PhilippineVelge饰）的女孩出现在两人的生活中时，亚历克西斯和大卫之间的关系开始慢慢出现裂痕。在一次激烈的争吵中，亚历克西斯负气出走，不放心他的大卫驱车在后面追赶，哪知道因此遭遇了车祸命丧黄泉。©豆瓣',6.9,'1623229712733882685.jpg'),(271,'担保','成东日;河智苑;朴昭怡;金熙元;','剧情;','韩国;','韩语;',1623229714284,113,'1993年，仁川，高利贷追讨者头石（成东日饰）和宗培（金熙元饰）想从明子（金允珍饰）处拿回欠款，却因为明子的窘迫只得将她的女儿承利（朴昭怡饰）带走作为担保。因为被人举报，作为非法滞留者的明子遭到驱逐，临行前拜托头石将承利送至其大伯处。本以为承利会被有钱人家收养的头石却发现承利被送到了不该她待的地方，他毅然决定把承利夺回…此去经年，正在中国作为中韩外交事务翻译的承利接到宗培的电话，得知了失踪已久的头石的讯息…',7.8,'1623229714331882725.jpg'),(272,'剧场','山崎贤人;松冈茉优;宽一郎;伊藤沙莉;井口理;浅香航大;上川周作;大友律;三浦诚己;','剧情;爱情;','日本;','日语;',1623229715312,136,'永田从高中开始和朋友建立了一个剧团，他兼任编剧和导演，但剧作由于太过前卫收到了很多差评，剧团面临着即将解散的状态。直到一天，永田在路上向穿着同样鞋子的沙希搭话。梦想成为演员的沙希和永田就这么谈起了恋爱。身无分文的永田搬进了沙希的家里，两人开始了同居生活。沙希无条件地支持着永田追逐梦想，永田也渐渐重新拾起对戏剧的热爱。',7.9,'1623229715357815924.jpg'),(273,'进击的巨人：编年史','梶裕贵;石川由依;井上麻里奈;下野纮;小林优;三上枝织;藤田咲;细谷佳正;桥诘知久;谷山纪章;岛村侑;津田健次郎;朴璐美;小野大辅;神谷浩史;子安武人;','动画;','日本;','日语;',1623229716208,120,'随著上周《进击的巨人》系列动画最终章首回宣传片正式发布之后，稍早官方宣布将以前三季的动画工作室WITSTUDIO所制作共计59话的内容为基础，重新精华编译《进击的巨人》动画版，推出《进击的巨人》系列编年史剧场版《进击的巨人CHRONICLE》，供所有粉丝一次饱览《进击的巨人》动画前三季内容，复习《进击的巨人》早先的剧情并期待最终季的正式推出。',8.6,'1623229716253140810.jpg'),(274,'你的眼睛在追问','吉高由里子;横滨流星;矢部享祐;田山凉成;野间口彻;奥野瑛太;町田启太;风吹淳;般若;坂之上茜;森宽和;','爱情;','日本;','日语;',1623229717320,123,'柏木明香里（吉高由里子饰）是一位个性非常开朗的女孩，曾经，因为一场可怕的交通事故，明香里失去了双亲，虽然自己捡回了一条命，但她失去了大部分的视力。实际上，明香里一直生活在深深的自责之中，将父母的死因归结到自己身上，但平日里，她还是竭力表现出非常乐观的一面，总是给身边的人带去积极的能量。一次偶然中，明香里结识了名为筱崎垒（横滨流星饰）的男孩，垒曾经梦想着成为一名拳击手，却因为种种意外而就此告别拳坛，现在靠着打零工度日。明香里的快乐影响了垒，当垒得知了明香里悲惨的过去和内心的阴暗面后，他决定再度走上擂台，靠打拳赢取奖金来给明香里治眼睛。©豆瓣',7.2,'1623229717376468855.jpg'),(275,'曼克','加里·奥德曼;阿曼达·塞弗里德;莉莉·柯林斯;查尔斯·丹斯;艾利斯·霍华德;汤姆·派福瑞;塔彭丝·米德尔顿;汤姆·伯克;杰米·麦克沙恩;莱文·兰宾;托比·莱昂纳德·摩尔;山姆·特劳顿;约瑟夫·克罗斯;艾维·约斯特;亚当·沙皮罗;费迪南德·金斯利;保罗·福克斯;娜塔莉·丹尼斯·斯皮尔;里克·帕斯夸隆;保罗·卡拉夫特斯;克里斯蒂安·普伦蒂斯;约翰·李·艾姆斯;金斯顿·凡尔内斯;克莱格·罗伯特·扬;贾可琳·贝瑟尼;卡米尔·蒙哥马利;克雷格·韦茨巴赫尔;乔安妮·汤姆森;达娜·林恩·拜伦;斯图瓦特·斯科尔顿;克里斯蒂安·罗伯茨;约翰·帕特里克·舒拉克;','剧情;传记;','美国;','英语;德语;拉丁语;',1623229718817,131,'随着赫尔曼·J·曼凯维奇争分夺秒地完成奥逊·威尔斯的《公民凯恩》剧本，人们将通过这位尖刻的社会评论家兼嗜酒编剧的视角，重新审视20世纪30年代的好莱坞。',7.4,'1623229718866885492.jpg'),(276,'线','菅田将晖;小松菜奈;荣仓奈奈;斋藤工;二阶堂富美;山本美月;高杉真宙;倍赏美津子;竹原皮斯托;松重丰;田中美佐子;山口纱弥加;永岛敏行;成田凌;马场富美加;','爱情;','日本;','日语;',1623229719836,130,'影片灵感来自中岛美雪的同名歌曲，辗转北海道、东京、冲绳、新加坡四地，讲述男主高桥涟和女主园田葵之间跨度长达31年的故事。',6.9,'1623229719879348691.jpg'),(277,'行骗天下JP：公主篇','长泽雅美;东出昌大;小日向文世;白滨亚岚;关水渚;古川雄大;柴田恭兵;北大路欣也;三浦春马;竹内结子;广末凉子;江口洋介;','剧情;喜剧;','日本;','日语;',1623229720838,124,'此次故事舞台设定在新加坡，长泽雅美、东出昌大、小日向文世组成的诈欺三人组的目标是闻名世界的大富豪胡雷盟留下的10兆日元遗产。',7.3,'1623229720887200511.jpg'),(278,'较量2','莫哈恩拉;Meena;Ansiba;Esther Anil;Siddique;Asha Sharath;Saikumar;Murali Gopy;Ganesh Kumar;Anjali Nair;Antony Perumbavoor;Aneesh Menon;Boban Samuel;','剧情;惊悚;犯罪;','印度;','马拉雅拉姆语;',1623229721616,152,'在少年瓦伦失踪六年后，乔治库迪和他的家人目前过着更好的生活，他比以前更富有，除了有线电视平台，他还新开了一家电影院，并打算制作电影。他们的小女儿安努年满18岁，就读于一所寄宿学校，临近毕业。大女儿安珠正计划升学，而母亲拉妮则拼命替大女儿安排婚姻。虽然一家人和和睦睦，但乔治库迪禁止在屋檐下讨论失踪案。该家庭的富裕地位使街坊邻居倍感嫉妒，各种闲言碎语开始流传，而警方由于多次未能破案而颜面尽失，再加上瓦伦父母的苦苦相逼，在多方夹击之下，乔治库迪能否再次保护家人？',7.5,'1623229721657225694.jpg'),(279,'樱','北村匠海;小松菜奈;吉泽亮;小林由依;水谷果穂;山谷花纯;加藤雅也;趙たみ和;寺岛忍;永濑正敏;','剧情;家庭;','日本;','日语;',1623229722410,119,'改编自第152届直木奖的获奖作家西加奈子于2005年出版的畅销书。讲述了一家人在绝望中寻求希望，以及对他们不离不弃的爱犬•樱的故事。平凡的二儿子（北村匠海），帅气逼人的长子（吉沢亮）和对长子有奇怪爱意的美貌妹妹（小松菜奈）,虽然有些奇怪但是幸福的家庭。随着一家人的长兄遭遇车祸，各自的命运发生了翻天覆地的变化……',6.4,'1623229722448985465.jpg'),(280,'我很在乎','裴淳华;彼特·丁拉基;艾莎·冈萨雷斯;黛安·韦斯特;克里斯·梅西纳;小伊塞亚·维特洛克;梅肯·布莱尔;艾丽西亚·维特;达米安·杨;尼古拉斯·罗根;利兹·恩格;乔治亚·莱曼;克里斯·埃弗里特;何塞·冈斯·阿尔维斯;凯文·芬内西;珍妮尔·费格利;杰米·加扎里安;阿德里安·M·蒙波因特;','喜剧;惊悚;犯罪;','英国;','英语;',1623229723258,118,'玛拉（裴淳华RosamundPike饰）经营着一家监护人公司，她专门寻找身体情况欠佳同时又无依无靠的老年人下手，通过并不是那么合法的手段令自己成为他们的法定监护人，将他们送进疗养院，之后便可接手和变卖他们的财产和房产，再将所得据为己有。某日，玛拉将下一个“吞噬”的目标放在了一位名叫珍妮弗（黛安娜·维斯特DianneWiest饰）的老太太身上，经调查，珍妮弗没有任何的亲人，同时又拥有着价值不菲的遗产，简直就是他们的最佳“肥羊”。在一番操作之后，珍妮弗被没收手机关进了疗养院，但此时的玛拉和她的恋人兼合伙人弗兰（艾莎·冈萨雷斯EizaGonzález饰）并不知道的是，她们惹上了一个不该惹，也不能惹的人。©豆瓣',6.3,'1623229723295808044.jpg'),(281,'灰猎犬号','汤姆·汉克斯;斯蒂芬·格拉汉姆;伊丽莎白·苏;迈克尔·本茨;罗布·摩根;大卫·马尔登那多;吉米·坦顿;马特·赫尔姆;汤姆·布里特尼;曼努埃尔·加西亚-鲁尔福;特拉维斯·普里兹比尔斯基;杰里米·丹尼尔·麦登;戴文·德鲁伊;特拉维斯·昆汀;威尔·普伦;乔什·维金斯;迈克尔·卡罗洛;凯莱布·J·塔格德;格雷森·拉塞尔;杰夫·阿德勒;戴夫·戴维斯;李·诺里斯;切特·汉克斯;卡尔·格洛斯曼;马修·祖克;B·马丁·威廉姆斯;乔恩·多纳休;伊恩·詹姆斯·科里特;马克西米利安·奥辛斯基;托马斯·克莱舒曼;','剧情;战争;','美国;加拿大;中国大陆;','英语;',1623229724140,91,'影片讲述二战初期，由37支盟军船只组成的护航舰队在欧内斯特·克劳斯（汤姆·汉克斯饰）舰长率领的一艘美国驱逐舰指挥下，穿越险恶的北大西洋，同时还要与德国U型潜艇狼群的周旋。',7.9,'1623229724181536460.jpg'),(282,'血腥地狱','本·奥图尔;梅格·弗雷泽;卡罗琳·克雷格;马修·桑德兰;Travis Jeffery;Jack Finsterer;David Hill;约书亚·布伦南;阿什丽·罗尔拜克;Sophia Emberson-Bain;Ryan Tarran;Scott George;Daniel Weaver;布拉德·麦克默里;Sean Lynch;吉姆·克诺贝洛赫;丽莎·加赛德;乔伊·维埃拉;克雷格·英汉姆;','惊悚;恐怖;','澳大利亚;美国;','英语;芬兰语;',1623229724886,94,'一个有着神秘过去的男人逃离了这个国家，逃脱了自己的个人地狱-只是到达了一个更加糟糕得多的地方。',6.9,'1623229724925453860.jpg'),(283,'角头外传：浪流连','郑人硕;谢欣颖;柯叔元;曾莞婷;陈竹昇;古斌;黄尚禾;唐振刚;张再兴;吴震亚;王宣;高捷;','剧情;','中国台湾;','汉语普通话;',1623229726175,120,'身为角头的阿庆（郑人硕饰）在北馆角头大哥仁哥的女儿满月宴上，偶遇摄影师小淇（谢欣颖饰），原本水火不容的两人，在一次次的争吵中发现其实自己最在乎对方。阿庆与小淇相爱、相知、相惜、互相扶持，阿庆为小淇解决困难、小淇在阿庆事业遇到瓶颈时给予鼓励。但就在此时湳沆的世界在背地里陷害北馆贩毒，不仅让北馆深陷危机，仁哥与五虎们相继误解阿庆，小淇也因为阿庆受重伤。阿庆分身乏术，痛定思痛决定奋力一搏。',6,'1623229726224970732.jpg'),(284,'最后的前线','阿尔乔姆·古宾;卢博夫·康斯坦丁诺娃;Igor Yudin;亚力克萨·巴杜科夫;叶甫根尼·戴亚特洛夫;谢尔盖·别兹鲁科夫;罗曼·马佳诺夫;叶卡婕琳娜·列德尼科娃;小谢尔盖·邦达尔丘克;达里亚;瓦西里·米什琴科;帕维尔·史顿;迪米特里·布尔热;尼古拉·萨姆索诺夫;卡琳娜·曼德罗夫斯卡娅;','战争;','俄罗斯;','俄语;',1623229727093,136,'这部电影讲述了1941年10月波多尔斯克军校学员在莫斯科郊外英勇抵抗的故事。波多尔斯克步兵和炮兵学校的学员被派往伊林斯基防线，与苏联第43军的部队并肩作战，阻止德军的前进，直到增援部队到达。由于寡不敌众，这些年仅十多岁的年轻人在一场持续近两周的战斗中献出了自己的生命。这场战斗旨在阻止远为优势的德国军队向莫斯科推进。这部电影不仅关于战争。它也关乎爱情，真正的友情，以及从童年到成年的道路。大约3500名学员和他们的指挥官被派去坚守莫斯科郊外的最后一道防线。他们大多数人永远留在那里。',7.5,'1623229727162752876.jpg'),(285,'恋途未卜','潘惠美;久川绫;堀江瞬;井上和彦;井上喜久子;齐藤壮马;佐仓绫音;岛崎信长;铃木球花;田中秀幸;','爱情;动画;','日本;','日语;',1623229727983,103,'偶然相遇、完全不是同一类型的朱里与由奈，以及朱里没有血缘关系的弟弟理央、由奈的青梅竹马和臣，是住在同一所公寓、就读同一所学校的高中一年级生。由奈憧憬着理央，理央对朱里怀抱无法说出口的心意，朱里隐藏着秘密，和臣目击了某个秘密。他们各自的心意复杂地纠结在一起，越是思念对方，就越是和对方错过——痛切的恋情，开始启动。',6.6,'1623229728026545470.jpg'),(286,'乐园之夜','严泰九;全汝彬;车胜元;赵东仁;朴浩山;玄奉植;车顺裴;孙秉浩;李文植;安世彬;张荣男;Greg Chun;诺希尔·达拉尔;安吉拉·林;马修·杨·金;基内·扬;','剧情;','韩国;','韩语;',1623229728797,132,'影片围绕着一个男人和一个女人分别展开，男人是某组织的头号目标人物，而女人则处在生命的尽头。',6.6,'1623229728840458233.jpg'),(287,'蛛丝马迹','丹泽尔·华盛顿;拉米·马雷克;杰瑞德·莱托;克里斯·鲍尔;迈克尔·凯悦;特里·金尼;娜塔丽·莫瑞丝;伊莎贝尔·阿雷扎;乔利斯·贾斯基;格伦·莫肖尔;苏菲亚·威希涅瓦;杰森·詹姆斯·里希特;约翰·哈伦·金;弗雷德里克·凯勒;朱迪斯·斯科特;玛雅·卡赞;奥利维亚·华盛顿;基夫·范登·霍伊维尔;J.唐宁;托马斯·克劳福德;利纳拉·华盛顿;杰夫·科贝特;斯蒂芬妮·埃尔布;萨曼莎·科尔米耶;李·加林顿;迪米特·D·马里诺夫;朱莉娅·维拉;杰克·托帕利安;查理·塞斯顿;埃姆利·贝赫什蒂;汉克·诺思罗普;亚当·哈林顿;凯莉·奥马利;','剧情;惊悚;犯罪;','美国;','英语;',1623229729728,127,'克恩郡巡警乔狄肯，小名狄克（丹泽尔·华盛顿饰），被派往洛杉矶进行本该是趟简单明快的证据收集任务。取而代之的是，他被卷入一场缉捕正肆虐该市的连环杀手之行动。领导缉捕的是洛杉矶郡警长吉姆贝克斯特（拉米·马雷克饰），对狄克的警察直觉大为惊艳，因而私自寻求他的协助。但在两人追踪主要嫌疑人艾伯特史帕玛（杰瑞德·莱托饰）时，贝克斯特浑然不觉该调查勾起了狄克对过去不愉快的回忆，随之出土的黑暗秘密除了威胁案件调查外，可能牵连更剧。',6.5,'1623229729771839792.jpg'),(288,'里夫金的电影节','华莱士·肖恩;吉娜·格申;路易·加瑞尔;克里斯托弗·瓦尔兹;埃伦娜·安纳亚;斯蒂夫·古根伯格;戴米恩·查帕;乔治娜·阿莫罗斯;塞尔希·洛佩斯;道格拉斯·麦克格兰斯;鲍比·斯雷顿;安德莉亚·特勒帕;卢兹·西普里奥塔;本·坦普尔;埃琳娜·桑兹;马努·弗欧拉;戈德莉芙·范·登·布兰特;约翰·西希尔;Yan Tual;娜塔莉亚·迪森塔;','喜剧;','西班牙;美国;意大利;','英语;西班牙语;',1623229730820,88,'讲述一对美国夫妇去参加圣塞巴斯蒂安电影节，却双双出轨：妻子和一个有才华的法国导演发生婚外情，丈夫爱上了一个漂亮的当地女子。',7.2,'1623229730861173689.jpg'),(289,'逃跑','莎拉·保罗森;基拉·艾伦;帕特·希利;埃里克·阿塔瓦尔;布拉德利·索茨基;奥娜莉·艾姆斯;德里克·詹姆斯·特拉普;Clark Webster;Conan Hodgkinson;Carter Heintz;Steve Pacaud;','悬疑;惊悚;恐怖;','美国;','英语;',1623229731674,90,'克洛伊（基拉·艾伦KieraAllen饰）从一出生起就和母亲（莎拉·保罗森SarahPaulson饰）过着相依为命的生活，在她们的世界里，父亲这一角色是从未存在过，也不可提及的。因为早产，克洛伊的健康面临着非常严重的打击，时时刻刻都在遭受着死亡的威胁，可即便如此，母亲也从未放弃过克洛伊，她凭借着自己坚强的力量将克洛伊抚养长大。克洛伊体弱多病，半身不遂只能依靠轮椅行动，母亲是她和外界唯一的联系，在母亲的帮助之下，克洛伊靠着自学参加了大学的入学考试，正在焦急的等待着考试结果的公布。某日，克洛伊对自己每天都要服用的药物产生了怀疑，通过种种调查，她震惊的发现这些药物正是导致自己无法行走的元凶。©豆瓣',6.7,'1623229731713188032.jpg'),(290,'砍人快乐','凯瑟琳·纽顿;文斯·沃恩;阿兰·卢克;凯蒂·芬内朗;米切尔·霍格;尤赖亚·谢尔顿;米沙·奥谢洛维奇;梅丽莎·科拉佐;凯利·拉莫尔·威尔逊;汉娜·拉塞尔;布鲁克·杰伊·泰勒;达娜·德罗里;塞莱斯特·奥康纳;查尔斯·格林;帕蒂·舍尔哈斯;珍妮弗·皮尔斯·马尔萨斯;塞莱斯特·赛德;尼古拉斯·斯塔格尔;戴恩·达文波特;','喜剧;惊悚;恐怖;','美国;','英语;',1623229732532,102,'在与一个精神错乱的连环杀手交换尸体后，一名高中女生发现，她只有不到24小时的时间才能得到永久性的改变。',6.1,'1623229732578704324.jpg'),(291,'致命弯道','夏洛特·维嘉;阿丹·布拉德利;比尔·萨奇;艾玛·杜蒙特;迪伦·麦蒂;黛茜·海德;马修·莫迪恩;Vardaan Arora;阿德里安·法维拉;Rhyan Elizabeth Hanavan;科里·斯科特·艾伦;达米安·马菲;大卫·哈奇森;瓦莱丽·简·帕克;丹尼尔·R·希尔;杰里米·安布勒;','惊悚;恐怖;','德国;美国;英国;','英语;',1623229733552,110,'一群亲密的好朋友决定前往西弗吉尼亚州徒步旅行，却意外遇到在对陌生人不友好的部落，这是一个已经在山里居住了数百年的部落。面对好朋友相继遇难，女主角利用自己的勇敢和智慧保护自己，最终虎口脱险的故事。',5.7,'1623229733594638364.jpg'),(292,'谢里','汤姆·赫兰德;席亚拉·博拉沃;杰克·莱诺;迈克尔·里斯波利;杰弗里·沃尔伯格;福勒斯特·古德勒克;迈克尔·甘多菲尼;丹尼尔·R·希尔;费昂·奥谢;Edward Kagutuzi;奥拉·奥雷比伊;Sam Clemmett;凯恩·扎贾斯;Kyle Harvey;Ann Russo;西奥·巴克利姆-比格斯;普奇·豪尔;何塞·巴勃罗·坎蒂略;小达蒙·韦恩斯;亚当·朗;利亚姆·加里根;弗兰克·布莱克;杰弗里·格罗弗;凯莉·伯格伦德;苏黑尔·达巴赫;乔·罗素;瑞奇·韦恩;克雷格·赫利;托马斯·列农;杰米·布鲁尔;托尼·戈因斯;安娜·科尔韦尔;贾辛特;鲍比·斯科菲尔德;纳尔逊·波尼拉;妮可·福斯特;伯尼·科萨;哈里·赫兰德;','剧情;犯罪;','美国;','英语;',1623229734375,140,'根据尼科·沃克的同名小说改编，故事涉及创伤后应激障碍，故事讲述一个来自富裕家庭的男子本拥有美好生活，此后他远离家乡，到伊拉克成为一名军医，而当他返回家乡后便患上了创伤后应激障碍，此后他吸毒、负债累累，他更是先后抢劫了11家银行。',6.6,'1623229734417447328.jpg'),(293,'世界新闻','汤姆·汉克斯;海伦娜·泽格尔;伊丽莎白·玛维尔;雷·迈克金农;梅尔·温宁汉姆;尼尔·桑迪兰兹;楚克武迪·武吉;托马斯·弗兰西斯·墨菲;米歇尔·坎贝尔;弗莱德·赫钦格;迈克尔·安盖洛·科维诺;斯塔福德·道格拉斯;J·内森·西蒙斯;斯蒂芬妮·希尔;布兰登·韦德纳;汤姆·阿斯特;安迪·卡斯特利奇;克林特·奥本钦;','剧情;动作;西部;冒险;','美国;','英语;',1623229735407,118,'美国内战结束后五年，三场战争的退伍军官杰佛森凯尔基得上尉（汤姆·汉克斯饰），现在以读报人的身份从一个小镇到另一个小镇，和当地居民分享世界各地的精彩新闻。他在德州的平原遇到乔韩娜（海伦娜·泽格尔饰），一个六年前被凯奥瓦印第安人掳走并被收养的十岁女孩。乔韩娜对她未曾体验过的世界充满敌意，而且被迫被送回她的阿姨和姨丈身边。基得上尉答应护送这女孩回到她依照法律应该属于的地方。他们必须在环境严苛的野外跋山涉水好几百英哩，而且这两人在寻找一个他们都可以称为家园的地方时，将面对来自人类和大自然的巨大挑战。该片根据波莱特·吉尔斯同名小说改编。',7.1,'1623229735449728948.jpg'),(294,'神弃之地','汤姆·赫兰德;罗伯特·帕丁森;比尔·斯卡斯加德;海莉·贝内特;丽莉·吉欧;哈利·米尔林;塞巴斯蒂安·斯坦;米娅·华希科沃斯卡;伊莱扎·斯坎伦;杰森·克拉克;道格拉斯·霍奇斯;德鲁·斯塔基;吉文·夏普;露西·浮士德;艾比·格洛弗;克里斯汀·格里菲斯;亚当·弗里斯托;大卫·马尔登那多;莫甘娜·布里吉尔斯;马克·杰弗里·米勒;迈克尔·哈丁;唐纳德·雷·波洛克;格雷戈瑞·凯利;科里·斯科特·艾伦;凯莱布·J·塔格德;菲利普·德沃纳;','剧情;惊悚;犯罪;','美国;','英语;',1623229736419,138,'该片是一部中西部哥特风电影，安东尼奥·坎帕斯(《克里斯汀》)执导，讲述俄亥俄州偏远之地Knockemstiff，男主角WillardRussell绝望地想拯救濒死的妻子，不惜屈服于牺牲，而他的儿子(霍兰德)正从一个在学校被虐待的孩子成长为知道何时出手的男人，角色包括一对连环杀手夫妇、一个考验人的信仰的传教士、一个腐败的当地警长(斯坦)。时间从二战末期到1960年代，地点从南俄亥俄州乡村到西维吉尼亚。',7,'1623229736466194321.jpg'),(295,'花束般的恋爱','菅田将晖;有村架纯;细田佳央太;清原果耶;小田切让;押井守;户田惠子;岩松了;小林薰;韩英惠;中崎敏;小久保寿人;泷内公美;森优作;古川琴音;篠原悠伸;八木亚里纱;佐藤宽太;冈部崇;萩原实里;福山翔大;萩原利久;片山友希;宇野祥平;佐藤玲;水泽绅吾;','剧情;爱情;','日本;','日语;',1623229737611,124,'影片是《四重奏》导演土井裕泰，编剧坂元裕二的大银幕首部合作作品。故事讲述男女主人公因在东京明大前站错过末班电车而偶然相识，之后展开时代、时间、地点、全部的偶然都像命运一样同步的5年恋爱，展现了他们在既非大人也非孩童的时期里，迷茫前行的模样。',8.4,'1623229737654760494.jpg'),(296,'一点就到家','刘昊然;彭昱畅;尹昉;谭卓;张琪;李佳琦;西文;陈瑞生;','剧情;喜剧;','中国大陆;','汉语普通话;',1623229738608,97,'魏晋北（刘昊然饰）、彭秀兵（彭昱畅饰）、李绍群（尹昉饰）三个性格迥异的年轻人从大城市回到云南千年古寨，机缘巧合下共同创业，与古寨“格格不入”的他们用真诚改变了所有人，开启了一段非常疯狂、纯真的梦想之旅。',6.7,'1623229738651619786.jpg'),(297,'我在时间尽头等你','李鸿其;李一桐;范伟;张超;罗辑;郭欣禹;','爱情;奇幻;','中国大陆;','汉语普通话;',1623229739899,115,'林格（李鸿其饰）人生所有美好的记忆，都与邱倩（李一桐饰）有关。一场意外、一块神奇的表彻底改变了两人的人生......时空不断被重置，唯一不变的，是爱你如初的心。',5.5,'1623229739940209994.jpg'),(298,'腿','桂纶镁;杨祐宁;张少怀;李李仁;金士杰;林志儒;陈以文;张立东;王自强;杨丽音;刘亮佐;施名帅;黄健玮;纳豆;刘冠廷;','剧情;喜剧;爱情;','中国台湾;','汉语普通话;闽南话;',1623229741110,115,'钱钰盈（桂纶镁饰）的丈夫郑子汉（杨祐宁饰）在腿部截肢手术后不幸离世，钱钰盈想拿回丈夫被截肢的腿，却被医院百般刁难、互踢皮球，于是一场异想天开的“夺腿计划”就此展开！她缠着外科医生要求帮忙，跑到一般人从未见过的医院地下室，在一包包检体中寻找丈夫的腿，甚至找上内勤人员监控医院合作车辆的GPS，闹到医院院长都来关切…而这段充满黑色幽默的寻腿旅程中，也勾起钱钰盈与郑子汉从相识、相爱到相互亏欠的过往回忆。郑子汉对美丽的国标舞者钱钰盈一见钟情，在照相馆朋友约翰（张少怀饰）的牵线之下成为她的舞伴，两人坠入爱河、步入婚姻，是人人称羡的神仙眷侣。但郑子汉一心想要赚大钱让妻子过美好日子，却让两人的感情逼入绝境，最终形同陌路，没想到两颗心再次靠近时却是在医院里将面临生离死别的时候…',6.3,'1623229741152435229.jpg'),(299,'波拉特2','萨莎·拜伦·科恩;玛丽亚·巴卡洛娃;迈克·彭斯;Rudy Giuliani;','喜剧;','英国;美国;','英语;保加利亚语;希伯来语;',1623229742091,95,'讲述波拉特从哈萨克斯坦再度来到美国的故事。',7.1,'1623229742136963338.jpg'),(300,'法式出口','米歇尔·菲佛;卢卡斯·赫奇斯;崔西·莱茨;维勒莉·玛哈菲;苏珊·柯尼;伊莫琴·普茨;丹妮尔·麦克唐纳;伊萨赫·德·班克尔;丹尼尔·迪托马索;马特·霍兰德;Robert Higden;拉里·戴;朱利安·拜利;Una Kay;瓦拉斯塔·瓦拉纳;','剧情;喜剧;','加拿大;爱尔兰;英国;','英语;',1623229742909,113,'米歇尔·菲佛、卢卡斯·赫奇斯、崔西·莱茨将出演超现实主义喜剧片[法国出口](FrenchExit，暂译)。阿扎泽·雅各布斯将执导这部改编自帕特里克·德维特小说的电影。菲佛饰演60岁的曼哈顿社交名媛弗朗西丝·普莱斯，赫奇斯饰演她没有方向的儿子马尔科姆，莱茨饰演她已故多年的丈夫富兰克林的化身——一只家猫。',6.3,'1623229742954140447.jpg'),(301,'熊出没·狂野大陆','张伟;张秉君;谭笑;','喜剧;科幻;动画;','中国大陆;','汉语普通话;',1623229743790,99,'狗熊岭附近新开业了一个神奇的“狂野大陆”，在那里，通过基因技术人可以自由变身各种动物，享受无比的自由和快乐。导游事业受挫的光头强，阴差阳错与神秘人乐天和熊二组队，参加乐园里奖金丰厚的比赛，却遭遇了队友乐天的背叛，历尽艰险终于获得冠军之际，却意外发现狂野大陆里隐藏着惊天的阴谋......',6.5,'1623229743830389049.jpg'),(302,'胜利号','宋仲基;金泰梨;陈善圭;柳海真;理查德·阿米蒂奇;丹尼尔·乔伊·奥尔布赖特;John D. Michaels;Ana Ruggiero;Milan-Devi LaBrey;Michael Davis;','科幻;','韩国;','俄语;法语;西班牙语;韩语;英语;日语;丹麦语;汉语普通话;阿拉伯语;德语;菲律宾语;',1623229744805,136,'故事讲述2092年，胜利号飞船在太空中展开的冒险，金泰梨饰演胜利号船长，宋仲基饰演问题飞行员。',6.5,'1623229744847292980.jpg'),(303,'最幸福的季节','克里斯汀·斯图尔特;麦肯兹·戴维斯;玛丽·斯汀伯根;维克多·加博;爱丽森·布里;玛丽·霍兰;丹·莱维;奥布瑞·普拉扎;莎拉尤·拉奧;杰克·麦克道曼;安娜·盖斯泰尔;珍妮·加利;蜜雪儿·伯托;卡拉·盖洛;蒂莫西·西蒙斯;劳伦·拉普库斯;肖恩·迈克尔·韦伯;戴恩·卡恩;克里斯托弗·乔恩·贡博什;威廉·卡尼亚;','爱情;同性;','加拿大;美国;','英语;',1623229745581,101,'讲述一个年轻女子准备在家庭一年一度的假日聚会上向女友求婚，结果发现女友还未向保守的父母出柜。',7.1,'1623229745622158202.jpg'),(304,'晴雅集','赵又廷;邓伦;王子文;春夏;汪铎;孙晨竣;徐开骋;欧米德;芦展翔;雎晓雯;王倾;艾米;圣微;','爱情;奇幻;','中国大陆;','汉语普通话;',1623229746411,132,'天都城内频频出现怪象，法师们从各方赶来，试图找到真相。阴阳师晴明（赵又廷饰）在探寻真相的过程中，与武士博雅（邓伦饰）、法师泷夜（春夏饰）、鹤守月（汪铎饰）相识，四人决定联手展开调查。深宫内，公主（王子文饰）背负着巨大秘密，深陷这场迷案中...却未曾料到，这背后暗藏一段哀伤的往事。一场危机悄然来临，在紧急关头，有人为知己、有人为心上人、有人为世间安宁，大家为了守护心中所爱，拼死一战……',5.1,'1623229746450345149.jpg'),(305,'弓蕉园的秘密','陈妤;刘倩妏;孙绽;徐宇霆;','剧情;同性;','中国台湾;','台语;',1623229747216,0,'劇中敘述1979年的暑假，女主角孟娟（陳妤飾演）邀請大學同學書蘭（劉倩妏飾演）到家中的香蕉園幫忙採收。兩人偷偷發展出一段曖昧的情誼，還結伴到美麗島雜誌社為自由人權發聲，眼看彼此找到心之所向，卻渾然不覺踏入白色恐怖的風暴中。',7,'1623229747256717819.jpg'),(306,'前哨','斯科特·伊斯特伍德;奥兰多·布鲁姆;卡赖伯·兰德里·琼斯;雅各布·西皮奥;杰克·凯西;米洛·吉布森;阿历克斯·阿诺;塞莱娜·辛顿;泰勒·约翰·史密斯;科里·哈德里克;巴比·洛克伍德;威尔·阿滕伯勒;法希姆·法兹利;詹姆斯·贾格尔;科瓦米·帕特森;阿尔菲·斯图尔特;','剧情;历史;战争;','保加利亚;美国;','英语;',1623229748640,123,'斯科特·伊斯特伍德、卡赖伯·兰德里·琼斯、奥兰多·布鲁姆将主演MillenniumMedia打造的阿富汗战争题材影片[前哨](TheOutpost，暂译)。罗德·拉里执导影片，影片则根据CNN记者JakeTapper著作改编。影片故事将围绕53名美国士兵的真实故事展开，这些士兵与阿富汗东北部约400名敌方武装分子拉开持久的作战。他们所建造的前哨基地位于巴基斯坦边境仅14英里处的三处陡峭山脉底部。基地则面临塔利班恐怖分子的袭击。而驻扎在那里的士兵则面临着巨大威胁。片中斯科特·伊斯特伍德扮演克林特·罗马沙军士，卡赖伯·兰德里·琼斯扮演专业军士TyMichaelCarter，布鲁姆扮演的BenjaminD.Keating在阿富汗战争中不幸丧生。该片预计将在今年8月展开拍摄，影片也将在戛纳电影节寻找买家。',7.1,'1623229748682781634.jpg'),(307,'鬼灭之刃 柱众会议・蝶屋敷篇','花江夏树;鬼头明里;下野纮;松冈祯丞;','动画;','日本;','日语;',1623229749508,106,'今回放送する『鬼滅の刃』＜柱合会議・蝶屋敷編＞は、アニメ『鬼滅の刃』の第22話～第26話で構成された『竃門炭治郎立志編』の完結編であり、『劇場版「鬼滅の刃」無限列車編』へと続くストーリー。劇場版にも登場する炎柱・煉獄杏寿郎（れんごく・きょうじゅろう）をはじめとする“鬼殺隊”の主軸をなす最強剣士である“柱”たちが初めて一堂に会し登場する“柱合会議”を含む重要エピソードだ。主人公・竃門炭治郎（かまど・たんじろう）が隊士でありながら鬼となった妹・禰豆子（ねずこ）と共に行動していることに対して“隊律違反”を犯したと“柱”たちから裁判を受ける。また那田蜘蛛山で負傷した炭治郎と、同期で仲間の我妻善逸（あがつま・ぜんいつ）、嘴平伊之助（はしびら・いのすけ）の“蝶屋敷”での修行模様や、劇場版へ続くエピソードまでを描いている。＜柱合会議・蝶屋敷編＞のキービジュアル...(展开全部)今回放送する『鬼滅の刃』＜柱合会議・蝶屋敷編＞は、アニメ『鬼滅の刃』の第22話～第26話で構成された『竃門炭治郎立志編』の完結編であり、『劇場版「鬼滅の刃」無限列車編』へと続くストーリー。劇場版にも登場する炎柱・煉獄杏寿郎（れんごく・きょうじゅろう）をはじめとする“鬼殺隊”の主軸をなす最強剣士である“柱”たちが初めて一堂に会し登場する“柱合会議”を含む重要エピソードだ。主人公・竃門炭治郎（かまど・たんじろう）が隊士でありながら鬼となった妹・禰豆子（ねずこ）と共に行動していることに対して“隊律違反”を犯したと“柱”たちから裁判を受ける。また那田蜘蛛山で負傷した炭治郎と、同期で仲間の我妻善逸（あがつま・ぜんいつ）、嘴平伊之助（はしびら・いのすけ）の“蝶屋敷”での修行模様や、劇場版へ続くエピソードまでを描いている。＜柱合会議・蝶屋敷編＞のキービジュアルはアニメーション制作のufotableが今回のために特別に描き下ろした新作ビジュアルだ。9人の柱たちが一堂に会したインパクトある今回のビジュアルは、ファンにはたまらない特別なビジュアルとなっている。さらに、今回の＜柱合会議・蝶屋敷編＞は、この放送のために制作された新規映像などが追加された特別編集版となることが決定！ufotable描き下ろしによる新規提供イラストやスペシャルエンドロール、さらには新作映像が加わったこの＜柱合会議・蝶屋敷編＞はまさに必見！鬼滅ファンの方はもちろん、アニメ『鬼滅の刃』を初めてみる方も、これから『劇場版「鬼滅の刃」無限列車編』を見る方、さらにはすでに劇場版をみた方も含め、楽しめる要素満載の特別編集版となっている。そして、前回の放送で大好評だった豪華プレゼントが当たるデータ放送プレゼント企画「鬼滅の刃キャラクターコレクション」を今回も実施することが決定。ガラガラを回して応募用キーワードを獲得する企画で、番組を3分視聴するごとにガラガラを回せる回数が増え、ガラガラをひくと『鬼滅の刃』のキャラクターカードをデータ放送上でゲットできる。キャラクターカードを10種類以上集めると応募用キーワードが閲覧可能となり「参加賞」への応募が可能になる。前回からキャラクターカードを一新するので、新たに楽しめること間違いなし！「参加賞」プレゼントとして今回、「柱合会議ランダムアクリルスタンド全9種セット」を30名の方に、また全20種類のカードを集めると「竈門禰豆子1/8スケールフィギュア」が10名に当たる「コンプリート賞」にも応募できる。ファンにとっては最高のクリスマスプレゼントになりそうだ。放送を見ながらデータ放送企画も一緒に楽しんでほしい。ぜひこの特別編集版の『鬼滅の刃』＜柱合会議・蝶屋敷編＞をご家族そろってご覧いただきたい。お見逃しなく！！',8.2,'1623229749553151748.jpg'),(308,'亲爱的杀手','郑人硕;邱偲琹;喜翔;黄采仪;郑志伟;','剧情;爱情;','中国台湾;','汉语普通话;',1623229750702,0,'成为杀手需要三个条件：一个委托，一个目标，一个报酬。单亲少女认为人活着也需要三个理由，但活着太苦，既要照顾失智母亲，又要顾店养家，还要被迫出卖身体。轮椅男缺乏自信，与老爸相依为命，渴望异性的温柔，却连召妓也被嫌弃，只能躲在残厕自慰。同是天涯沦落人，可否相濡以沫？亲爱的杀手，可否杀掉痛苦根源？童星出身的邱偲琹，演活悲惨人物，突破过往形象。近年挑战不同角色的郑人硕，饰演下肢瘫痪的弱势力量，再显演技实力。',6.2,'1623229750748387045.jpg'),(309,'工作细胞：细胞大作战','花泽香菜;前野智昭;小野大辅;井上喜久子;长绳麻理亚;早见沙织;行成桃姬;小林裕介;吉田有里;高桥李依;藤原夏海;久保由利香;石田彰;能登麻美子;','喜剧;动画;','日本;','日语;',1623229751934,112,'这是人类的体内。许许多多的细胞勤奋工作的世界。某日白细胞(中性粒细胞)与红细胞，遇见了收留迷路乳酸菌的一般细胞。为了将乳酸菌护送至同伴身边，白细胞(中性粒细胞)与一般细胞向肠道出发。然而他们却与来者不善的最强敌人重逢。「我和你们到底谁才是正义的一方，趁这次弄个清楚吧」再次现身的癌细胞。以及遭到坏菌破坏的肠内环境。体内遭遇前所未有的大危机！？「束手就擒吧癌细胞！」为了守护这个世界，白细胞们(中性粒细胞)向赌上世界命运的大战发起挑战。',7,'1623229751973356000.jpg'),(310,'末日逃生','杰拉德·巴特勒;莫蕾娜·巴卡琳;大卫·丹曼;霍普·戴维斯;罗杰·戴尔·弗洛伊德;安德鲁·巴切勒;梅琳·当吉;霍特·麦克卡兰尼;斯科特·格伦;Randal Gonzalez;里克·帕斯夸隆;Nicola Lambo;阿兰·皮特鲁塞泽维斯基;斯科特·波伊思雷斯;Claire Bronson;Madison Johnson;加里·维克斯;特雷西·邦纳;Brandon Miller;海耶斯·梅居尔;库尔特·岳;克米特·罗里森;布兰登·奎因;约书亚·米克尔;詹姆斯·罗根;兰达尔·阿切尔;凯特·琼斯;肯德里克·克罗斯;莉安·特威登;阿·米切尔;亚当·克罗南;艾琳·法萨诺;迈克·加萨威;帕蒂·舍尔哈斯;','剧情;科幻;灾难;','美国;英国;','英语;',1623229753210,119,'科学家们发现，宇宙中的两颗彗星正在急速向地球逼近，不出意外的话，它们终将撞上地球，给地球带来无法估量的损失。为了避免造成世界级的恐慌，政府封锁了这一消息，偷偷在格陵兰岛建造了非常坚固的堡垒，只有躲进堡垒的人们才能够获得一线生机，而进入堡垒的条件非常的苛刻。杰夫（杰拉德·巴特勒GerardButler饰）是一名建筑工程师，他得到了进入堡垒的机会，于是决定带着妻子艾莉森（莫瑞娜·巴卡琳MorenaBaccarin饰）和儿子内森（罗杰·戴尔·弗洛伊德RogerDaleFloyd饰）一起前往格陵兰岛。哪知道旅途进行到一半，察觉到了事件真相的军方开始了暴乱行动。©豆瓣',5.5,'1623229753260694937.jpg'),(311,'所言所行','卡梅丽雅·乔丹娜;尼尔斯·施内德;樊尚·马凯涅;艾米莉·德奎恩;珍娜·蒂亚姆;纪尧姆·谷伊;茱莉亚·皮亚彤;','爱情;','法国;','法语;',1623229754006,122,'在法国乡间度假期间，已怀孕三个月的德芬要独自接待男朋友方士华的表弟麦森，因为弗朗索瓦的同事生病，他要赶回巴黎代班。在等待他回来的四天中，德芬和麦森逐渐熟络起来并开始互相分享一些非常私密的故事，二人亦因此愈来愈亲近……',7.7,'1623229754045889463.jpg'),(312,'2020去死','塞缪尔·杰克逊;休·格兰特;丽莎·库卓;库梅尔·南贾尼;崔茜·尤玛;萨姆森·卡约;莱斯莉·琼斯;戴安·摩根;克里斯汀·米利欧缇;乔·基瑞;劳伦斯·菲什伯恩;莉莉·沙利文;查理·布鲁克;Angelo Irving;','喜剧;','美国;','英语;',1623229755101,70,'2020：如此[insertdireadjectiveofchoicehere]的一年，就连《黑镜》的创作团队也编不出这样的故事，但这并不意味着他们没有可发挥的余地。《再也不见2020》是一部喜剧，回顾了这可怕的一年，也许一切尚未结束？在这部具有里程碑意义的纪录片式特辑中，一些全球最著名的人物（虚构）采访结合过去12个月的真实影像，交汇成一部叙事合唱曲。',7.2,'1623229755145212461.jpg'),(313,'釜山行2：半岛','姜栋元;李贞贤;权海骁;李来;金敏载;具教焕;金度允;李艺媛;张素妍;文宇振;丹尼尔·乔伊·奥尔布赖特;Si-Won Cha ;Pierce Conran ;Terri Doty ;Geoffrey Giuliano;Christopher Gordon;Yeon-hee Hwang;','动作;惊悚;恐怖;','韩国;','韩语;英语;粤语;',1623229755892,115,'上集列车驶往釜山后，丧尸病毒瞬间全国爆发，4年后的韩国尸毒遍野，被全球孤立，沦为死城。所馀无几的生还者踏上最后一艘难民船，离开被世人遗弃的朝鲜半岛。退伍军人正锡(姜栋元饰)和家人有幸登上难民船，但一上船便发现丧尸潜伏，幸得香港收容，这批韩国人才得以上岸，以「半岛难民」身分在香港重新生活。但正锡受不住金钱诱惑，加入了一个回国窃取巨额美金的行动。他和队友重返韩国，竟然发现仍有一班未受尸毒感染的人在挣扎求存，正锡决定带这班倖存者逃生，他们最后能否成功逃出尸杀半岛？',5.1,'1623229755936582065.jpg'),(314,'恋途未卜','滨边美波;北村匠海;福本莉子;赤楚卫二;','爱情;','日本;','日语;',1623229756709,124,'根据同名少女漫画改编，描绘了4名高中生男女的青春爱情故事。山本朱里（滨边美波）是崇尚现实恋爱的女主角，山本理央（北村匠海）则是她没有血缘关系的弟弟。',6.8,'1623229756757158620.jpg'),(315,'乡下人的悲歌','艾米·亚当斯;格伦·克洛斯;加布里埃尔·巴索;海莉·贝内特;芙蕾达·平托;博·霍普金斯;欧文·艾斯特罗斯;杰西·C·博伊德;史蒂芬·坤肯;申庚;大卫·德怀尔;桑妮·马布雷;埃德·阿玛特鲁多;大卫·德弗里斯;Holly A. Morris;布兰登·赫希;大卫·詹森;斯凯拉·丹尼;威廉·麦克·麦库洛;杰森·戴维斯;科里·查普曼;丹尼尔·R·希尔;乔丹·崔威里恩;谢丽尔·霍华德;托尼·瓦德;泰丝·马里斯·金凯德;玛丽·克拉夫特;杰西卡·米塞尔;西德尼·格蕾丝·卡维尔;Morgan Gao;Ethan Suess;Bill Kelly;Jono Mitchell;','剧情;','美国;','英语;',1623229757686,116,'杰德（加布里埃尔·巴索GabrielBasso饰）是在耶律大学法学院攻读法律的天之骄子，在深造之前，他还是一名杰出的海军陆战队队员，如此出色的履历表令无比璀璨的未来在前方等待着他的到来。可就在这个节骨眼上，杰德收到了来自故乡南俄亥俄州的消息，他不得不返回家乡处理复杂的家庭事务，要是到，当初杰德可是费了好大的劲才从那个一团乱麻的家庭之中挣脱出来。回到家乡后，杰德再度见到了自己喜怒无常、毒瘾缠身的母亲贝芙（艾米·亚当斯AmyAdams饰），这唤醒了他关于过于的糟糕的回忆，与此同时，杰德家族中另一位坚强的女性——他的姥姥（格伦·克洛斯GlennClose饰）的形象也鲜活起来。©豆瓣',7.6,'1623229757725138148.jpg'),(316,'我想结束这一切','杰西·普莱蒙;杰西·巴克利;托妮·科莱特;大卫·休里斯;盖伊·博伊德;哈德莉·罗宾逊;格斯·伯尼;艾比·奎因;蔻碧·米纳菲;安东尼·格拉索;泰迪·库卢卡;杰森·拉尔夫;奥利弗·普莱特;弗雷德里克·沃丁;瑞恩·斯蒂尔;','剧情;惊悚;','美国;','英语;',1623229758887,134,'剧本改编自伊恩·里德同名小说，小说审视了心灵的脆弱和孤独的极限。杰克原本带女友回家见父母，女友一路却在想着“结束这一切”，在杰克改变原定路线后，一切都朝着失控方向发展。',7.3,'1623229758932275348.jpg'),(317,'妙先生','小连杀;宝木中阳;','动画;奇幻;冒险;','中国大陆;','汉语普通话;',1623229760018,89,'影片改编自不思凡(《大护法》)的同名原创短片，由李凌霄执导，彩条屋影业(《哪吒之魔童降世》)出品，讲述一场关于“善恶抉择”的人性考验。',6.3,'1623229760066819676.jpg'),(318,'41舞会','阿方索·埃雷拉;埃米里亚诺·苏里塔;Mabel Cadena;Fernando Becerril;','剧情;同性;传记;','墨西哥;','西班牙语;',1623229760721,93,'本片改编自真实事件。19世纪末，伊格纳西奥·德拉·托雷与墨西哥总统的女儿波费里奥·迪亚斯成婚。伊格纳西奥过着双重生活：他在传统的政治世界中声名鹊起，同时又是秘密社团的成员之一。他一直维持着这种微妙的平衡，直到他结识了社团的第42位成员埃瓦里斯托。一次，他举办的派对（也被称为“秘舞41”）遇到了警方的突袭检查，导致丑闻曝光，引起轩然大波。',6.5,'1623229760782945596.jpg'),(319,'战争幽灵','布伦顿·思韦茨;西奥·罗西;凯尔·加尔纳;斯盖拉·阿斯丁;阿兰·里奇森;莱拉·班基;内森·库珀;丽贝卡·弗林·怀特;卡洛延·赫里斯托夫;亚历山大·贝兰·凯什卡;珊农·麦克凯恩;亚尼莎·米哈伊洛娃;马修·瑞斯;肖恩·托布 ;比利·赞恩;','惊悚;恐怖;战争;','英国;','英语;',1623229761824,95,'故事以二战末期为背景，讲述五人美军小队奉命守护一座法国古堡。不料城堡除了残余的敌军，一股超自然的邪恶力量也正在蓄势待发。小队众人也面临着比战场上更加残酷的威胁。',6.7,'1623229761868504452.jpg'),(320,'开始','亚姆泽·苏基塔什威利;拉蒂·奥奈利;卡卡·金祖拉什威利;Saba Gogichaishvili;Ia Kokiashvili;Mari Kopchenovi;格奥尔基·采列捷利;','剧情;','格鲁吉亚;法国;','格鲁吉亚语;',1623229762790,120,'年轻的耶和华见证会传教士亚娜在一次礼拜中被愤怒的当地人烧毁了她的礼拜场所，她感到十分震惊。她的丈夫大卫设法获得了这次袭击的闭路电视录像。但在他们与年幼的儿子同住的格鲁吉亚偏远村庄里，他对正义的追求引发了一系列事件，他们将发现这个家庭被完全孤立，完全听任敌对的当地警察的摆布。',6.2,'1623229762831386283.jpg'),(321,'神枪手','连姆·尼森;凯瑟琳·温妮克;特蕾莎·鲁伊斯;胡安·巴勃罗·拉瓦;迪兰·科宁;卢斯·雷恩斯;雅各布·佩雷斯;多米尼克·坎塞利埃;蔡斯·马林斯;肖恩A·罗萨莱斯;阿尔弗雷多·奎罗斯;亚历克斯·奈特;格雷森·贝里;安伯·明迪桑德;汤米·拉菲特;王明;卢·伍德曼;','动作;惊悚;','美国;','英语;',1623229763670,108,'海军陆战队退役的神射手吉姆（连姆·尼森饰）在亚利桑那州边境拥有一座牧场，过着离群索居生活的吉姆，某日目睹11岁男孩米格尔和母亲萝莎遭到墨西哥毒贩追杀。在一场激烈枪战后，奄奄一息的萝莎将米格尔托付给吉姆，吉姆决定带着米格尔横跨半个美国，前往芝加哥与家人团聚，两人也建立起一段不平凡的友谊。然而，面对穷追不舍的毒贩杀手，吉姆一路上将运用自己过去在海军陆战队习得的战斗技巧，与这群杀手展开一场生死之战，誓死护送米格尔安全回家……',5.4,'1623229763714491238.jpg'),(322,'猎谎者','王茂蕾;孙梦纯;张圣鹏;秦雪;马小茜;卜志岩;李宏磊;姜无寒;王斌;冯逾;刘宝;','剧情;悬疑;犯罪;','中国大陆;','汉语普通话;',1623229764806,92,'三个月前，某市发生了一起恶性绑架杀人案。三个月后，凶手与被害人都死于车祸。初出茅庐的女警韩烨找到了案件的幸存者林超凡，向他求证案件发生的经过。但随着调查的深入，韩烨发现林超凡的很多证词都存在漏洞，再三逼问之下，林超凡无奈坦白了另一个版本的故事，但案件真相远没有这么简单，几乎每个人都在说谎，而故事也开始不断反转。',7,'1623229764848497431.jpg'),(323,'不日成婚','陈家乐;卫诗雅;朱栢康;谈善言;岑珈其;杨偲泳;邵音音;','喜剧;爱情;','中国香港;','粤语;汉语普通话;',1623229766694,104,'阿佳(陈家乐饰)与可怡（卫诗雅饰）在一个婚礼上相识，两人一拍即合，相爱五年，终于迎来最大的感情危机－“结婚”！女方视结婚为爱的证明；男方视结婚为爱的坟墓，二人在这议题上互有攻守，展开了一场男女之间深层次的角力！可怡的闺蜜Jenny(谈善言饰)与Jessica(杨偲泳饰)出谋献策，教她奇招务求怀孕上身！一旦怀孕，婚事不就势在必行？！阿佳眼见可怡对自己展开“逼婚计划”，惟有在兄弟灰熊（朱栢康饰）与阿健(岑珈其饰)的帮忙下积极迎战，誓要坚守不婚底线！女方计谋被连番识破，Jessica只好掏出杀着－春药！得知消息的灰熊冒着生命危险通风报信，阿佳虽已有所防范，但还是百密一疏，中了可怡的圈套，渡过了极爽快的“无套一夜”！事后阿佳提心吊胆，最反对结婚的浪子阿健立即提出“事后大行动”—务求在黄金三十六小时内，将事后避孕丸偷偷让可怡服下...(展开全部)阿佳(陈家乐饰)与可怡（卫诗雅饰）在一个婚礼上相识，两人一拍即合，相爱五年，终于迎来最大的感情危机－“结婚”！女方视结婚为爱的证明；男方视结婚为爱的坟墓，二人在这议题上互有攻守，展开了一场男女之间深层次的角力！可怡的闺蜜Jenny(谈善言饰)与Jessica(杨偲泳饰)出谋献策，教她奇招务求怀孕上身！一旦怀孕，婚事不就势在必行？！阿佳眼见可怡对自己展开“逼婚计划”，惟有在兄弟灰熊（朱栢康饰）与阿健(岑珈其饰)的帮忙下积极迎战，誓要坚守不婚底线！女方计谋被连番识破，Jessica只好掏出杀着－春药！得知消息的灰熊冒着生命危险通风报信，阿佳虽已有所防范，但还是百密一疏，中了可怡的圈套，渡过了极爽快的“无套一夜”！事后阿佳提心吊胆，最反对结婚的浪子阿健立即提出“事后大行动”—务求在黄金三十六小时内，将事后避孕丸偷偷让可怡服下！然而，阿佳冷静过后，还是打消了念头，但事情最终败露。阿佳百口莫辩，可怡心灰意冷，决绝提出分手。恢复单身的二人心境大不相同，可怡在姐妹的陪伴下走出阴霾，重新出发，将生活的重心放回自身，重拾WorkingHoliday的心愿。那边厢阿佳自以为潇洒，尽情享受单身的自由，但随时间推移却愈发空虚难耐，此时他才明白比起面对婚姻，他最恐惧的，原来是永远失去可怡！为追回即将飞往他国的女友，他当机立断，誓要策划一场“不日成婚”大行动！',5.6,'1623229766735888828.jpg'),(324,'福尔摩斯小姐：失踪的侯爵','米莉·波比·布朗;路易斯·帕特里奇;山姆·克拉弗林;亨利·卡维尔;海伦娜·伯翰·卡特;阿迪勒·阿赫塔尔;费奥纳·肖;弗朗西斯·德·拉·图瓦;苏珊·沃卡曼;伯恩·戈曼;杰伊·辛普森;乔基姆·斯卡利;欧文·阿特拉斯;哈蒂·莫拉汉;克莱尔·拉什布鲁克;埃莉·哈丁顿;丽贝卡·汉森;','剧情;悬疑;犯罪;冒险;','美国;英国;','英语;',1623229767685,123,'故事发生在1884年的英国，伊诺拉（米莉·博比·布朗MillieBobbyBrown饰）正准备迎接自己的16岁生日，哪知道在这一天，她的母亲（海伦娜·伯翰·卡特HelenaBonhamCarter饰）失踪了。大名鼎鼎的名侦探夏洛特福尔摩斯（亨利·卡维尔HenryCavill饰）和麦考夫（山姆·克拉弗林SamClaflin饰）成为了伊诺拉的监护人。面对古灵精怪不受控制的妹妹，两个男人一门心思的想要将她送到专门培养“淑女”的寄宿学校中就读，伊诺拉哪会这样乖乖受人摆布？一言不合之下，她选择了离家出走，只身一人前往伦敦寻找母亲的下落。在旅途中，伊诺拉被卷入了一个非常神秘的案件之中，她化身成为侦探，和自己的哥哥展开了斗智斗勇的较量。©豆瓣',6.1,'1623229767723449413.jpg'),(325,'名侦探柯南：绯色的不在场证明','高山南;山崎和佳奈;小山力也;池田秀一;林原惠美;日高法子;田中敦子;森川智之;','剧情;动作;动画;悬疑;','日本;','日语;',1623229768941,94,'真实身份谜团重重、每个人都有着复杂背景的危险一家——赤井家族。在来叶崖假死的FBI探员赤井秀一，《名侦探柯南绯色的不在证明》以他为中心展开，揭开了赤井秀一、世良真纯、羽田秀吉、玛丽等人的个性，以及他们几人之间的关系。故事的高潮则在讲述赤井秀一华丽复活的“绯色”系列。在某个事件中，赤井秀一的宿敌、代号为波本的安室透从FBI那打听到了“线索”。之后，安室透便深入调查赤井秀一与冲矢昴的关系。在经过了一系列的高智商攻防战后，赤井秀一的回归给所有人带来了冲击。而在这一连串的“不在场证明剧”的真相背后，都有着柯南的身影——《名侦探柯南》系列中不可缺少的赤井一家，该总集篇将彻底解剖他们至今为止的行动轨迹、以及他们与柯南的关系。',6.8,'1623229768984201193.jpg'),(326,'#活着','刘亚仁;朴信惠;李铉旭;全裴修;苏熙静;金丹菲;乔汉俊;','动作;惊悚;灾难;','韩国;','韩语;',1623229770121,98,'讲述突然被不明病毒感染，并失控扩散的城市中，被孤立的幸存者身上发生的故事。刘亚仁将在片中饰演因与世隔绝而幸存的游戏玩家俊宇一角，朴信惠饰演直面极端情况，寻找新的生存方式的幸存者宥彬一角。',5.7,'1623229770164709089.jpg'),(327,'三振集团英语托业班','高雅星;李絮;朴慧秀;赵贤哲;金钟秀;金元海;裴海善;大卫·麦金尼斯;白贤镇;李成旭;崔秀林;李周英;泰勒;','剧情;','韩国;','韩语;',1623229770971,110,'讲述1995年进入公司已有8年，业务能力虽是经验丰富的老手，但因为是高中毕业，所以总是处于最低端。一起听公司托业班的三个朋友合力揭露公司所犯下的不正之风的故事。',7.2,'1623229771011333064.jpg'),(328,'蓝调天后','维奥拉·戴维斯;查德维克·博斯曼;科尔曼·多明戈;格林·特鲁曼;迈克尔·波茨;杰里米·萨默斯;约翰尼·科瓦内;泰勒·佩姬;杜山·布朗;约书亚·哈尔托;奎因·范安特卫普;克洛伊·戴维斯;梅特·纳塔利奥;约翰娜·埃尔米纳·莫伊兹;Onyxx Noel;詹姆斯·西耶斯基;威廉·卡尼亚;','剧情;音乐;','美国;','英语;',1623229772507,94,'20世纪20年代，在芝加哥的一场午后录音中，乐队成员们正在等待开拓性的表演者、传奇的“蓝调之母”玛·雷尼（奥斯卡金像奖得主维奥拉·戴维斯饰），其间气氛变得愈发紧张。录音进行到后期时，无畏又脾气火爆的玛和其白人经纪人及制作人就她的音乐控制权展开了一场意志的较量。雄心勃勃的小号手列维（查德维克·博斯曼饰）非常欣赏玛的女朋友，并决心在音乐行业中占有一席之地，当乐队在工作室幽闭的排演室中等待时，他促使乐手们爆出揭露真相的故事，这将永远改变他们的生活。《蓝调天后》根据两次普利策奖得主奥古斯特·威尔逊的戏剧改编而成，歌颂了蓝调的变革力量以及那些拒绝让社会偏见左右自己价值的艺术家。该电影由乔治·乌尔夫执导，鲁本·桑地亚哥-哈德森进行剧本改编，凭借《藩篱》荣获奥斯卡奖提名的丹泽尔·华盛顿和托德·布莱克担任制片人。科尔曼·多明戈、格林·特鲁曼、迈克尔·波茨、泰勒·...(展开全部)20世纪20年代，在芝加哥的一场午后录音中，乐队成员们正在等待开拓性的表演者、传奇的“蓝调之母”玛·雷尼（奥斯卡金像奖得主维奥拉·戴维斯饰），其间气氛变得愈发紧张。录音进行到后期时，无畏又脾气火爆的玛和其白人经纪人及制作人就她的音乐控制权展开了一场意志的较量。雄心勃勃的小号手列维（查德维克·博斯曼饰）非常欣赏玛的女朋友，并决心在音乐行业中占有一席之地，当乐队在工作室幽闭的排演室中等待时，他促使乐手们爆出揭露真相的故事，这将永远改变他们的生活。《蓝调天后》根据两次普利策奖得主奥古斯特·威尔逊的戏剧改编而成，歌颂了蓝调的变革力量以及那些拒绝让社会偏见左右自己价值的艺术家。该电影由乔治·乌尔夫执导，鲁本·桑地亚哥-哈德森进行剧本改编，凭借《藩篱》荣获奥斯卡奖提名的丹泽尔·华盛顿和托德·布莱克担任制片人。科尔曼·多明戈、格林·特鲁曼、迈克尔·波茨、泰勒·佩姬、杜山·布朗担任联合主演，艾美奖得主布兰福德·马萨利斯进行配乐。',6.5,'1623229772551339599.jpg'),(329,'哦！文姬','罗文姬;李熙俊;崔元英;朴智英;金贵先;李珍珠;金宝静;东铉培;金艺恩;金秀京;金宣敬;金正英;金学善;车顺裴;李圭成;吴昌庆;','喜剧;悬疑;','韩国;','韩语;',1623229773464,109,'讲述不惧危险的的儿子“斗源”和事故唯一的目击者痴呆母亲“文姬”（罗文姬饰）一起寻找伤害孙女普美的肇事逃逸者的同时展开的愉快故事。',7.2,'1623229773505903117.jpg'),(330,'超新星','科林·费尔斯;斯坦利·图齐;皮帕·海伍德;彼得·麦昆;妮娜·马林;伊恩·德赖斯代尔;莎拉·伍德沃德;詹姆斯·德雷福斯;洛丽·坎贝尔;丹妮卡·埃切尔斯;哈勒玛·侯赛因;朱莉·汉南;约翰·艾伦·罗伯茨;','爱情;同性;','英国;','英语;',1623229774287,95,'萨姆与塔斯克(费斯与图奇分饰)是一对相守20年的伴侣，俩人计划驱车穿越英格兰探访朋友、家人和过去待过的地方。自两年前塔斯克被诊断出患有早发性痴呆以来，他们在一起的时间便成了他们之间最重要的事。但是随着旅程的进行，他们对于未来的想法充满冲突，过往的秘密也不断涌现，并且他们对彼此的爱从未像现在这样受到考验。最终，他们还必须面对这样一个问题：面对塔斯克的疾病，彼此相爱意味着什么。',7.3,'1623229774327493027.jpg'),(331,'晨曦将至','永作博美;井浦新;莳田彩珠;Reo Sato;中岛博子;平原哲;Ren Komai;田中伟登;山下莉绪;森田想;叶月瞳;石桥菜津美;利重刚;浅田美代子;','剧情;','日本;','日语;',1623229775328,139,'患有不育症的栗原夫妇通过领养制度迎来了他们可爱的儿子栗原朝斗，然而6年的幸福生活顷刻被打乱——一位困窘落魄的年轻女性突然造访，并坚称自己才是孩子的亲生母亲，然而比起孩子，她似乎更想得到金钱上的补偿…日本著名导演河濑直美的新作关照女性、生育、领养等社会议题，以充满戏剧性和冲击力的笔触再次探讨“母亲”这一身份，以多样的叙事风格为观众提供真切又复杂的情感体验。',7.1,'1623229775368295788.jpg'),(332,'星期一','塞巴斯蒂安·斯坦;丹妮斯·高夫;多米尼克·蒂珀;约戈斯·皮尔帕索珀罗斯;埃莉·特琳古;安德烈亚斯·康斯坦丁诺;索菲亚·库阿丽;西拉斯·楚梅尔卡斯;Chloe Sirene;玛丽萨·特里安德菲里都;奥兰多·希尔;普罗米修斯·阿利费尔;Mihalis Alexakis;亚历山德罗斯·洛戈蒂斯;范吉利斯·穆里基斯;Julie Agoraki;Orfeas Avgoustidis;','剧情;爱情;','英国;希腊;美国;','英语;希腊语;',1623229776526,116,'讲述两个30多岁、有自毁倾向的美国人Mickey和Chloe住在雅典，发展出了海啸般的恋爱：Chloe在希腊的时光本已到了尾声，她该回到美国继续自己有远大前程的工作，但她决定放弃，想要探索一个周末的热情是否会随着不可避免的周一到来而消退。',5.5,'1623229776573691271.jpg'),(333,'埃舍尔街的红色邮筒','茉爱罗;藤田朋子;吹越满;小澤真利奈;诹访太朗;鸟羽润;渡边哲;','剧情;喜剧;','日本;','日语;',1623229777347,146,'园子温新片讲述导演小林正的新片“假面”招募演员，吸引大批想入行的女人前来报名，但是条件只有一个：必须通过实体书信邮寄，而正是红色的邮筒，将所有角色串联到了一起……',7.7,'1623229777392241245.jpg'),(334,'奇奇怪怪：整容液','문남숙;장민혁;조현정;김보영;崔乘训;김소형;강시현;朴圣光;정유정;황창영;','动画;恐怖;','韩国;','韩语;',1623229778533,85,'人气恐怖悬疑韩漫《#整容液#》的改编动画电影发布预告！《整容液》出自韩国漫画家吴城垈脑洞大开的“奇奇怪怪”系列网络漫画，讲述一款名为“整容液”的产品能让人轻易改变容貌与身材，像捏黏土一样轻松变美，女主在使用整容液后成了受欢迎的“女神”，却因其副作用而出现了逐渐失控的展开。影片将于今年8月在韩国上映。',6.2,'1623229778581402121.jpg'),(335,'在回家之后重新开始','古川雄辉;龙星凉;村川绘梨;佐野岳;中岛博子;萤雪次朗;甲本雅裕;三浦理奈;','同性;','日本;','日语;',1623229779380,99,'古川雄辉&龙星凉首次合作！共同出演治愈系纯爱BL漫改电影《在回家之后重新开始》，将于今秋在日本上映！讲述疲于都市生活、遭受人生挫折的傲娇男孤塚光臣（古川雄辉饰），与生活在乡下、性格稳重的男子熊井大和（龙星凉饰）的纯爱故事。',6.6,'1623229779417985581.jpg'),(336,'可不可以，你也刚好喜欢我','陈妤;曹佑宁;林映唯;杨谨华;黄健玮;李杏;陈彦名;程予希;刘名凯;林鹤轩;黄腾浩;','爱情;','中国台湾;','汉语普通话;',1623229780444,108,'改编自肆一的同名作品，导演简学彬的首部剧情长片。描述暗中喜欢着青梅竹马的筱湘，借由塔罗牌算出了告白的最佳时机，但没想到要告白时，青梅竹马和她的好友却告白！？筱湘的初恋会有结果吗？',6.2,'1623229780489123184.jpg'),(337,'地牢女孩','杰克·埃瑟里奇;辛迪妮·科瓦尔斯基;利亚姆·皮莱吉;艾玛·迈尔斯;布拉克斯顿·比肯;杰克·努塔尔;安吉拉·珀金斯;卡门·亚历克西斯;妮娜·勇;小贾斯蒂斯·史密斯;尼克·斯塔尔;乔莉·费舍尔;贾德·尼尔森;伊莎·罗谢尔;金·罗森;斯戴芬妮·斯考特;马克·威尔斯;','剧情;犯罪;','美国;','英语;',1623229781388,88,'根据真实事件改编，一个充满活力的十几岁的女孩莎拉，她期待着她的18岁生日，这样她就可以离开她控制她的父亲唐（贾德·尼尔森）。但在她吹灭蜡烛之前，唐把她关在他们家的地下室里，她的世界变得非常黑暗。当唐试图说服妻子艾琳（乔莉·费希尔饰）莎拉离家出走时，他会偷偷到地下室探望她，折磨并强奸她，而艾琳和她的妹妹艾米（艾米丽·托普饰）继续住在楼上。随着时间的流逝，莎拉生下了几个孩子，独自在地下室里。唐最终抚养了他们最小的儿子，把他留在了门阶上，艾琳发现了他和一张便条，便条上是莎拉写的，说那是她的儿子，她不能照顾他，艾琳最终接受了唐关于莎拉的说法。在被囚禁禁了几十年之后，莎拉终于逃脱了，她的家人知道了20年来发生在他们脚下的毁灭性真相。',6.2,'1623229781425321309.jpg'),(338,'冰下的鱼','高放;周波;庄馨;王莉;崔璐;张弘海;朱艳彬;周洪儒;','剧情;','中国大陆;','汉语普通话;',1623229782227,99,'本片讲述了冬捕开始前的七天里，发生在中国东北一座老工业城市的一个老人的故事。丈夫去世几年后，82岁的赵丽华患上了轻度抑郁症。她打算去职工浴池泡澡，却多次被拒之门外而且遭到羞辱。儿子朱红兵为了找到两个陪护母亲洗澡的女人费尽周折，一个看似简单的日常生活，摆在这对母子面前却显得异常地艰难。母亲最后也没实现在职工浴池泡澡的心愿，尽管她曾在这个工厂工作了一辈子。对于赵丽华而言，“泡澡”是洗礼一般的自我清洁，有尊严地“安乐”地离开，是她最后的选择……',6.7,'1623229782269398809.jpg'),(339,'威利的游乐园','尼古拉斯·凯奇;艾米莉·托斯塔;贝丝·格兰特;里克·赖茨;克里斯·华纳;卡伊·卡德莱茨;凯丽‧考恩;乔纳森·梅赛德斯;特雷勒·希尔;克里斯蒂安·戴尔格罗索;杰西卡·格拉夫斯;泰勒·托尔里;格兰特·克雷默;','动作;惊悚;恐怖;','美国;','英语;西班牙语;',1623229783056,88,'尼古拉斯·凯奇扮演的看门人被迫在一个扭曲的游乐园里过夜，在那里他陷入了一场恶梦。当动画角色们变得栩栩如生时，看门人必须各个攻破，才能活直到早晨并离开游乐园。',5.4,'1623229783094593195.jpg'),(340,'邻居','郑宇;吴达洙;金熙元;李侑菲;郑熙泰;','剧情;悬疑;犯罪;','韩国;','韩语;',1623229819395,130,'故事讲述被软禁在家中的预备大选竞选人和秘密监视邻居的一举一动的国家秘密情报要员，以及隔着一道墙的两个极端职业男子之间可疑而又隐秘的交易。',6.7,'1623229819437432425.jpg'),(341,'母亲','长泽雅美;奥平大兼;阿部隆史;郡司翔;夏帆;皆川猿时;仲野太贺;木野花;土村芳;荒卷全纪;大西信满;浅田芭路;','惊悚;','日本;','日语;',1623229820217,126,'本片是根据实际发生的「少年杀害了祖父母事件」的构思而改编成电影的崭新故事。长泽扮演懒散奔放的母亲·秋子，挑战堕入了社会黑暗面的女人，而阿部サダヲ则饰演与秋子没有结婚登记而同居的丈夫·遼，影片将重点刻画秋子和她年幼的儿子·周平（郡司翔）之间所展开的关系。',6.2,'1623229820260384126.jpg'),(342,'海绵宝宝：营救大冒险','基努·里维斯;奥卡菲娜;克兰西·布朗;汤姆·肯尼;比尔·法格巴克;罗里·艾伦;劳伦斯先生;玛丽·乔·卡特利特;罗德格尔·邦帕斯;吉尔·塔利;卡罗琳·劳伦斯;维罗妮卡·阿利奇诺;','喜剧;动画;冒险;','美国;韩国;墨西哥;日本;西班牙;','英语;西班牙语;阿拉伯语;',1623229821255,91,'《海绵宝宝：营救大冒险》讲述了海绵宝宝心爱的宠物小蜗被绑架后，海绵宝宝和派大星前往失落的大西洋城展开营救冒险的故事。在这场充满危险又妙趣横生的营救行动中，海绵宝宝和他的朋友们用实际行动证明了友谊的力量无限大！',6.2,'1623229821294777805.jpg'),(343,'希望','堤真一;石田百合子;冈田健史;清原果耶;加藤雅也;市毛良枝;松田翔太;龙雷太;','剧情;','日本;','日语;',1623229822386,108,'故事讲述在高级宅邸生活的石川一家的儿子规士，在未经允许的外宿后失踪，他被怀疑与一桩杀人事件有关，因此原本幸福的家庭生活发生改变。',7,'1623229822427338387.jpg'),(344,'常春藤','禹美华;李妍; 金宝敏;','剧情;同性;','韩国;','韩语;',1623229823279,99,'同性恋人恩秀和艺媛幸福地生活在一起。某天，恩秀出了严重的车祸，她的妹妹恩惠因此去世。恩秀妹妹的女儿秀敏变成了孤儿。恩秀和艺媛面临领养秀敏的处境中。《常春藤》是一部让人思考家庭的真正意义的电影。在车祸后，艺媛说，“我们不是一个家吗？家人之间怎么会因为车祸而抛弃彼此？”恩秀回答说，“家庭？谁认为我们是一个家庭？”三个女性如艺媛希望的那样生活在一起，一起经历着日常。但是，社会的成见阻止她们组成一个家庭。这部电影真正的美在于结局。就像도종환的诗作《常春藤》一样，没有幸福或悲伤的结局，即使走了弯路，也一直在缓慢地选择幸福的道路而不会着急。',7.2,'1623229823322753683.jpg'),(345,'想哭的我戴上了猫的面具','志田未来;花江夏树;山寺宏一;小木博明;寿美菜子;小野贤章;浪川大辅;千叶进步;川澄绫子;大原沙耶香;','动画;奇幻;','日本;','日语;',1623229824285,104,'笹木美代（志田未来配音）是一名高中二年级女生，因为总是将自己真实的情感隐藏在心底，因此美代被周围的朋友们称作“无限大神秘人”，实际上，美代是一个非常在意别人看法，时时刻刻都在关心这周围人的女孩。美代暗恋着名叫日之出贤人（花江夏树配音）的男生，但贤人对美代的态度却十分的冷淡。实际上，美代保守着一个秘密，她曾从一个神秘的商人手里得到了一个猫咪面具，只要带上这个面具，美代便可以变成猫咪。变成猫咪后的美代总喜欢前往贤人的家，因为她发现贤人对人类虽然冷漠，但是对猫咪却格外的亲热。美代越来越沉迷于以猫咪的身份和贤人待在一起。©豆瓣',6.4,'1623229824329798668.jpg'),(346,'逃狱兄弟','谭耀文;张继聪;栢天男;张建声;','喜剧;犯罪;','中国香港;','粤语;',1623229825430,88,'龙蛇混杂的监狱世界，一直由江湖巨头滚筒（谭耀文饰）和被判终身监禁的刀疤（张建声饰）两大势力平分天下，却因为冤狱新囚麦建天（栢天男饰）的出现，改变了风平浪静的监狱生活。建天先被刀疤连番威迫放弃上诉，后被揭发与滚筒有着深仇大恨而惨被欺凌，建天为求保命只好接受同仓狱友浩正（张继聪饰）的建议，合谋策划了精密的越狱计划。为了避开邓狱长（黄德斌饰）的严密监管，浩正设局游说滚筒协助，同时却被刀疤识破而被迫接受加盟。就此，狱中四人只好放下成见共同联手，上演一场惊心动魄的逃狱行动！',6,'1623229825475223222.jpg'),(347,'寻找见习魔女','森川葵;松井玲奈;百田夏菜子;千叶千惠巳;秋谷智子;松冈由贵;宍户留美;宫原永海;石田彰;滨野谦太;三浦翔平;','动画;奇幻;','日本;','日语;',1623229826464,92,'影片的设定图也一同曝光。本片是为纪念《小魔女DoReMi》推出20周年而推出，由原动画版原班人马制作。',7.2,'1623229826505324789.jpg'),(348,'之后2','约瑟芬·兰福德;赫洛·费因斯-提芬;迪伦·斯普罗斯;塞尔玛·布莱尔;查理·韦伯;坎迪丝·阿科拉;路易丝·隆巴德;沙恩·保罗·麦吉;塞缪尔·拉森;罗伯·艾斯特斯;迪伦·阿诺德;伊南娜·萨尔基斯;皮亚·米尔;克里麦·威斯特博克;哈迪扎·里德·桑德尔;本杰明·韦弗;玛丽索尔·科雷亚;','剧情;爱情;','美国;','英语;',1623229827553,105,'故事围绕泰莎和哈丁这对情侣展开。迪伦饰演特雷弗，他是泰莎在万斯出版社的同事之一，并爱上了泰莎，这让哈丁感到非常沮丧。',5.8,'1623229827591907837.jpg'),(349,'永生守卫','查理兹·塞隆;琪琪·莱恩;马提亚斯·修奈尔;马尔万·肯扎里;卢卡·马里内利;切瓦特·埃加福;哈利·米尔林;吴青芸;娜塔莎·卡拉姆;梅特·托利;安娜玛丽亚·玛琳卡;迈克尔·沃德;莎拉·尼克斯;马吉德·埃塞迪;乔伊·安沙;安德瑞扎亚茨;奥利维亚·罗斯;奥兰多·希尔;西蒙·钱德勒;拉塞尔·巴洛格;亚当·柯林斯;通恰伊·古奈什;豪尔赫·莱昂·马丁内斯;马汀·麦格;吉米·斯达;','动作;奇幻;','美国;','英语;',1623229828692,125,'一个名叫安迪（查理兹·塞隆饰）的战士领导了一个关系紧密的秘密雇佣兵团体，他们具有神秘的不死之身，为了保护凡人世界而战斗了几个世纪。但团队在受雇执行紧急任务时突然暴露了他们不寻常的能力，他们要依靠安迪和新加入的士兵奈尔（琪琪·莱恩饰），帮助团队消除那些不择手段要复制他们的能力并从中获利的人所带来的威胁。',6.3,'1623229828733758595.jpg'),(350,'骗骗爱上你','纳得克·库吉米亚;平采娜·乐维瑟派布恩;提顶·玛哈由踏纳;卡达莉亚·麦金多斯;邦沙敦·宗威拉克;辰塔维·塔纳西维;','喜剧;爱情;','泰国;','泰语;',1623229829630,127,'天真的伊娜是一名银行员，在历经前男友卷款，并与小三私奔后，过着负债累累的辛苦生活，一场因缘际会下，意外认识了一个外表帅气却十分狡猾的骗子，然而伊娜并没有因此报警，反而决定雇用这名骗子，并对她的前男友展开报复行动，一场谍对谍的爆笑骗局，就此展开！',7.1,'1623229829671312122.jpg'),(351,'绝密档案','西奥·詹姆斯;斯塔西·马汀;罗娜·迈特拉;彼得·费迪南多;莉娅·威廉姆斯;托比·琼斯;Richard Glover;Hans Peterson;Hadisha Sovetova;Imre Csók;Norbert Botszki;Eliza Winter Rothery;Chris Schubert;Timea Maday Kinga;Ami Masamitsu;杰瑞米·惠勒;','科幻;','英国;匈牙利;美国;','英语;',1623229830369,109,'提奥·詹姆斯加盟[绝密档案](Archive，暂译)。该片是[月球]的概念设计者加文·罗瑟里的导演处女作。故事设置在近未来，提奥饰演的科学家，创造出一款与人类十分接近的机器人，他的科研成果背后，却隐藏着不可告人的目的。[摩天大楼]摄影师劳里·罗斯将为本片掌镜。',6.8,'1623229830411504586.jpg'),(352,'无处寻觅','延宇振;李知恩;李周英;金相浩;','剧情;','韩国;','韩语;',1623229831301,85,'入围2019年全州计划。讲述一个男人与不同人交谈后，经历了一系列的心境变化。',6.3,'1623229831344924999.jpg'),(353,'我所有的朋友都死了','米哈尔·迈耶尔;亚当·沃诺维茨;茱莉亚·维尼瓦-纳基维奇;','喜剧;犯罪;','波兰;','波兰语;法语;',1623229832190,96,'在一群朋友的除夕晚会上，一系列疯狂的活动揭露了秘密，伤心了，并导致了令人震惊的结局。',6.6,'1623229832228741201.jpg'),(354,'大地','罗宾·怀特;德米安·比齐尔;莎拉·道恩·普莱奇;金·迪肯斯;沃伦·克里斯蒂;芬莱·沃杰塔克-希松;布拉德·利兰;戴夫·特里布尔;Barb Mitchell;劳拉·延加;','剧情;','美国;','英语;',1623229833046,89,'罗宾·怀特饰演的律师EdeeMathis满怀悲伤，决定把自己的痕迹从社会中抹去。咨询了网络上的求生专家后，她“消失”去了美国最人迹罕至的地带之一：怀俄明州的肖松尼族国家森林。Mathis住在木屋里，学习自己打猎、捕鱼、种植，对抗当地严寒的冬天和残酷的地貌，以及会杀人的野兽。此时，她遇到了印第安人Joseph，为此，她开始直面内心的恶魔，并惊讶地发现，自己的求生意志其实比想象的强烈。',6.9,'1623229833086661690.jpg'),(355,'帕尔默','贾斯汀·汀布莱克;莱德·艾伦;阿丽莎·温赖特;朱诺·坦普尔;朱恩·斯奎布;兰斯·E·尼克尔斯;J·D·埃弗摩尔;迪恩·文特斯;维恩·埃维雷特;杰西·C·博伊德;戴恩·罗兹;斯蒂芬·路易斯·格拉什;尼古拉斯·帕森斯;克莱格·谢佛;约翰·麦康奈尔;查明·李;雷·加斯帕德;杰克·布雷楠;Heaven MacPherson;布鲁斯·威南特;费舍·史蒂芬斯;蒂莫西·辛里奇斯;','剧情;','美国;','英语;',1623229834086,110,'讲述前高中橄榄球明星埃迪·帕尔默在入狱后回到家乡，遭遇了过去留下的种种麻烦事，除此之外，他还成了一个被母亲遗弃的小男孩的监护人。',7.6,'1623229834127243287.jpg'),(356,'剧场版 假面骑士零一 REAL×TIME','高桥文哉;冈田龙太郎;鹤岛乃爱;','科幻;','日本;','日语;',1623229834839,0,'',8.7,'1623229834880728580.jpg'),(357,'飞奔去月球','凯西·昂;菲莉帕·苏;罗伯特·邱;郑肯;约翰·赵;吴珊卓;','动画;家庭;冒险;','美国;中国大陆;','英语;汉语普通话;',1623229836342,100,'影片讲述了小女孩菲菲的奔月故事。菲菲从小听着妈妈讲述的嫦娥与后羿的爱情故事长大，她坚信嫦娥是真爱永恒的化身。妈妈去世几年之后，爸爸准备再婚，菲菲深受打击。为了捍卫自己的家庭，为了向爸爸证明，嫦娥还在月球上永志不渝地等待后羿，她所代表的永恒真爱是真实存在的，菲菲自己动手制作了一艘“火箭飞船“，开启一段奇妙的奔月之旅。影片预计将于2020年在中国院线上映，海外观众可通过Netflix平台欣赏到这一影片。',6.2,'1623229836384200862.jpg'),(358,'云上情歌','芬·奥尔格斯;内芙·坎贝尔;塞布丽娜·卡彭特;麦迪森·伊瑟曼;汤姆·艾弗瑞特·斯科特;里尔·莱尔·哈瓦瑞;Summer H. Howell;薇薇安·安迪克特·道格拉斯;迪兰·埃弗雷特;杰森·玛耶兹;蒂龙·本斯金;Benjamin Eli;Aida Yirga;路易斯·奥利瓦;Morgana Mogent;艾米丽·芭尔多尼;亚尼·金;玛丽莲·迪恩-罗比齐;','剧情;音乐;','美国;','英语;',1623229837201,122,'基于真实故事，美国男孩扎克·索比赫14岁被诊断患有骨肉瘤(18岁去世)，多次手术和化疗并未遏制癌症发展，在得知自己只剩几个月寿命后，他创作了《云》这首歌，感谢自己身边的人和所经历的一切，乐观面对。',7.7,'1623229837245534175.jpg'),(359,'浴血无名川','李东学;任天野;张光北;付美;张露;郝汉;曲家辉;','历史;战争;','中国大陆;','汉语普通话;',1623229838189,96,'影片讲述了抗美援朝战争时期，我国志愿军三排排长孟大关（任天野饰）临危受命，带领小队前去解救被困敌后的侦察排，经历了一系列艰难险阻，三排与“杜神枪”杜川（李东学饰）带领的侦察排成功汇合。为了避免大部队更大伤亡，孟大关与杜川在危急关头果断决定困死无法补充供给的敌方重炮营，一次次小规模战斗在这个无名水川暗暗展开……',6.2,'1623229838231274337.jpg'),(360,'马尔科姆与玛丽','赞达亚;约翰·大卫·华盛顿;','剧情;爱情;','美国;','英语;',1623229839632,106,'讲述一个电影人和女友参加了电影首映庆功会后回家，影片成功在望，名和利唾手可得。而这个美好的夜晚在关于两人关系的一些东西开始曝光后突然转变，考验他们之间爱的力量。',7.2,'1623229839678179270.jpg'),(361,'碧蓝之海','龙星凉;犬饲贵丈;与田祐希;朝比奈彩;小仓优香;石川恋;高岛政宏;','剧情;喜剧;','日本;','日语;',1623229840624,108,'北原伊织（龙星凉饰）在升上大学后，寄宿在叔父所经营的潜水商店「GRANDBLUE」，并且与相隔十年不见的表姐妹—古手川奈奈华（朝比奈彩饰）和古手川千纱（与田佑希饰）同住一个屋檐下生活。对青春大学新生活充满期待的他，被大学潜水社团「PeekaBoo」盯上，殊不知被社团前辈盯上，连热爱二次元世界的友人今村耕平也一起被扯进来，于是展开了一段结合潜水、裸体、酒精、打闹、妄想、恋爱的荒谬大学生活。为什么在大学里全裸狂奔⁉️因为疯狂的青春只有一次‼️',6.6,'1623229840662759334.jpg'),(362,'何塞','塞尔希·洛佩斯;大卫·马赛;瓦莱丽·勒梅西埃;赫拉德·埃尔南德斯;弗朗索瓦·莫雷尔;西尔维娅·佩雷斯·克鲁兹;Emmanuel Vottero;Xavier Serrano;Thomas Vandenberghe;Bruno Solo;Alain Cauchi;Bamar Kane;Alba Pujol;Sophia Aram;','动画;','法国;西班牙;比利时;','法语;西班牙语;加泰罗尼亚语;英语;',1623229841448,74,'西班牙内战时期，人们为了逃离独裁统治而来到了法国。面对大量外来人口的突然涌入，法国当局将他们集中安置，然而生活区的条件十分艰苦。虽然有铁丝网的阻隔，画家何塞还是想尽办法与外界沟通，寻找他失散的伴侣，并且和一位守卫成为了好友。同时插画家出身的导演奥雷尔，最大程度地让何塞的画作重新散发光彩，将其流畅地融于影片之中，着重描绘在艰难逆境中艺术的力量和顽强抗争的精神，完美呼应了主人公之言：“美好的想法，如果不与美好的人相遇，就会消逝。”',7.4,'1623229841493429675.jpg'),(363,'来玩','艾奇·罗伯逊;吉莉安·雅各布斯;小约翰·加拉赫;温斯洛·费格雷;杰登·马林;加文·麦基弗·赖特;蕾切尔·威尔森;阿拉娜·阿什利·马奎斯;达尔默·阿泽德;伊斯汗·莫里斯;','恐怖;家庭;奇幻;','美国;','英语;',1623229842261,97,'孤单的小男孩Olive（艾奇·罗伯逊饰），他觉得自己处处异于其他人。他很想要交朋友，于是他花很多时间在手机和平版上。当一个神秘的生物想要透过Oliver的手机和平板来进入我们的世界，Oliver的父母（吉莉安·雅各布斯GillianJacobs、小约翰·加拉赫JohnGallagherJr.饰）必须挺身而出，将儿子从神秘生物的手中救出。',6.2,'1623229842300937791.jpg'),(364,'GIVEN 被赠与的未来 剧场版','矢野奖吾;内田雄马;中泽匡智;江口拓也;浅沼晋太郎;','动画;','日本;','日语;',1623229843055,59,'高校生の上ノ山立夏は、佐藤真冬の歌声に衝撃を受け、中山春樹、梶秋彦と組んでいるバンドにボーカルとして真冬を加入させる。真冬加入後初のライブを成功させ、バンド「ギヴン」の活動が始動する中、立夏は真冬への想いを自覚し、ふたりは付き合い始める。一方、春樹は長年密かに秋彦に想いを寄せていたが、秋彦は同居人のヴァイオリニスト・村田雨月との関係を続けていて･･･。スクリーンで、春樹と秋彦、雨月の恋が軋んで動き出す――！',8.1,'1623229843093930697.jpg'),(365,'致所有的男孩：爱你永远','拉娜·康多;诺亚·琴蒂内奥;玛德琳娜·亚瑟;埃米利娅·巴拉纳茨;莎拉尤·拉奧;丽莎·杜鲁普;莫莉·格雷斯;C.恩斯特·哈斯;乔伊·帕切科;贾娜尔·帕里希;里什·沙阿;莫莫娜•塔玛达;琼·B·王尔德;Danielle Brokopp;Anisha Cheema;Chloe Simone Crawford;Mariesa Crouse;Michael Delleva;Kayla Deorksen;Katie Do;Sarah Formosa;','喜剧;爱情;','美国;','英语;',1623229844091,115,'即将高中毕业的劳拉准备踏入成人阶段，两段改变人生的旅程使她明白原来毕业后与家人、朋友和彼得的相处并非如想像中那样。',6.8,'1623229844129995047.jpg'),(366,'夺魂连线','海莉·毕晓普;杰玛·摩尔;艾玛·路易斯·韦伯;拉迪娜·德兰多娃;卡罗琳·沃德;艾伦·埃默里斯;帕特里克·沃德;爱德华·利纳德;金妮·洛夫特豪斯;塞兰·巴克斯特;杰克·布莱顿;詹姆斯·斯旺顿;','恐怖;','英国;','英语;',1623229845729,56,'六名好友在居家隔离期找了一位灵媒，想要通过Zoom进行降灵仪式。然而事情的发展远超他们的想象，一个恶灵似乎回应了他们的召唤，并且侵入了每个人的家中……',6.2,'1623229845766906421.jpg'),(367,'贩肤走卒','亚亚·马黑尼;Dea Liane;肯·德·布沃;莫妮卡·贝鲁奇;Saad Lostan;达丽娜·奥乔迪;Jan Dahdoh;克里斯蒂昂·瓦迪姆;Marc de Panda;Najoua Zouhair;胡萨姆·查达特;Nadim Cheikhrouha;Rémi Sarmini;Mouldi Kriden;鲁伯特·韦恩-詹姆斯;安尼萨·达伍德;雅克·热尔曼;','剧情;','突尼斯;法国;比利时;德国;瑞典;土耳其;','阿拉伯语;英语;法语;弗拉芒语;',1623229846787,104,'他自己的身体变成了一件活生生的艺术品，并迅速在博物馆展出，叙利亚难民萨姆很快就会意识到，出售的不仅仅是他的皮肤。',6.9,'1623229846826969909.jpg'),(368,'正义协会：二战','马特·波莫;斯坦娜·卡蒂克;艾尔西亚·罗塔鲁;克里斯·迪亚曼托普洛斯;奥米德·阿布塔西;马修·默瑟;连姆·麦肯泰尔;Armen Taylor;','动画;','美国;','英语;',1623229847748,84,'美国正义协会是一群在第二次世界大战中协助盟军的英雄，他们从未来获得了一位盟友，这位盟友将他们送上了一场改变历史的冒险之旅。',5.8,'1623229847786596170.jpg'),(369,'鲍勃的圣诞礼物','卢克·崔德威;安娜·威尔逊-琼斯;妮娜·瓦迪娅;克里斯蒂娜·托内瑞·杨;蒂姆· 普莱斯特;猫鲍勃;黛西·巴杰;斯特芬·马克尔;法尔杜特·夏尔马;塞林·琼斯;希娜·巴特萨;波皮·露;斯图尔特·惠兰;杰米·培根;艾拉·贾维斯;丹尼尔·厄根;夏兰·凯利;','剧情;喜剧;','英国;','英语;',1623229848810,92,'电影将聚焦詹姆斯和爱喵鲍勃的生活，回顾詹姆斯和流浪猫鲍勃在街头度过的最后一个圣诞节，以及鲍勃如何帮他度过最艰难的时光，探索圣诞节的真谛。',7.5,'1623229848851438843.jpg'),(370,'南巫','徐世顺;蔡宝珠;吴俐璇;云镁鑫;邓壹龄;','剧情;惊悚;','马来西亚;','闽南语;汉语普通话;马来语;泰语;',1623229850212,105,'1987年马泰边界，吉打象屿山下的村落里，村民阿昌是民间神明拿督公的虔诚信仰者，妻子阿燕却不以为然。某日阿昌驱赶神龛前的蛇，不慎打破暹罗裔邻家屋墙。两周后，阿昌突在田埂晕阙，口吐血丝锈钉，村人知悉各圆其说，阿燕全然不信，决意为丈夫遍寻药方。三个月后，阿昌久病不愈，阿燕无计可施，到洞穴祭拜象屿山神。此时，穴内出现一名女子，向她娓娓道出狼牙修时代的传说。霎时之间，阿燕仿如置身边界的融汇与对立，深陷惶恐与未知。本片以精湛的视听语言和炉火纯青的场面调度勾勒出东方神秘主义的新面貌。',7.6,'1623229850252153347.jpg'),(371,'天堂的张望','杜奕衡;朱梓玥;王力可;马瑜遥;吴志雄;刘流;卢秋宏;宫晓瑄;张永达;杜芷萱;','剧情;家庭;儿童;','中国大陆;','汉语普通话;',1623229851259,116,'7岁女孩张望和父亲张国华相依为命，生活虽是清贫，但还是生活的很幸福。一天张望突然流鼻血不止，去医院检查，才知得了急性白血病，治疗需要30多万的费用，筹钱无果的张国华整日以泪洗面；而张望，清楚自己的家庭情况，毅然决定放弃治疗。记者王小月得知此事，赶往张国华家中，才得知了张望的真实身世.....事件经媒体曝光后，张望引起社会各界关注，全国各地纷纷捐款资助，很快，张望的医疗费就凑够了。感受到社会爱的力量和无数陌生人的关心，也使张望变得无比坚强，她用常人难以想象的痛苦接受着治疗，并一次一次经历着鬼门关，然而就在大家都认为张望的病快要好起来的时候，张望却做了一个出乎所有人意料的决定..........',7,'1623229851297869737.jpg'),(372,'食运','片冈直人;土屋太凤;凉;石黑贤;松尾谕;寺胁康文;白竜;東ちづる;矢柴俊博;笕美和子;大泉洋;大和田伸也;龙雷太;','剧情;','日本;','日语;',1623229852690,105,'佐藤良人（NAOTO饰）的母亲安江（凉饰）一个人经营着烤肉店“根岸苑”，这是亡夫留下的唯一的遗物。一个女人独自开店，一边养育儿子，一边亲手做出充满爱意的料理，这对安江来说是幸福的时光，对良人来说，吃母亲亲手做的美食是最幸福的时候。这是深受人们喜爱的“根岸苑”，但由于人气美食评论家古山（松尾谕饰）所写的毫无根据的报道，来店光顾的客人骤减。在店铺一点点恢复活力的时候，良人想让一直一心忙碌工作的安江能够照顾他，于是不久后安江就决定关店了。18年后，良人离开了家，成为一个没有出头之日的自由撰稿人。有一天，他与编辑竹中静香（土屋太凤饰）一同被任命成立只收集“真货”的新美食情报网站。第一弹的主题是“缘分的烤肉”。虽然良人决定接受，但是也为这份工作感到苦恼，此时他收到了关系已经疏远了的母亲安江病倒的消息。良人下不了和母亲见面的决心，通过到访名店进行采访的过程，...(展开全部)佐藤良人（NAOTO饰）的母亲安江（凉饰）一个人经营着烤肉店“根岸苑”，这是亡夫留下的唯一的遗物。一个女人独自开店，一边养育儿子，一边亲手做出充满爱意的料理，这对安江来说是幸福的时光，对良人来说，吃母亲亲手做的美食是最幸福的时候。这是深受人们喜爱的“根岸苑”，但由于人气美食评论家古山（松尾谕饰）所写的毫无根据的报道，来店光顾的客人骤减。在店铺一点点恢复活力的时候，良人想让一直一心忙碌工作的安江能够照顾他，于是不久后安江就决定关店了。18年后，良人离开了家，成为一个没有出头之日的自由撰稿人。有一天，他与编辑竹中静香（土屋太凤饰）一同被任命成立只收集“真货”的新美食情报网站。第一弹的主题是“缘分的烤肉”。虽然良人决定接受，但是也为这份工作感到苦恼，此时他收到了关系已经疏远了的母亲安江病倒的消息。良人下不了和母亲见面的决心，通过到访名店进行采访的过程，他邂逅了令人怀念的“根岸苑”的味道，饱尝了“食”，在与“人”的羁绊中了解了母亲的想法，良人心中也发生了变化。',5.9,'1623229852730481842.jpg'),(373,'小确幸地图','凯瑟琳·纽顿;凯尔·艾伦;约什·汉密尔顿;艾尔·马德里加尔;克莱奥·弗雷泽;Anna Mikami;Vanessa Padla;Teance Blackburn;Jermaine Harris;Lisa VanAmburg;Daniel Scott Lumpkin Jr.;Lydia Houston;Lily Lumpkin;Emmett Ferguson;Douglas DeLisle;','喜剧;爱情;奇幻;','美国;','英语;',1623229853625,99,'Margaret和Mark都被困在不断循环重复的一天，他们都以为只有自己被困住了，直到他们碰到彼此。他们试图制作一张地图，记录所有以前被他们所忽视的小确幸。期间，他们也不断地了解彼此，也找到了打破循环的方法。',6.9,'1623229853666160318.jpg'),(374,'馗降：粽邪2','李康生;陈博正;雷洪;','恐怖;','中国台湾;','汉语普通话;',1623229854532,105,'《馗降：粽邪2》延续第一集宫庙民俗的侧写，将镜头伸向传统送肉粽仪式中最重要的桥段—跳锺馗，通常会由事主家属聘请专门的法师扮演锺馗，将上吊亡灵的怨气送到海口祭吊煞，以达到驱邪避凶之效。本片锺馗便由影帝饰演，李康生在剧中的角色自幼带有天命能见阴阳，他却因此命运多舛，所幸由雷洪饰演的金龙师点化开悟，成为锺馗身为民除煞。然而他的命运却没有从此一帆风顺……今年因为疫情肆虐，戏院排片也饱受影响，目前《馗降：粽邪2》仍定档今年农曆七月，希望鬼门大开之时，藉由鬼王出巡的气势，为大家驱疫除害。',5.9,'1623229854571128153.jpg'),(375,'别对映像研出手！','斋藤飞鸟;山下美月;梅泽美波;小西樱子;滨边美波;板垣瑞生;樱田日和;赤楚卫二;福本莉子;','喜剧;','日本;','日语;',1623229855327,120,'高中1年级学生浅草绿（斋藤飞鸟饰），是强调“设定即生命”的动画迷。在素描本上描绘积累各种各样的想法，却因不能一个人行动做事而无法迈出走向动画制作的一步。对于浅草这种才能，拥有制片人气质的金森沙耶加（梅泽美波饰）很快注意到了。同时，了解到同学兼新星读者模特的水崎燕（山下美月饰），其实上希望成为动画家，3人为了展现脑内“最强的世界”而设立了映像研。电影版『别对映像研出手！』2020年初夏上映',6.4,'1623229855369767299.jpg'),(376,'阴声','鲁道夫 桑丘;安娜·费尔南德斯;拉蒙·巴雷阿;贝伦·法布拉;卢卡斯·布拉斯;内瑞雅·巴德洛斯;比阿特丽斯·阿荷纳;何塞·贝穆德斯;何塞·路易斯·洛萨诺;鲁本·科尔沃;罗莎·阿尔瓦雷斯;阿尔瓦罗·丰塔尔巴;安托·托罗;哈维尔·博泰特;维提·苏亚雷斯;蕾·瓦蕾拉;','恐怖;','西班牙;','西班牙语;',1623229856177,97,'丹尼尔的幼子在新家离奇死亡后，，他开始听见诡异的的，求救声，只得求助一位一位知名的灵异专家。',6.4,'1623229856215810079.jpg'),(377,'怪胎','林柏宏;谢欣颖;张少怀;钟瑶;钟政均;钟岳纯;','喜剧;爱情;','中国台湾;','汉语普通话;',1623229857101,100,'两个怪胎相遇之后彼此的怪，不再奇怪亚洲首部iPhone拍摄剧情长片在爱情的世界裡，我们是彼此的怪胎。陈柏青是一名严重神经性强迫症患者，有非常严重的洁癖。每月的15号是柏青唯一一天出门採买的日子，就在某个命运的15号，他遇见了与他「同病相怜」的另一个怪胎—陈静。原本以为自己要永远孤单活在这世界上的两人，老天爷让他们相遇，发展出一尘不染的爱情，彷彿拥有了彼此就不再害怕被世界遗弃。然而这段看似命中注定的关係，却在柏青的强迫症突然消失后，渐渐的变了调…爱情的承诺，真的能永保新鲜吗？',7.1,'1623229857140813007.jpg'),(378,'克劳德夫人','卡罗勒·罗谢;加朗斯·马里利埃;罗什迪·泽姆;皮埃尔·德隆尚;莱娅·奥普莱;保罗·艾米;米兰妮·让帕诺米;阿弗西娅·埃尔奇;里贾纳·阿尼基;安娜贝尔·贝尔蒙多;约瑟芬·德·拉·波美;吉娜·希门尼斯;苏珊·卡门·贾戈金斯卡;芭芭拉·约瑟夫;布里吉特·海伦·莫雷尔;塞德里克·阿皮耶托;萨米尔·盖丝米;菲利普·雷博;班哲明·比欧雷;亚历珊德拉·耶尔马克;','剧情;爱情;传记;','法国;','法语;',1623229857995,112,'Paris,thelate1960s.MadameClaudeisattheheadofaflourishingbusinessdedicatedtoprostitutionthatgivesherpoweroverboththefrenchpoliticalandcriminalworlds.Buttheendofherempireiscloserthanshethinks.',6.1,'1623229858033653990.jpg'),(379,'午夜天空','乔治·克鲁尼;菲丽希缇·琼斯;大卫·奥伊罗;凯尔·钱德勒;德米安·比齐尔;蒂凡尼·布恩;苏菲·兰朵;伊森·派克;蒂姆·罗斯;米利亚姆·肖尔;利利娅·诺特·拉林斯多蒂尔;汉娜·玛丽亚·卡尔斯多蒂尔;阿特利·奧斯卡·法奈森;伊登·黑赫斯特;莎拉·盖林;尼克·欧文福特;','剧情;科幻;惊悚;奇幻;','美国;','英语;',1623229859242,122,'神秘的全球性灾难爆发，一位独自驻扎北极的科学家竭力与一群返回地球的宇航员取得联系，他们正要回到惨遭神秘灾难重创的地球。',5.9,'1623229859288890832.jpg'),(380,'精神错乱','罗素·克劳;凯伦·皮斯托里斯;加布里埃尔·贝特曼;吉米·辛普森;奥斯汀·麦肯齐;朱丽叶·乔伊纳;斯蒂芬·路易斯·格拉什;安妮·雷登;德文·泰勒;西尔维娅·格雷丝·克里姆;维维安·弗莱明·阿尔瓦雷斯;萨曼莎·博利厄;露西·浮士德;谢丽尔·布朗;迈克尔·帕帕约翰;格蕾琴·科尔纳;唐娜·杜普兰提尔;布雷特·斯姆兹;安德鲁·莫尔加多;戈登·德克海默;蒂莫西·辛里奇斯;','惊悚;','美国;','英语;',1623229860442,90,'瑞秋（凯伦·皮斯托里斯CarenPistorius饰）和丈夫正在分居之中，目前由她独自抚养着年幼的儿子凯伊（加布里埃尔·贝特曼GabrielBateman饰）。离婚事宜的商讨令瑞秋心力交瘁，睡过头的她眼看着就要迟到，却不巧碰上了高速公路大堵车。明明是绿灯，瑞秋却被停在她前面的一辆大卡车拦住了去路，失去耐心的瑞秋狂按喇叭，哪知道却惹恼了卡车司机（罗素·克劳RussellCrowe饰）。卡车司机命令瑞秋为她的不礼貌而道歉，瑞秋拒绝了，此时的瑞秋还并没有意识到，自己已经引火烧身。卡车司机是一名精神病患者，刚刚放火烧死了要同自己离婚的前妻一家子。他掉包了瑞秋的手机，开始对她进行人肉搜索和疯狂报复。©豆瓣',6.2,'1623229860481560796.jpg'),(381,'西游记之再世妖王','边江;张磊;蔡海婷;苏尚卿;张赫;林强;刘思岑;王晨光;宝木中阳;章斌 ;常进;图特哈蒙;张遥函;白雪岑;邱秋;常文涛;李嘉祥;','动作;动画;奇幻;','中国大陆;','汉语普通话;',1623229861306,95,'混沌初开之时，世上的第一只妖降世，名元蒂（张磊配音），被奉为妖祖。千百万年后，昔日妖王孙悟空（边江配音）被唐僧（苏尚卿饰）从五行山下救出，悟空答应保护唐僧，前往西天取经。而传说中的妖祖元蒂再次现世，三界岌岌可危。两代妖王注定终极一战，但这次，孙悟空遇上了真正的劲敌。',5.5,'1623229861348334482.jpg'),(382,'尤巴县突发新闻','艾莉森·珍妮;米拉·库尼斯;奥卡菲娜;旺达·塞克丝;马修·莫迪恩;萨米拉·威利;艾伦·巴金;朱丽叶特·刘易斯;雷吉娜·赫尔;吉米·辛普森;克里斯·劳威尔;小克利夫顿·克林斯;布里奇特·埃弗里特;马塞拉·伦茨·波普;多米尼克·伯吉斯;露西·浮士德;申庚;西尔维娅·格雷丝·克里姆;迪内·泰勒;T·C·马特恩;彼得·詹梅斯;','喜剧;犯罪;','英国;美国;','英语;',1623229862154,96,'苏·宝特姆斯(珍妮饰)将丈夫与一个女子捉奸在床，却没成想，她的丈夫被吓到心脏病发离世。苏随即把丈夫尸身埋掉。老公的消失，倒是让苏的名望、地位日益增长。但是苏很快发现，她自己不仅要躲避警察和罪犯，更要对她那迫切想要获得猛料的新闻主播妹妹南希三缄其口。',6.6,'1623229862192391290.jpg'),(383,'清白','申惠善;裴宗玉;许峻豪;洪京;太恒浩;高昌锡;朴哲民;车顺裴;郑仁谦;韩利进;崔宏一;金重熙;夏成光;韩哲宇; 郭子亨;郑爱华;李智友;申文成;金英在;金锡勋;朴成根;裴海善;朴振英;','剧情;','韩国;','韩语;',1623229863153,110,'从小因父亲重男轻女，贞仁（申惠善饰演）在中学时就逃家自力更生，与家人断了联系。贞仁后来凭一己之力成为顶级辩护律师，在一次偶然中，她得知罹患老年痴呆症的母亲花子（裴宗玉饰演）涉嫌杀害父亲，同时还对不少无辜民众下毒手。怀疑事有蹊翘的贞仁决定亲自出马，在层层阻挠下，她该如何为母亲翻供，揭开这个桩谋杀案背后不可告人的真相？',6.8,'1623229863195231536.jpg'),(384,'人数之町','中村伦也;石桥静河;立花惠理;山中聪;柳英里纱;','剧情;悬疑;','日本;','日语;',1623229864109,111,'影片以一个“绝不能离开”的小镇为舞台，讲述被追债的主人公“苍山”，在某日受到一名神秘男子的邀请而来到这个奇怪的小镇，他在和当地人的交流中逐渐了解了这里的秘密…。',6.3,'1623229864152139572.jpg'),(385,'野马分鬃','周游;郑英辰;王小木;佟林楷;赵多娜;刘禹霆;李梦;','剧情;','中国大陆;','汉语普通话;',1623229865051,134,'大学即将毕业的阿坤正站在大学和社会的分水岭上，他像所有急于驰骋的少年一样，迫不及待要好好闯荡一番。拿到驾照后，阿坤邂逅了自己的二手吉普车，本以为它会给生活带来新的可能，但它却将自己带到了人生的另一个路口。在这段荒腔走板的日子中，阿坤逐渐意识到了成长的代价和生命的无常。',7,'1623229865092301975.jpg'),(386,'偶然与想象','古川琴音;涩川清彦;占部房子;中岛步;玄理;森郁月;甲斐翔真;河井青叶;','剧情;爱情;','日本;','日语;',1623229865770,121,'影片由三个短片构成——《魔法（比魔法更不真切）》《开着的门》《再来一次》。女性角色的多重性和镜像性是滨口之前的作品中的主题，在他的新作《偶然与想象》中也是如此。前作《欢乐时光》和《夜以继日》，从字面上看，颇有小说的味道，而《偶然与想象》则可以说是一部短篇小说集。叙事节奏更强化了这一印象：三集，每集围绕一个女性角色展开，又分为三幕。三个短片讲述了一个意想不到的三角恋、一场未遂的诱惑和一个因误会而相遇的故事。尽管零散，但仍保持了有机的叙事流程，甚至还强调了这一点。虽然大部分的动作都发生在一个空间里，而且只有两个演员参与，这部电影却不让人觉得像一出室内剧。这不仅仅是由于对话的缘故，还在于其复杂的时空概念，最后一集几乎变成了科幻片。我们所见证的时刻都与感人的普遍命运相连，以选择、遗憾、欺骗和巧合为标志，它们是影片真正的主角。',8.7,'1623229865807299334.jpg'),(387,'超能计划','杰米·福克斯;约瑟夫·高登-莱维特;多米尼克·菲什巴克;罗德里戈·桑托罗;考特尼·万斯;艾米·兰德克;机关枪凯利;泰特·弗莱彻;阿伦·马尔多纳多;安德烈·沃德·哈蒙德;可亚娜·西蒙妮·辛普森;C.J.勒布朗;CG刘易斯;约瑟夫·波利昆;雅茨·德·利瑟尔;凯西·奈斯泰德;珍妮特·罗斯·阮;吉姆·克洛克;乔恩·阿兹;戴恩·罗兹;怀尔德·韦恩;贾斯汀·贾木什;戈登·德克海默;卢克·霍克斯;彼得·詹梅斯;托尼·查普曼·斯蒂尔;约书亚·萨达索;','动作;科幻;犯罪;','美国;','英语;',1623229866668,111,'在新奥尔良的街道上，关于神秘新药丸的消息开始传播开来，这种药丸可以解锁每位使用者独特的超能力。但问题是：在服用之前，没人知道用药后会发生什么。一些人会进化出防弹皮肤、隐形能力和超强力量，也有很多人会表现出更致命的反应。但是，当药丸使城市内的犯罪升级到危险水平时，当地警察（约瑟夫·高登-莱维特饰）与一名少女小贩（多米尼克·菲什巴克饰）和誓报私仇的退伍士兵（杰米·福克斯饰）联手以硬碰硬，他们冒着服用药丸的风险，以追踪并制止制造出该药丸的团队。',5.7,'1623229866704784021.jpg'),(388,'科拉深孔','米莱纳拉·德罗维奇;谢尔盖·伊万俞科;尼克雷·柯维巴斯;瓦季姆·德姆乔格;基里尔·柯维巴斯;尼基塔·德俞班诺夫;阿宾娜·柴基纳;伊利亚·伊林尼赫;弗拉迪米尔·柯里达;Viktor Nizovoy;Maksim Radugin;达尔雅·沙加尔;Evgeniy Tscherkashin;Artyom Tsukanov;','科幻;恐怖;','俄罗斯;','俄语;',1623229868114,113,'故事聚焦在一支研究团队，他们被派到科拉深孔（KolaSuperdeepBorehole）去调查源自于深处的奇怪声音，他们却发现超乎他们所有想像的东西。更糟的是，他们可能无意间将躲藏在深处的东西给释放了出来。',5.5,'1623229868157381303.jpg'),(389,'凶宅怪谈','龟梨和也;奈绪;濑户康史;木下邦家;江口德子;Megumi;真鱼;泷川英次;加藤谅;坂口涼太郎;宇野祥平;高田纯次;小手伸也;有野晋哉;滨口优;','剧情;恐怖;','日本;','日语;',1623229869070,111,'该片改编自寻找凶宅租住的艺人松原田螺根据真实经历创作的同名小说，龟梨和也饰演没什么名气的艺人山野，他因节目需求被制作人安排去住凶宅，故事就从他住进发生杀人案的凶宅后开始。',5.4,'1623229869107986079.jpg'),(390,'美国诉比莉·哈乐黛','安德拉·戴;崔凡特·罗兹;加内特·赫德兰;娜塔莎·雷昂;泰勒·詹姆斯·威廉姆;托恩·贝尔;罗布·摩根;丹娜·格瑞尔;达明·乔伊·伦道夫;伊万·罗斯;梅尔文·格雷格;埃里克·拉雷·哈维;崔斯坦·D·拉勒;夸西·宋桂;艾丽嘉·奥特雷恩;乔·柯布登 ;亚瑟·霍尔顿;乔纳森·希金斯;杰夫·科贝特;卡尔·格拉戈萨斯;阿莱恩·古勒姆;马克·安东尼·克鲁帕;杜桑恩·杜基齐;西尔维亚·斯图尔特;凯瑟琳·勒米厄;西蒙·阿兰;','剧情;音乐;传记;','美国;','英语;',1623229870135,130,'讲述她被美国联邦麻醉品管理局派卧底设局，黑人特工JimmyFletcher领导此行动，与荷莉戴展开了一场热烈的情事，展现她挣扎于药瘾、名声和让人心碎的爱情。',5.9,'1623229870172541606.jpg');

/*Table structure for table `order` */

