/*Table structure for table `studio` */

DROP TABLE IF EXISTS `studio`;

CREATE TABLE `studio` (
  `studio_id` int(2) NOT NULL AUTO_INCREMENT COMMENT '演出厅id',
  `studio_name` char(15) NOT NULL COMMENT '演出厅名称',
  `studio_row_count` int(2) NOT NULL COMMENT '演出厅行数',
  `studio_col_count` int(2) NOT NULL COMMENT '演出厅列数',
  `studio_status` int(1) NOT NULL DEFAULT '1' COMMENT '1 启用；0 禁用',
  PRIMARY KEY (`studio_id`),
  UNIQUE KEY `studio_name` (`studio_name`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;

